INSERT INTO Courses (CourseID, CourseSubject, CourseNumber, CourseName, MinCredits, MaxCredits, GradeMode, CourseDesc, DepartmentID, LevelID) VALUES
	(1,N'ACCT',N'B225',N'Fundamentals of Accounting I',3,NULL,N'Standard Letter',N'(Prerequisite: MATH B111) External financial reporting for business entities, including income measurement and determination of financial position.',1,NULL),
	(2,N'ACCT',N'B226',N'Fundamentals of Accounting II',3,NULL,N'Standard Letter',N'(Prerequisite: ACCT B225 with a grade of �C� or higher; MGSC B290 or CSCI B101) Internal managerial and cost accounting, including budgeting, cost determination and analysis.',1,NULL),
	(3,N'ACCT',N'B325',N'Fraud Examination',3,NULL,N'Standard Letter',N'(Prerequisite: ACCT B226) An overview of the different types of fraud, how and why they are committed, and the methodology for investigating and resolving allegations of fraud. Special emphasis is placed on detection and deterrence.',1,NULL),
	(4,N'ACCT',N'B335',N'Survey of Federal Taxation',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of �C� or higher in ACCT B226) Federal tax law and preparation of individual income tax returns.',1,NULL),
	(5,N'ACCT',N'B345',N'Accounting Information Systems',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of �C� or higher in ACCT B226) Accounting systems for business decision-making and effective control of the business enterprise.',1,NULL),
	(6,N'ACCT',N'B355',N'Cost Accounting',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of �C� or higher in ACCT B226) Preparation, critical analysis and use of management accounting information for purposes of strategic decision making, planning and control and performance measurement and evaluation.',1,NULL),
	(7,N'ACCT',N'B425',N'Intermediate Accounting I',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of �C� or higher in ACCT B226) A detailed study of the preparation and presentation of the balance sheet, income statement, statement of retained earnings, and statement of cash flows. Includes a comprehensive analysis of financial transactions related to revenues and assets, with an emphasis on revenue recognition, and asset valuation issues.',1,NULL),
	(8,N'ACCT',N'B426',N'Intermediate Accounting II',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of �C� or higher in ACCT B425) A continuation of the detailed study of the preparation and presentation of financial statements. Problem solving techniques and the ability to structure problem solutions will be stressed.',1,NULL),
	(9,N'ACCT',N'B429',N'Internship in Accounting',2,6,N'Standard Letter',N'(Prerequisite: ACCT B226 and one upper level accounting concentration class with a grade of �C� or higher; and consent of the instructor) Experiential learning in a public or private accounting setting. This course may be repeated once with the approval of the Department Chair and consent of the Instructor. ',1,NULL),
	(10,N'ACCT',N'B437',N'Advanced Accounting',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in ACCT B426) The detailed study of special advanced topics of accounting, including (1) accounting for business mergers and consolidations, subsequent activities and consolidated reporting of financial information, (2) tax topics for business combinations, (3) relevant International Financial Reporting Standards, (4) accounting for legal reorganizations and liquidations, and (5) accounting for partnership formations, operations, and terminations.',1,NULL),
	(11,N'ACCT',N'B485',N'Auditing',3,NULL,N'Standard Letter',N'(Prerequisites: ACCT B426, STAT B201) Principles of auditing necessary to evaluate the integrity of accounting systems and financial reporting.',1,NULL),
	(12,N'AFAM',N'B201',N'Introduction to African-American Studies I',3,NULL,N'Standard Letter',N'A broad introduction to the history, culture, religion, institutions, politics, economics, arts, and psychology of people of African descent as developed from experience in both the old and new worlds.',6,NULL),
	(13,N'AFAM',N'B202',N'Introduction to African-American Studies II',3,NULL,N'Standard Letter',NULL,6,NULL),
	(14,N'ANTH',N'B101',N'Primates, People and Prehistory',3,NULL,N'Standard Letter',N'An exploration of human origins, human evolution, human prehistory and cultural existence from its less complex forms to early civilizations. An introduction to the concepts, methods and data of physical, biological and archaeological anthropology. May be taken with, or independently of, ANTH B102. Satisfies 3-credit hour course requirement for Natural Science GE.',6,NULL),
	(15,N'ANTH',N'B102',N'Understanding Other Cultures',3,NULL,N'Standard Letter',N'An exploration and comparison of selected contemporary cultures, including their languages. An introduction to the concepts, methods and data of socio-cultural anthropology and anthropological linguistics. May be taken with, or independently of, ANTH B101. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',6,NULL),
	(16,N'ANTH',N'B312',N'Contemporary Cross-Cultural Analysis',3,NULL,N'Standard Letter',N'An examination of conformity, conflict or stability, of human interactions across cultural boundaries both at home and abroad, the positive and negative consequences of increasing global interconnectedness and the role of culture change, ethnic identity or religious unity in creating contradictory social and political trends. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',6,NULL),
	(17,N'ANTH',N'B317',N'North American Indian Cultures',3,NULL,N'Standard Letter',N'Comparative study of ethnographic data on American Indian cultures, with emphasis on their significance for ethnological theory. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',6,NULL),
	(18,N'ANTH',N'B319',N'Principles of Archaeology',3,NULL,N'Standard Letter',N'An introduction to the principles, methods, and theory of archaeology, including prehistoric and historic case studies. ',6,NULL),
	(19,N'ANTH',N'B333',N'North American Prehistory',3,NULL,N'Standard Letter',N'Prehistoric anthropology in North America from the first arrival of man through the beginning being of European acculturation. ',6,NULL),
