	(21,N'ANTH',N'B351',N'The Family in Cross-Cultural Perspective',3,NULL,N'Standard Letter',N'Kinship, systems of descent, marriage and domestic organization in different cultures. Variations in childrearing practices, sex roles and other aspects of social relations in kin groups. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',6,NULL),
