	(30,N'ARTH',N'B201',N'History of Animation in the US',3,NULL,N'Standard Letter',N'{� MART B201} (Prerequisite: ARTH B105 and ARTH B106) A survey of popular animation in the United States, from early 20th century film to contemporary digital media, with an introduction to animation techniques using computer software. ',4,NULL),
	(31,N'ARTH',N'B315',N'History of Medieval Art',3,NULL,N'Standard Letter',N'(Prerequisite: ARTH B105 or at the discretion of the instructor) A survey of architecture, painting and sculpture in Europe during the Middle Ages.  ',4,NULL),
	(32,N'ARTH',N'B320',N'History of Italian Renaissance Art',3,NULL,N'Standard Letter',N'(Prerequisite: ARTH B106 or at the discretion of the instructor) The origins and development of Renaissance painting, sculpture and architecture in Italy during the 15th and 16th centuries. ',4,NULL),
