	(50,N'ARTS',N'B262',N'Digital Photography I',3,NULL,N'Standard Letter',N'(Prerequisite: ARTS B102, B103, B104, and B111) An introduction to the use of the DSLR camera and software manipulation. Manual camera use and creative expression will be the focus aside from historical references pertaining to traditional and digital photography.',4,NULL),
