	(62,N'ARTS',N'B364',N'Digital Photography III',3,NULL,N'Standard Letter',N'(Prerequisite: ARTS B102, B103, B104, B111, and B363) A more experimental approach to the photographic image. Non-traditional processes and concepts will be explored, with the further development of personal expression related to the image. ',4,NULL),
	(63,N'ARTS',N'B370',N'Advanced Drawing',3,NULL,N'Standard Letter',N'(Prerequisite: ARTS B102, B103, B104, B111, and B330) Execution of advanced techniques in drawing utilizing emerging and contemporary practices. Emphasis on personal expression. Can be repeated for a total of 6 credit hours',4,NULL),
	(64,N'ARTS',N'B390',N'Directed Studio Art Internship',3,NULL,N'Standard Letter',N'(Prerequisites: minimum 2.5 GPA, 24 hours of ARTS credits, and approved contract with the internship supervisor) Supervised professional experience working within an arts business. A contract approved by the instructor, advisor and department chair is required for undergraduate students. Minimum of 150 service hours required.',4,NULL),
