	(73,N'ARTS',N'B485',N'Senior Exhibition',3,NULL,N'Standard Letter',N'(Prerequisite: ARTS B102, B103, B104, and B111) A capstone course that focuses on a group exhibition that includes: artist biography, resume, and statement with an online portfolio documenting the exhibition and other support materials. All Art Majors are required to register for the Senior Exhibition in their senior year. ',4,NULL),
	(74,N'ASTR',N'B111',N'Descriptive Astronomy I',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of C or better in MATH B111 or a higher level mathematics course) The universe: physical processes and methods of study. Lectures, demonstrations, and laboratory experience. Designed primarily for the non-science major.',11,NULL),
	(75,N'ASTR',N'B111L',N'Descriptive Astronomy I Laboratory',1,NULL,N'Standard Letter',N'Selected topics from ASTR B111 studied in greater depth. Laboratory experience required of students who have not completed ASTR B111.  ',11,NULL),
	(76,N'ASTR',N'B211',N'Desciptive Astronomy II',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of C or better in MATH B111 or a higher level mathematics course) Study of Galactic Astronomy including stars, black holes and Galaxies.',11,NULL),
	(77,N'ASTR',N'B211L',N'Descriptive Astronomy II Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: ASTR B111L) Topics from ASTR B111/B211 studied in greater depth. Laboratory experience required of students who have not completed ASTR B111.',11,NULL),
	(78,N'BADM',N'B101',N'Contemporary Business',3,NULL,N'Standard Letter',N'The nature of American business and its goals. The course includes types of economic systems and concepts of organizing and managing businesses. Topics in management, marketing, finance and accounting will be integrated into the course. A topical survey of business issues and challenges. ',1,NULL),
	(79,N'BADM',N'B150',N'Introduction to Personal Finance',3,NULL,N'Standard Letter',N'Financial Planning and literacy from a personal perspective. Topics include money management skills, taxes, banking, savings, credit, debt management, careers, consumer purchasing strategies, housing, insurance, investments, and retirement. ',1,NULL),
	(80,N'BADM',N'B210',N'Financial Reasoning',3,NULL,N'Standard Letter',N'The course will provide an introduction to the financial concepts and principles that support business analyses and decision making. The course will focus on important concepts such as: the time value of money, stock and bond valuations, and interest rates and return. In addition, the course will develop an understanding of financial statements and financial ratios.',1,NULL),
	(81,N'BADM',N'B310',N'Health Economics',3,NULL,N'Standard Letter',N'(Prerequisite: ECON B221 or ECON B222 or PUBH B380) This course will help students develop the understanding of demand and supply side factors related to health care so they can apply economic principles to various aspects of health, health systems and health care.  ',1,NULL),
	(82,N'BADM',N'B324',N'Commercial Law',3,NULL,N'Standard Letter',N'(Prerequisite: Junior standing) Contracts, sales, bailments, negotiable instruments, agency, partnership and corporation. A combination of textbook and casebook methods of instruction is used.',1,3),
	(83,N'BADM',N'B345',N'Business Communications',3,NULL,N'Standard Letter',N'(Prerequisite: grade of �C� or better in ENGL B102) A study of effective methods of business communications including written, oral, electronic and organizational communication.',1,NULL),
	(84,N'BADM',N'B363',N'Business Finance',3,NULL,N'Standard Letter',N'(Prerequisite: ACCT B226) The study of the procurement, management, and analysis of the financial wealth and resources of profit-seeking firms. ',1,NULL),
	(85,N'BADM',N'B379',N'Business Ethics',3,NULL,N'Standard Letter',N'(Prerequisite: Junior standing) A study of the values and ethics in business, business and government relations, corporate social performance and stakeholder responsibility. Social, economic, political, technological and ecological dimensions of the external environment will be integrated.',1,3),
	(86,N'BADM',N'B380',N'Entrepreneurship',3,NULL,N'Standard Letter',N'(Prerequisites: MKTG B350, BADM B363 and MGMT B371) This course is an overall introduction to the nature and scope of entrepreneurship. The entrepreneurial process as well as the entrepreneurial profile is examined in detail. It includes the planning, financing, launching and harvesting of a new venture. Entrepreneurial strategies are discussed for all facets of the business including franchising, growth and international aspects. Application of entrepreneurship to large corporations, i.e. entrepreneurship, is also a part of the course. ',1,NULL),
	(87,N'BADM',N'B383',N'International Business',3,NULL,N'Standard Letter',N'(Prerequisites: MGMT B371) Introduces the student to economic, financial, legal, political, cultural, institutional and managerial considerations associated with international business transactions. ',1,NULL),
	(88,N'BADM',N'B396',N'Business Research Methods',3,NULL,N'Standard Letter',N'(Prerequisites: STAT B201 and MKTG B350) Focus is on the acquisition, use and evaluation of information from a manager�s perspective. The course will include problem diagnosis, research design, questionnaire preparation, sampling plans and the collection, analysis and interpretation of data as an aid to effective and efficient managerial decisions. ',1,NULL),
	(89,N'BADM',N'B397',N'Topics in Business',1,3,N'Standard Letter',N'Study of varied business areas and issues that are not covered in existing course offerings. Course may be taken twice with different topics for a maximum of 6 credit hours.',1,NULL),
	(90,N'BADM',N'B399',N'Independent Study in Business',3,6,N'Standard Letter',N'(Prerequisite: Contract approval is required) The maximum number of independent study hours a student may earn in business is limited to six.',1,NULL),
	(91,N'BADM',N'B429',N'Internship in Business',3,6,N'Standard Letter',N'(Prerequisites: Junior standing, 2.5 GPA, MKTG B350, BADM B345 and an approved contract with the Internship Coordinator) This course provides students in all disciplines with the opportunity to reinforce classroom learning by working in their discipline in a supervised business environment. This course may be repeated with the approval of the Department Chair and the student�s academic advisor.',1,3),
	(92,N'BIOL',N'B100H',N'Biology Honors Seminar',1,NULL,N'Standard Letter',N'(Prerequisite: Acceptance in the Biology Honors program) This seminar will be an introduction to topics, information, reading and class field trips to reflect the honor�s experience in the first two years of the program. Topics covered will include common readings, discussion of current research topics or current events, and professional development of the student. Course can be repeated for up to 4 credits.',11,NULL),
	(93,N'BIOL',N'B101',N'Biological Principles I',4,NULL,N'Standard Letter',N'Introductory survey of cell structure and function, genetics and evolution. For biology majors, premed students and others needing a prerequisite in biological sciences. Three lecture hours and three laboratory hours per week. ',11,NULL),
	(94,N'BIOL',N'B102',N'Biological Principles II',4,NULL,N'Standard Letter',N'Introductory survey of plant and animal systems, principles of development, physiology, reproduction and ecology. Three lecture hours and three laboratory hours per week. ',11,NULL),
	(95,N'BIOL',N'B110',N'General Biology',4,NULL,N'Standard Letter',N'Basic biological concepts and issues for non?biology majors. Three lecture, two laboratory hours per week. (Note: Combination of BIOL B110 & BIOL B120 does NOT satisfy the Natural Science GE requirement)',11,NULL),
	(96,N'BIOL',N'B120',N'Human Biology',3,NULL,N'Standard Letter',N'Fundamental principles of human biology. Three lecture hours per week. Not for major credit.  (Note: Combination of BIOL B110 & BIOL B120 does NOT satisfy the Natural Science GE requirement)',11,NULL),
	(97,N'BIOL',N'B120L',N'Human Biology Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: BIOL B120) Exercises dealing with basic concepts of human biology. Not for major credit.',11,NULL),
	(98,N'BIOL',N'B200',N'Plant Science',3,NULL,N'Standard Letter',N'An introduction to plant science for the non-major. This course does not carry major credit and is not designed as a prerequisite for other biology courses. Plant development, physiology, genetics, evolution and ecology will be considered. Three lecture hours per week.  ',11,NULL),
	(99,N'BIOL',N'B200L',N'Plant Science Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: BIOL B200) Laboratory exercises, demonstrations and audiovisual supplements to BIOL B200. Two hours per week. Not for major credit. ',11,NULL),
	(100,N'BIOL',N'B230',N'Microbiology',4,NULL,N'Standard Letter',N'(Prerequisite: college-level biology) An introduction to bacteria and viruses, emphasizing structure, metabolism and pathogenesis. Discussion of infectious diseases, antigen-antibody relationships and anti-microbial agents in chemotherapy. Not available for biology major credit. Three lecture and three laboratory hours per week.',11,NULL),
	(101,N'BIOL',N'B232',N'Human Anatomy',4,NULL,N'Standard Letter',N'Functional anatomy of the human body and its relation to disease processes. Not for biology major credit. Three lecture and three laboratory hours per week.',11,NULL),
	(102,N'BIOL',N'B234',N'Human Physiology',4,NULL,N'Standard Letter',N'(Prerequisite: CHEM B109) Physiology of the human body, including Nervous, sensory, endocrine, muscle, circulatory, immune, respiratory, digestive, urinary and reproductive systems. Not available for biology majors� credit. 3 lecture and 2 laboratory hours. ',11,NULL),
	(103,N'BIOL',N'B243',N'Human Anatomy and Physiology',4,NULL,N'Standard Letter',N'Recommended for students with 1 year of high school (or higher) biology or chemistry with laboratory with a grade of B or better. Functional anatomy and physiology of the human body, including the integumentary, skeletal, muscular and nervous systems. Not available for biology major credit. Three lecture hours and three laboratory hours per week.',11,NULL),
	(104,N'BIOL',N'B244',N'Human Anatomy and Physiology II',4,NULL,N'Standard Letter',N'Functional anatomy and physiology of the human body, including the cardiovascular, endocrine, excretory, reproductive, digestive and respiratory systems. Not available for biology major credit. Three lecture hours and three laboratory hours per week. ',11,NULL),
	(105,N'BIOL',N'B270',N'Introduction to Environmental Biology',3,NULL,N'Standard Letter',N'Basic ecological principles and the impacts of human population growth and technology. Not for major credit.',11,NULL),
	(106,N'BIOL',N'B270L',N'Introduction to Environmental Biology Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: BIOL B270) Demonstrations, data analyses, discussions and films relating to human ecology, resource use and environmental impact. Two hours per week. Not for major credit. ',11,NULL),
	(107,N'BIOL',N'B271',N'Applied Enviromental Science',3,NULL,N'Standard Letter',N'Basic ecological principles on the functions and values of natural systems and how to apply those principles to designing the built environment in concert with nature. ',11,NULL),
	(108,N'BIOL',N'B290',N'Weekly Seminar in Science',1,NULL,N'Standard Letter',N'(Prerequisite: Permission of instructor) Weekly seminar in science is a survey of scientific research seminars presented by both USCB researchers and visiting researchers from other institutions. Format is that of a departmental seminar. Grades are based on attendance and on a number of executive summaries of seminars by students taking the course for credit. Class can be taken up to 4 times under different semesters.',11,NULL),
	(109,N'BIOL',N'B295',N'Directed Studies in Biology',1,4,N'Standard Letter',N'(Prerequisite: BIOL B101) Study of a topic not otherwise available to student. May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor. Repeatable to a maximum of 6 credits.',11,NULL),
	(110,N'BIOL',N'B301',N'Ecology and Evolution',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of �C� or better in BIOL B102 and Co-requisite: BIOL B301L) Concepts of evolution, populations and population interactions; communities and ecosystems. Three lecture hours per week.',11,NULL),
	(111,N'BIOL',N'B301L',N'Ecology and Evolution Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: BIOL B301) Experiments, exercises and demonstrations. Three hours per week.',11,NULL),
	(112,N'BIOL',N'B302',N'Cell and Molecular Biology',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of �C� or better BIOL B102) Principles of eukaryotic cell structure, molecular organization and physiology. Genome organization and expression. Cell growth, division and cell-cell interactions. Three lecture hours per week.',11,NULL),
	(113,N'BIOL',N'B302L',N'Cell and Molecular Biology Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: BIOL B302) Experiments, exercises and demonstrations. Three lab hours per week',11,NULL),
	(114,N'BIOL',N'B303',N'Fundamental Genetics',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of �C� or better in BIOL B102) Basic principles of transmission and molecular genetics; quantitative inheritance; recombination; bio- chemical aspects of gene function and regulation; developmental genetics and population genetics. Three lecture hours per week.',11,NULL),
	(115,N'BIOL',N'B395',N'Advanced Directed Studies in Biology',1,4,N'Standard Letter',N'(Prerequisite: One course from BIOL B301, B302 or B303 with a grade of �C� or better) Study of a topic not otherwise available to student. May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor. Repeatable to a maximum of 6 credit hours.',11,NULL),
	(116,N'BIOL',N'B399',N'Independent Study in Biology',1,6,N'Standard Letter',N'(Prerequisite: Contract approval is required).',11,NULL),
	(117,N'BIOL',N'B401',N'Marine Internship',0,3,N'Pass/Fail',N'(Prerequisite: Sophomore standing) Required paid or unpaid internship or field experience for gaining practical experience in marine biology.',11,2),
	(118,N'BIOL',N'B405',N'Developmental Biology I',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) An introduction to the fundamental principles of animal and plant embryonic and post-embryonic development using anatomical, experimental and molecular genetics approaches. Three lecture hours per week.',11,NULL),
	(119,N'BIOL',N'B405L',N'Developmental Biology I Laboratory',1,NULL,N'Standard Letter',N'(Co-requisite: BIOL B405) Descriptive and experimental exercises related to embryology. One three-hour laboratory per week.',11,NULL),
	(120,N'BIOL',N'B410',N'Invertebrate Zoology',4,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Phylogenetic and comparative aspects of anatomy, physiology, reproduction and embryology of the invertebrates. Three lecture and one three-hour laboratory per week.',11,NULL),
	(121,N'BIOL',N'B411',N'Biology of Marine Organisms',4,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Biological concepts emphasizing adaptation to marine environments. Laboratory experiments emphasize principles and techniques of marine biological study. Three lecture and three laboratory hours per week. Scheduled field trips are required.',11,NULL),
	(122,N'BIOL',N'B425',N'Marine Plants',4,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Diversity, distribution, physiology, ecology, evolution, and economic importance of marine algal, sea grass and mangrove communities. Three lecture and three laboratory hours per week. Scheduled field trips are required.',11,NULL),
	(123,N'BIOL',N'B430',N'Histology',4,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) An introduction to the tissues that make up the human body. The microscopic anatomy of tissues is examined and discussed in terms of function and physiology. Three lecture hours and four laboratory hours per week.',11,NULL),
	(124,N'BIOL',N'B431',N'Bacteriology',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303; Co-requisite BIOL B431L) An introduction to bacteria and viruses emphasizing ultrastructure, physiology, genetics and growth. Discussion of public health, industrial and environmental microbiology. Three lecture hours per week.',11,NULL),
	(125,N'BIOL',N'B431L',N'Bacteriology Laboratory',1,NULL,N'Standard Letter',N'(Co-requisite: BIOL B431) Three laboratory hours per week.',11,NULL),
	(126,N'BIOL',N'B435',N'Neurobiology',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Descriptive and experimental aspects of the neural basis of behavior, emphasizing cellular and molecular mechanisms. Three lecture hours per week.',11,NULL),
	(127,N'BIOL',N'B435L',N'Neurobiology',1,NULL,N'Standard Letter',N'(Prerequisite: BIOL B302 and consent of instructor) Descriptive and experimental aspects of the neural basis of behavior, emphasizing cellular and molecular mechanisms. One 3-hour laboratory per week.',11,NULL),
	(128,N'BIOL',N'B436',N'Ichthyology',4,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Phylogeny, morphology, behavior, and ecology of fishes. Three lecture and three laboratory hours per week. Several field trips are required.',11,NULL),
	(129,N'BIOL',N'B438',N'Marine Mammal Biology',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Diversity, anatomy, ecology, energetics, and conservation of marine mammals.',11,NULL),
	(130,N'BIOL',N'B438L',N'Marine Mammal Biology Lab',1,NULL,N'Standard Letter',N'(Prerequisite: BIOL B301; Corequisite: BIOL B438) Experimental aspects of marine mammal biology.  ',11,NULL),
	(131,N'BIOL',N'B441',N'Principles of Biochemistry',3,NULL,N'Standard Letter',N'{�CHEM B450} (Prerequisite: CHEM B333) A survey of fundamentals of biochemistry.',11,NULL),
	(132,N'BIOL',N'B441L',N'Principles of Biochemistry Laboratory',1,NULL,N'Standard Letter',N'{�CHEM B450L} (Prerequisite or Co-requisite: BIOL B441) Three laboratory hours per week.',11,NULL),
	(133,N'BIOL',N'B448',N'Life and Death in the Salt Marsh',4,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Intensive Summer May Term course teaching field research methods, statistical design, and culminating in an independent research project on aspects of ecological processes of Beaufort and surrounding counties. Students will spend more than 5 hours per day in classroom/field-laboratory context planning, developing, researching background, and carrying out their research project, approved and facilitated by course faculty.',11,NULL),
	(134,N'BIOL',N'B450',N'Biological Oceanography',4,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Capstone course for the Marine Biology degree program that is an interdisciplinary introduction to biological oceanography. The course integrates physical, chemical, geological and biological principles into an overview of oceanic processes, with an emphasis on the influence of organisms on biogeochemical cycles. 3-50 minute lectures and 2.8-hour laboratory each week.',11,NULL),
	(135,N'BIOL',N'B451',N'Forensic Techniques and Data Analysis',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Current application of forensic data collection, analysis and interpretation in the legal process. Three lecture hours per week.',11,NULL),
	(136,N'BIOL',N'B460',N'General Physiology',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303 & Senior Standing) Functional mechanisms of vertebrate organ systems. Three lecture hours per week.',11,4),
	(137,N'BIOL',N'B460L',N'General Physiology Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: BIOL B460) Experiments on vertebrate organ system functions using different animal models. One four-hour laboratory per week. ',11,NULL),
	(138,N'BIOL',N'B461',N'Medical Parasitology',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303; Corequisite: BIOL B461L) The goal of this course is to introduce students to a phylogenetic/taxonomic overview of major groups of parasites with emphasis on parasites that are of medical or veterinary importance.',11,NULL),
	(139,N'BIOL',N'B461L',N'Medical Parasitology Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite: BIOL B302 & B303. Corequisite: BIOL B461) The goal of this course is to introduce students to a phylogenetic/taxonomic overview of major groups of parasites and develop laboratory skills in parasite identification and morphology.',11,NULL),
	(140,N'BIOL',N'B471',N'Conservation Biology',4,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Synthesis of current scientific trends in conservation biology. Emphasis will be placed on the preservation of biological diversity as well as its evolutionary potential. Laboratory/Seminar will review scientific literature and introduce modern molecular techniques in conservation biology and computer simulation modeling.',11,NULL),
	(141,N'BIOL',N'B475',N'Marine Ecology',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Structure, dynamics and interactions between populations and communities in marine ecosystems. Three lecture hours per week.',11,NULL),
	(142,N'BIOL',N'B475L',N'Marine Ecology Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: BIOL B475) Laboratory and field exercises in coastal environments.',11,NULL),
	(143,N'BIOL',N'B476',N'Freshwater Biology',4,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) This course provides an introduction to freshwater biology, with an emphasis on blackwater swamps, temperate and subtropical zone lakes, ponds and streams including species, populations, and communities that occupy these environments.',11,NULL),
	(144,N'BIOL',N'B478',N'Herpetology',4,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Evolution, physiology, ecology and behavior of amphibians and reptiles. The lab portion of this course will focus on native amphibians and reptiles and their importance in local ecosystems. ',11,NULL),
	(145,N'BIOL',N'B480',N'Molecular Marine Ecology',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Investigation of techniques and analysis of molecular data in marine organisms. Hands-on experience using molecular tools to investigate population genetic, ecological and systematic principles.',11,NULL),
	(146,N'BIOL',N'B490',N'Marine Policy',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) This course is an overview of strategies and current practices in marine and coastal policy and management and will examine relevant historical and current state, federal and international marine and coastal policy programs and issues. Students will learn directly from professionals in government, academia and non-governmental organizations and stakeholders. Specific emphasis will be put on science communication to policymakers in current issues. This course will be heavily activity-based.',11,NULL),
	(147,N'BIOL',N'B495',N'Introduction to Sustainability',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) This course introduces students to the principles of sustainability as they apply to the environment, economy and social issues. The course format will primarily be interactive classroom experiences and experiential exercises (i.e., hands-on, real-life activities and projects). Standard course materials will be supplemented by guest speakers drawn from our local community.   ',11,NULL),
	(148,N'BIOL',N'B498',N'Biological Research: An Introduction',4,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Methodologies of biological research with emphasis on hypothesis formation, research design and data collection and current issues in biology. Two lecture and six laboratory hours per week.',11,NULL),
	(149,N'BIOL',N'B499',N'Topics in Biology',1,3,N'Standard Letter',N'(Prerequisite: a grade of C or better in two of the three core courses: BIOL B301, B302, B303) Current developments in biological sciences. Readings and research on selected topics. Course content varies and will be announced in the schedule of classes. May be repeated under different topics.',11,NULL),
	(150,N'CHEM',N'B109',N'Chemistry of Living Things',4,NULL,N'Standard Letter',N'(Prerequisite: MATH B111 or higher.) Chemical principles including the structure of and energy associated with matter; quantitative kinetic and equilibrium analysis of chemical and physical processes. Structure and function of biological macromolecules and the molecular basis of inheritance are surveyed. Specifically designed for non-science majors. Cannot receive credit for both CHEM B101 and B109. Three lecture, one recitation and two laboratory hours per week.',11,NULL),
	(151,N'CHEM',N'B111',N'General Chemistry I',4,NULL,N'Standard Letter',N'(Prerequisite: MATH B111 or B115) A survey of the principles that underlie all chemistry with applications illustrating these principles. Three lecture, one recitation and two laboratory hours per week.',11,NULL),
	(152,N'CHEM',N'B112',N'General Chemistry II',4,NULL,N'Standard Letter',N'(Prerequisites: MATH B111 or B115 and a grade of C or better in CHEM B111) A continuation of CHEM 111. Special emphasis on chemical equilibrium. Three lecture, one recitation and three laboratory hours per week.',11,NULL),
	(153,N'CHEM',N'B321',N'Quantitative Analysis',3,NULL,N'Standard Letter',N'(Prerequisite: CHEM B112; Co-requisite: CHEM B321L) Gravimetric, volumetric and introductory instrumental analysis. Three lecture and one recitation hours per week.',11,NULL),
	(154,N'CHEM',N'B321L',N'Quantitative Analysis Laboratory',1,NULL,N'Standard Letter',N'(Co-requisite: CHEM B321) Three laboratory hours per week.',11,NULL),
	(155,N'CHEM',N'B331L',N'Essentials of Organic Chemistry Laboratory I',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: CHEM B333) Laboratory safety, syntheses, separation and purification of carbon compounds.',11,NULL),
	(156,N'CHEM',N'B332L',N'Essential of OrganicI Chemistry Laboratory II',1,NULL,N'Standard Letter',N'(Prerequisite: CHEM B331L or, consent of instructor; Prerequisite or Co-requisite: CHEM B334) Continuation of CHEM B331L. Spectroscopic identification of carbon compounds. Three laboratory hours per week.',11,NULL),
	(157,N'CHEM',N'B333',N'Organic Chemistry I',3,NULL,N'Standard Letter',N'(Prerequisite: CHEM B112) Contemporary theories, nomenclature, reactions, mechanisms and syntheses of carbon compounds. Three lecture hours per week.',11,NULL),
	(158,N'CHEM',N'B334',N'Organic Chemistry II',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of C or better in CHEM B333, or with consent of instructor, CHEM B331) Continuation of CHEM B333. Three lecture hours per week.',11,NULL),
	(159,N'CHEM',N'B398',NULL,1,4,N'Standard Letter',N'Study of a topic not otherwise available to student. May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor. Repeatable to a maximum of 8 credit hours. ',11,NULL),
	(160,N'CHEM',N'B399',N'Indpendent Study in Chemistry',1,3,N'Standard Letter',N'Contract approval by instructor, advisor, and Department Chair is required.',11,NULL),
	(161,N'CHEM',N'B450',N'Principles of Biochemistry',3,NULL,N'Standard Letter',N'{�BIOL 441} (Prerequisite: CHEM B333) A survey of fundamentals of biochemistry.',11,NULL),
	(162,N'CHEM',N'B450L',N'Principles of Biochemistry Laboratory I',1,NULL,N'Standard Letter',N'{�BIOL B441L} (Prerequisite or Co-requisite: CHEM B450) Three laboratory hours per week.',11,NULL),
	(163,N'CHEM',N'B496',N'Undergraduate Research in Chemistry',3,NULL,N'Standard Letter',N'(Prerequisite: consent of instructor) Introduction to the methods of chemical research. A written report on work accomplished is required at the end of each semester. Nine hours of library and laboratory per week.',11,NULL),
	(164,N'COMM',N'B140',N'Public Communication',3,NULL,N'Standard Letter',N'Public speaking and the principles and criticism of oral public communication, to include performance by students.',1,NULL),
	(165,N'COMM',N'B190',N'Introduction to Communication Studies',3,NULL,N'Standard Letter',N'An introduction to communication studies as a field of study, including the concepts, ideas, issues, research methods and theories associated with the discipline.',1,NULL),
	(166,N'COMM',N'B201',N'Interpersonal Communication',3,NULL,N'Standard Letter',N'Presents basic concepts for understanding communication in interpersonal relationships. It combines a theoretical approach with a skills approach to the study of interpersonal communication.',1,NULL),
	(167,N'COMM',N'B210',N'Writing Across Media Platforms',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and B102 or B106, each with a grade of C or higher, and COMM B140 and COMM B190) Students will learn practical skills to help them succeed in writing for specifically online news environments. Emphasis is given to clear and effective communication and professional standards as well as the need to tailor the message to the audience and the platform through which it is communicated.',1,NULL),
	(168,N'COMM',N'B216',N'Digital Communication Technologies',3,NULL,N'Standard Letter',N'(Prerequisite: COMM B140 or B201) This course introduces students to digital communication technologies from both a theoretical and practical framework. Students will understand how to use communication technologies to advance communication strategies to multiple audiences.',1,NULL),
	(169,N'COMM',N'B225',N'Single Camera Production',3,NULL,N'Standard Letter',N'(Prerequisite: COMM B140) This course introduces students to the fundamentals of video production. Students will gain experience in pre-production, production, and post-production short projects.',1,NULL),
	(170,N'COMM',N'B230',N'Organizational Communication',3,NULL,N'Standard Letter',N'Fundamentals of oral communication within business and professional settings. Includes performance.',1,NULL),
	(171,N'COMM',N'B240',N'Media and Society',3,NULL,N'Standard Letter',N'An introduction to the history, evolution and cultural impact of traditional and digital platforms, enabling students to develop a critical perspective of media content.',1,NULL),
	(172,N'COMM',N'B250',N'Theories of Communication',3,NULL,N'Standard Letter',N'(Prerequisite: COMM B140 and COMM B190) Investigation of theories and concepts used to explain human communication. Includes oral presentation.',1,NULL),
	(173,N'COMM',N'B255',N'Communication Studies Research',3,NULL,N'Standard Letter',N'An examination of the qualitative and quantitative methods employed in communication research. Includes oral presentation.',1,NULL),
	(174,N'COMM',N'B285',N'Intercultural Communication',3,NULL,N'Standard Letter',N'A study of cultural differences in human communication with focus on theoretical and experiential approaches toward gaining competence in communicating across cultures. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement). ',1,NULL),
	(175,N'COMM',N'B303',N'Communication Law',3,NULL,N'Standard Letter',N'(Prerequisite: COMM B190 and COMM B240, or consent of instructor) An overview of the key areas of First Amendment law, and the important U.S. Supreme Court cases that have addressed the Constitution''s guarantee of free speech and free press.',1,NULL),
	(176,N'COMM',N'B305',N'Television Studio Production I',3,NULL,N'Standard Letter',N'This course is devoted to learning the techniques of television studio production. Students will learn preproduction planning, script development, lighting design, audio design, the art of three studio-camera shooting, technical directing and studio television directing.',1,NULL),
	(177,N'COMM',N'B306',N'Strategic Social Media',3,NULL,N'Standard Letter',N'This course explores the changing environment of traditional production and distribution of media by examining theories of new media distribution and specific cases of social media producers. Includes the production and distribution of students'' original work on the Internet.',1,NULL),
	(178,N'COMM',N'B307',N'Documentary Theory & Aesthetics',3,NULL,N'Standard Letter',N'The course is a theoretical consideration of documentary filmmaking, covering the subgenres, conventions, evolution, social impact, and contemporary issues of the genre. Students will watch and critique films that represent a variety of approaches to the genre.',1,NULL),
	(179,N'COMM',N'B308',N'Persuasion & Social Influence',3,NULL,N'Standard Letter',N'An in-depth exploration of the art and science of persuasion and social influence. Topics of study include definitions and models of persuasion, individual communicator characteristics important in the complex process of persuasion, conformity and influence in groups, persuasive language and nonverbal cues, principles of rhetoric and rhetorical devices, compliance-gaining communication, motivational appeals, deception, and the ethical dimensions of persuasion and social influence. ',1,NULL),
	(180,N'COMM',N'B325',N'Advocacy and Opposition',3,NULL,N'Standard Letter',N'(Prerequisite: COMM B140) Major focus on models of argument and how they are presented in various communication contexts. Student debating included. ',1,NULL),
	(181,N'COMM',N'B328',N'Introduction to Public Relations',3,NULL,N'Standard Letter',N'(Prerequisite: COMM B210) A cross-disciplinary approach to the practice of public relations and its role in contemporary society, including a theoretical and practical understanding of relationship management.',1,NULL),
	(182,N'COMM',N'B340',N'Oral Interpretation of Literature',3,NULL,N'Standard Letter',N'{�THEA B340} A course designed to give an understanding of the principals involved in extracting meaning from the printed page and the oral presentation of that meaning in a lucid and stimulating manner.',1,NULL),
	(183,N'COMM',N'B342',N'Communication in Sports',3,NULL,N'Standard Letter',N'Examines sports from a communication studies perspective.',1,NULL),
	(184,N'COMM',N'B345',N'Storytelling in Contexts',3,NULL,N'Standard Letter',N'(Prerequisite: COMM B140) This course analyzes the role of storytelling in everyday life. A variety of contexts will be examined and students will study storytelling techniques and use these to tell stories.',1,NULL),
	(185,N'COMM',N'B350',NULL,3,NULL,N'Standard Letter',N'Examines the strategies of health communication in interpersonal, group, organizational, societal-cultural, political- economic, and historical contexts. ',1,NULL),
	(186,N'COMM',N'B385',N'Gender & Communication',3,NULL,N'Standard Letter',N'{�ANTH B385} This course examines how the concept of sex, gender, and sexuality affect human and mediated communication and, in turn, how communication affects our understanding of these concepts. ',1,NULL),
	(187,N'COMM',N'B389',N'Group & Team Communication',3,NULL,N'Standard Letter',N'(Prerequisite: COMM B201) The application of small group/team communication theory and techniques in personal, academic, and professional group/team experiences, with emphases on improving communication skills across contexts, understanding roles within groups and teams, and managing group/team conflict. ',1,NULL),
	(188,N'COMM',N'B390',N'Family Communication',3,NULL,N'Standard Letter',N'A basic introduction to the study of how communication is used in the family to develop, maintain, enhance or disturb marital and family relationships. ',1,NULL),
	(189,N'COMM',N'B398',N'Topics in Communication Studies',3,NULL,N'Standard Letter',N'Reading and research on selected communication studies topics. Course content varies and will be announced in the schedule of classes by topic title. May be repeated under different topics.',1,NULL),
	(190,N'COMM',N'B399',N'Independent Studies',3,6,N'Standard Letter',N'(Prerequisite: Contract approval is required)',1,NULL),
	(191,N'COMM',N'B400',N'Communication and Popular Culture',3,NULL,N'Standard Letter',N'(Prerequisite: Junior standing) Explores the complex relationships of language, visual images, mediated communication, and cultural values in popular culture.',1,3),
	(192,N'COMM',N'B401',N'Public Relations Campaigns',3,NULL,N'Standard Letter',N'(Prerequisite: COMM B328) An experiential-based seminar on the planning, development, and execution of a comprehensive public relations campaign for organizational or non-profit entities.',1,NULL),
	(193,N'COMM',N'B402',N'Sports Broadcasting',3,NULL,N'Standard Letter',N'The course provides a strong foundation into the field of sports broadcasting. Students will explore the key issues that drive the sports broadcasting industry and will participate in the production of sports broadcasting.',1,NULL),
	(194,N'COMM',N'B403',N'Documentary Production',3,NULL,N'Standard Letter',N'(Prerequisite: COMM B225 or instructor permission) A course devoted to the study of techniques of producing documentaries on video. The work will be grounded in an historical survey of the genre in film and television. The class will include single camera production projects by class production teams. ',1,NULL),
	(195,N'COMM',N'B404',N'Power, Discourse & Social Identity',3,NULL,N'Standard Letter',N'(Prerequisite: Junior standing or instructor permission) This course examines notions of identity in public discourse. Students will be introduced to theories of discourse, identity, and power in public discourse (i.e. legal, mediated, policy, etc.) on current social issues. ',1,3),
	(196,N'COMM',N'B405',N'Television Studio Production II',3,NULL,N'Standard Letter',N'(Prerequisite: COMM B305 or instructor permission) This course is devoted to learning advanced techniques of television studio production. Students will extend previously learned skills of television studio production and will individually produce television shows to be aired on local outlets. ',1,NULL),
	(197,N'COMM',N'B490',N'Communication Studies Capstone',3,NULL,N'Standard Letter',N'(Prerequisite: Senior status and consent of instructor) Provides students with the opportunities to integrate the knowledge and skills they have acquired as communication studies majors as well as provide experiences for students to exhibit competent communication skills learned during their program of study.',1,4),
	(198,N'COMM',N'B495',N'Internship in Communication Studies',3,NULL,N'Standard Letter',N'(Prerequisite: Communication Studies Major only, 15 hours of communication studies, consent of instructor). Provides students with the opportunity to apply skills and knowledge across socially and culturally diverse populations in a professional setting. Minimum requirement of 150 service hours. May be repeated for a maximum of 12 credit hours.',1,NULL),
	(199,N'CPLT',N'B290',N'Great Books of the West',3,NULL,N'Standard Letter',N'{�ENGL B290} Selected masterpieces of Western literature, with emphasis on non-English language texts in translation which are foundational to literature in English, including works by Homer, Dante, Cervantes, Voltaire, Goethe and Flaubert.',4,NULL),
	(200,N'CPLT',N'B291',N'Introduction to Non-Western Literature',3,NULL,N'Standard Letter',N'{�ENGL B291} Selected masterpieces of non-western literature. Works may range from antiquity to the present. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',4,NULL),
	(201,N'CPLT',N'B381',N'The Renaissance',3,NULL,N'Standard Letter',N'{�ENGL B381} Literature of the Renaissance, in its cultural contexts, explored through representative works. ',4,NULL),
	(202,N'CPLT',N'B382',N'The Enlightenment',3,NULL,N'Standard Letter',N'{�ENGL B382} Literature of the Enlightenment in its cultural contexts, explored through representative works. ',4,NULL),
	(203,N'CPLT',N'B384',N'Realism',3,NULL,N'Standard Letter',N'{�ENGL B384} Literature of Realism in its cultural contexts, explored through representative works. ',4,NULL),
	(204,N'CPLT',N'B385',N'Modernism',3,NULL,N'Standard Letter',N'{�ENGL B385} Literature of Modernism in its cultural contexts, explored through representative works. ',4,NULL),
	(205,N'CPLT',N'B386',N'Postmodernism',3,NULL,N'Standard Letter',N'{�ENGL B386} Literature of Postmodernism in its cultural contexts, explored through representative works. ',4,NULL),
	(206,N'CPLT',N'B395',N'Classical Drama',3,NULL,N'Standard Letter',N'{�ENGL B395} Representative plays by Greek and Roman dramatists. ',4,NULL),
	(207,N'CPLT',N'B397',N'Modern European Drama',3,NULL,N'Standard Letter',N'{�ENGL B397} Continental plays from the mid-19th century to the present. ',4,NULL),
	(208,N'CSCI',N'B101',N'Introduction to Computer Concepts',3,NULL,N'Standard Letter',N'(Prerequisite: two years of college preparatory mathematics or equivalent) History, application and social impact of computers; problem-solving, algorithm development, applications software and programming in a procedural language. Open to all majors.',7,NULL),
	(209,N'CSCI',N'B102',N'Introduction to HTML and CSS',3,NULL,N'Standard Letter',N'{�ISAT B102} (Prerequisite: two years of college preparatory mathematics) Introduction to systematic computer problem-solving and programming for a variety of applications. Open to all majors.',7,NULL),
	(210,N'CSCI',N'B104',N'Computer Programming Techniques, Practices, and Tools',3,NULL,N'Standard Letter',N'{�ISAT B104} (Prerequisites: Two years of college preparatory mathematics or equivalent) Students successfully completing this course will have developed basic competence in computer programming techniques, practices, and tools. Topics include: coding standards and best practices; implicit and explicit types; conditional/complex-conditional logic; iteration; logic encapsulation and code modularity; parameter/argument usage; file input and output; Integrated Development Environment (IDE) usage; computer program creation. Previous programming experience is not required. ',7,NULL),
	(211,N'CSCI',N'B145',N'Object-Oriented Programming I',4,NULL,N'Standard Letter',N'{�ISAT B145} (Prerequisite: C or better in MATH B111 or higher or consent) Problem solving, algorithmic design, and programming. Open to all majors.',7,NULL),
	(212,N'CSCI',N'B146',N'Object-Oriented Programming II',4,NULL,N'Standard Letter',N'{�ISAT B146} (Prerequisite: Grade of C or better in CSCI B145 and grade of C or better in MATH B141 or B174; Co-requisite: MATH B174) Continuation of CSCI 145. Rigorous development of algorithms and computer programs; elementary data structures. Three lecture hours and two laboratory hours per week. Open to all majors.',7,NULL),
	(213,N'CSCI',N'B150',N'Introduction to Computational Science',3,NULL,N'Standard Letter',N'{�ISAT B150} (Prerequisite: two years of college preparatory mathematics or equivalent) Topics include computing theories, programming languages, modeling/simulation and visualization tools, and case studies of problem solving and high performance computing in natural sciences.',7,NULL),
	(214,N'CSCI',N'B201',N'Introduction to Computer Security',3,NULL,N'Standard Letter',N'{�ISAT B201} (Prerequisite or Co-requisite: CSCI B104 or ISAT B104) This course will provide students with an introduction to the theory and practice of computer security. Topics to be covered include: security policies, authentication, digital certificates, firewalls, malicious code, legal and ethical issues, and incident handling. [This is the first required course in the ISAT Cybersecurity concentration.] ',7,NULL),
	(215,N'CSCI',N'B202',N'Introduction to Front-End Web Development',3,NULL,N'Standard Letter',N'{�ISAT B202} (Prerequisite: CSCI B145 and B150) Application of programming techniques to the development of interactive, event-driven web applications. Brief coverage of document markup (HTML) and styling (CSS) essentials, followed by significant coverage of scripting languages, libraries, and frameworks for manipulating the Document Object Model.',7,NULL),
	(216,N'CSCI',N'B207',N'Computer System Administration',3,NULL,N'Standard Letter',N'{�ISAT B207} (Prerequisite: CSCI B145 and B150) Account maintenance, backups, restoration, system configuration, resource allocation and monitoring, network management, peripheral administration, emphasis on Microsoft Windows and UNIX/Linux systems.',7,NULL),
	(217,N'CSCI',N'B209',N'Special Topics in Computer Programming',1,3,N'Standard Letter',N'Programming and application development using selected programming languages. Course content varies and will be announced in the schedule of classes by topic title.',7,NULL),
	(218,N'CSCI',N'B211',N'Digital Logic Design',3,NULL,N'Standard Letter',N'{�ISAT B211} (Prerequisite: MATH B141 or B174) Number systems, Boolean algebra, logic design, sequential machines.',7,NULL),
	(219,N'CSCI',N'B212',N'Introduction to Computer Architecture',3,NULL,N'Standard Letter',N'{�ISAT B212} (Prerequisite: CSCI B211) Organization and architecture of computer systems hardware; instruction set architectures; addressing modes; register transfer notation; processor design and computer arithmetic; memory systems; hardware implementations of virtual memory, and input/output control and devices. ',7,NULL),
	(220,N'CSCI',N'B240',N'Introduction to Software Engineering',3,NULL,N'Standard Letter',N'{�ISAT B240} (Prerequisite: CSCI B145 or consent of instructor) Fundamentals of software design and development; software implementation strategies; object-oriented design techniques; ethics in software development.',7,NULL),
	(221,N'CSCI',N'B250',N'Mobile Application Development',3,NULL,N'Standard Letter',N'{�ISAT B250} (Prerequisite: CSCI 145 with grade of C or better, or consent.) Introduction to Mobile application development fundamentals including development platforms, user interface design, data persistence, map Application Programming Interface. ',7,NULL),
	(222,N'CSCI',N'B255',N'Introduction to Computational Biology',3,NULL,N'Standard Letter',N'{�ISAT B255} (Prerequisite: CSCI B104 or BIOL B101 or consent) Introduction to the Linux operating system, an introduction to computer science and programming using high-level languages, and a survey of various computational tools used in exploring and analyzing biological data.',7,NULL),
	(223,N'CSCI',N'B265',N'Graphics, Multimedia and User-Interface Design',3,NULL,N'Standard Letter',N'{�ISAT B265} (Prerequisite: CSCI/MATH B280 or MATH B230, and CSCI B145 or consent.) Principles of windowing systems; Graphical interface design and implementation; Processing graphical data using a high level programming language. ',7,NULL),
	(224,N'CSCI',N'B280',N'Computational Mathematics',4,NULL,N'Standard Letter',N'{�MATH B280} (Prerequisite: MATH B142 and CSCI B104 or consent of instructor) Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations, diagonalization, and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines. ',7,NULL),
	(225,N'CSCI',N'B317',N'Introduction to Digital Forensics',3,NULL,N'Standard Letter',N'{�ISAT B317} (Prerequisite: CSCI B201/ISAT B201 or Permission of Instructor) This course will provide students with an introduction to the field of digital forensics and e-discovery. Topics to be covered include the scientific method of digital forensics, electronic discovery, legal issues related to digital analysis, and mobile technologies. Students will learn basic procedures and requirements for conducting digital forensics on a variety of platforms, including Windows, iOS, and Android devices. ',7,NULL),
	(226,N'CSCI',N'B320',N'Database Systems Management',3,NULL,N'Standard Letter',N'{�ISAT B320} (Prerequisite: CSCI B145 or consent) Provides foundations of database systems for students with little prior database experience; topics include relational algebra, data models, schema design and normalization, storage management, query, transaction, concurrency control and consistency.',7,NULL),
	(227,N'CSCI',N'B321',N'Database-Driven Applications Development',3,NULL,N'Standard Letter',N'{�ISAT B321} (Prerequisite: CSCI B145 and CSCI B320) Development of data-driven software for devices including smart phones, tablets, handheld units, and other general purpose computing platforms. Emphasis on database connectivity, design patterns, human-computer interfaces and usability.',7,NULL),
	(228,N'CSCI',N'B350',N'Introduction to Data Structures and Algorithms',3,NULL,N'Standard Letter',N'{�ISAT B350} (Prerequisite: CSCI B146 or consent) Core techniques in the scientific computing process; the focus is on numerical methods, data structures, and computing optimization.',7,NULL),
	(229,N'CSCI',N'B360',N'Operating Systems',3,NULL,N'Standard Letter',N' (Prerequisite: CSCI B145 or a high-level programming language). Introduction to operating systems. Topics include evolution of operating systems, components and performance, process management, memory management, file systems, security and advanced topics.',7,NULL),
	(230,N'CSCI',N'B365',N'Computer Graphics',3,NULL,N'Standard Letter',N'{�ISAT B365} (Prerequisite: CSCI B240 and CSCI/MATH B280 [or MATH B230] or consent.) Graphics pipeline; 2D and 3D geometric objects and transformations; 2D and 3D viewing, clipping, lighting, and rendering processes; Perspective projections; Lighting and reflectance models; Shading models; Hidden surface elimination; 3D curves and surfaces; Color perception and color models.',7,NULL),
	(231,N'CSCI',N'B399',N'Independent Study',1,3,N'Standard Letter',N'{�ISAT B399} (Prerequisite: Contract approval is required).',7,NULL),
	(232,N'CSCI',N'B401',N'Information Security Principles',3,NULL,N'Standard Letter',N'{�ISAT B401} (Prerequisite: CSCI B201) This course extends fundamental computer security concepts, practices, and issues, introducing students in the broader field of information security. Topics include: common attack/threat vectors; information security planning; information security prevention, detection, and response tools and approaches; risk and risk assessment; human factors in information security; legal, ethical, and professional issues.',7,NULL),
	(233,N'CSCI',N'B409',N'Selected Topics in Computing',1,3,N'Standard Letter',N'(Prerequisite: Permission of Instructor) Intensive study of a particular topic or topics in computing. Course content varies and will be announced in the schedule of classes by topic title. May be repeated for credit under a different topic title.',7,NULL),
	(234,N'CSCI',N'B416',N'Introduction to Computer Networks',3,NULL,N'Standard Letter',N'{�ISAT B416} (Prerequisite: CSCI B145 or consent) Fundamental concepts in computer networks, protocols, and applications. Topics include: network architectures, transmission media, protocols, wireless networks, routing, security and latest topics.',7,NULL),
	(235,N'CSCI',N'B419',N'Mathematical Modeling',4,NULL,N'Standard Letter',N'{�MATH B419} (Prerequisite: grade of �C� or better in MATH B142 and CSCI B104, or consent of instructor) Utilizes numerical and mathematical analysis to investigate experimental data and complex systems in science and/or engineering. Emphasis is on the mathematical modeling techniques and computer programming to explore applied problems.',7,NULL),
	(236,N'CSCI',N'B420',N'Database Management Systems II',3,NULL,N'Standard Letter',N'{�ISAT B420} (Prerequisite: CSCI B320) This course explores advanced data manipulation and server-side programming techniques for use in enterprise Relational Database Management Systems (RDBMS). Topics include: platform specific programmatic extensions to Structured Query Language (SQL); stored procedure, function, and package implementation; trigger creation and usage; query optimization techniques; security considerations. ',7,NULL),
	(237,N'CSCI',N'B422',N'Introduction to Data Mining',3,NULL,N'Standard Letter',N'{�ISAT B422} (Prerequisite: MATH B230 or CSCI/MATH B280, STAT B340 and CSCI B320) Introduction to information processing techniques and mathematical tools to assemble, access, and analyze data for decision support and knowledge discovery. ',7,NULL),
	(238,N'CSCI',N'B437',N'Information Technology Project Management',3,NULL,N'Standard Letter',N'{�ISAT B437} (Prerequisite: CSCI/ISAT B207 and MGMT B371, or consent of instructor) This course introduces students to project management concepts, techniques, and tools used by project managers to plan, initiate, manage and close information technology projects. Topics include: the systems approach to project management; application of a project management framework to the planning and management of scope, cost, people, expectations, risk, communications, and procurement; agile methodologies; project management software.',7,NULL),
	(239,N'CSCI',N'B450',N'Modeling and Simulation',3,NULL,N'Standard Letter',N'{�ISAT B450} (Prerequisite: CSCI B350 or consent, and STAT B340) An introduction to modeling and simulation. Topics include fundamental techniques in designing, coding, and use of simulation software to represent actual or theoretical systems in order to observe their behavior and evaluate design correctness.',7,NULL),
	(240,N'CSCI',N'B452',N'Computer Game Development',3,NULL,N'Standard Letter',N'(Prerequisite: CSCI B350 or consent.) Game concept development; User interface design; Graphics (2D, 3D, animation, and advanced techniques); Game physics; Real-time interaction; Intelligent characters; Software engineering considerations.',7,NULL),
	(241,N'CSCI',N'B463',N'Introduction to Digital Image Processing',3,NULL,N'Standard Letter',N'(Prerequisite: CSCI B104 or CSCI B145, MATH B230 or CSCI/MATH B280, STAT B340) Overview of digital image processing techniques and their applications; transforms, enhancement, analysis, segmentation, compression, color image processing; computer projects.',7,NULL),
	(242,N'CSCI',N'B466',N'Data Visualization',3,NULL,N'Standard Letter',N'(Prerequisite: CSCI B350 and CSCI B365 or consent) Concepts of visualization and human vision system; hardware and software basics of computer graphics; visualization pipeline; data representation and processing in computer graphics; algorithms in rendering 2D and 3D geometry; image processing; applications of visualization in science and technology. ',7,NULL),
	(243,N'CSCI',N'B469',NULL,3,NULL,N'Standard Letter',N'{�ISAT B469} (Prerequisite: CSCI B104 or CSCI B145, MATH B230 or CSCI/MATH B280, and CSCI B150) Architecture and interconnection of parallel computers; parallel programming models and applications; issues in high performance computing; programming of parallel computers; general purpose GPU programming and applications. ',7,NULL),
	(244,N'CSCI',N'B470',N'Software Testing and Verification',3,NULL,N'Standard Letter',N'{�ISAT B470} (Prerequisite: CSCI B350 or consent) Testing theory and techniques for software systems; software development process, specification, black-box and white-box testing, configuration and compatibility testing, usability testing, quality assurance, testing planning, and documentation.',7,NULL),
	(245,N'CSCI',N'B499',N'Computational Science Co-op/Internship',1,3,N'Standard Letter',N'{�ISAT B499} (Prerequisite: Computational Science major or consent of instructor) Practical full-time work experience in an area of Computational Science, selected by the student and approved by the Department Chair or Computational Science Program Coordinator. For 1 credit, 45 minimum internship work hours required; for 2 credits, 90 work hours, and for 3 credits, 135 work hours.',7,NULL),
	(246,N'CSCI',N'B500',N'Practical Computing for Computational Scientists',3,NULL,N'Standard Letter',N'(Prerequisite: Enrollment in CSCI M.S. program OR consent of instructor) Application of mathematical, science, and engineering problems to software engineering. Introduction to operating systems including UNIX/LINUX. ',7,NULL),
	(247,N'CSCI',N'B501',N'Advanced Statistical Methods',3,NULL,N'Standard Letter',N'{�STAT B501} (Prerequisite: STAT B340 [or demonstrated equivalent knowledge/experience] or consent of instructor) Methods of data description and analysis, regression and spectral techniques, graphical presentation, estimation and forecasting. Statistical software will be used throughout the course. ',7,NULL),
	(248,N'CSCI',N'B502',N'Numerical Analysis and Computing',3,NULL,N'Standard Letter',N'{�MATH B502} (Prerequisite: CSCI B280 and MATH B240 [or demonstrated equivalent knowledge/experience], or consent of instructor) Application of tools and techniques to algorithmic problems arising in discrete applied math. Topics include probabilistic methods, entropy, linear algebra methods, risk analysis, approximation and optimization techniques, and performance analysis.',7,NULL),
	(249,N'CSCI',N'B515',N'Topics in Computational Science',3,NULL,N'Standard Letter',N'(Prerequisite: undergraduate programming experience or CSCI B500 or consent of instructor) Selected topics in computational science. May be repeated under different topics.  ',7,NULL),
	(250,N'CSCI',N'B516',N'Data Communications and Networks',3,NULL,N'Standard Letter',N'(Prerequisite: undergraduate programming experience or CSCI B500 or consent of instructor) Advanced topics in data communications, architecture, communication protocols, topologies, network access control, LANs, MANs, and WANs; internetworking. ',7,NULL);
INSERT INTO Courses (CourseID, CourseSubject, CourseNumber, CourseName, MinCredits, MaxCredits, GradeMode, CourseDesc, DepartmentID, LevelID) VALUES
	(251,N'CSCI',N'B520',N'Advanced Topics in Database Systems',3,NULL,N'Standard Letter',N'(Prerequisite: CSCI B320 [or demonstrated equivalent knowledge/experience], or consent of instructor) Advanced data-processing techniques, software, database design, implementation, and manipulation. ',7,NULL),
	(252,N'CSCI',N'B522',N'Data Mining',3,NULL,N'Standard Letter',N'(Prerequisite: CSCI B501 and CSCI B502 [or demonstrated equivalent knowledge/experience]) Concepts, issues, tasks and techniques of data mining. Topics include data preparation, feature abstraction, association, classification, clustering, evaluation and validation, scalability, spatial and sequence mining, and data mining applications. ',7,NULL),
	(253,N'CSCI',N'B550',N'Systems Modeling and Simulation',3,NULL,N'Standard Letter',N'(Prerequisite: CSCI B500, B501, and B502, or consent of instructor) Introduction of computational tools, models, system dynamics, input and output analysis, and performance analysis.',7,NULL),
	(254,N'CSCI',N'B563',N'Digital Image Processing',3,NULL,N'Standard Letter',N'(Prerequisite: CSCI B500, B501, and B502 [or demonstrated equivalent knowledge/experience]) Computational techniques in image processing and analysis.',7,NULL),
	(255,N'CSCI',N'B566',N'Data Visualization',3,NULL,N'Standard Letter',N'(Corequisite: CSCI B501 and CSCI B502 or consent of instructor) Advanced techniques and algorithms for creating effective visualizations based on principles from graphic design, visual art, perceptual psychology, and cognitive science.',7,NULL),
	(256,N'CSCI',N'B569',N'High Performance Computing',3,NULL,N'Standard Letter',N'(Prerequisite: CSCI B500 & B501; Corequisite: CSCI B502; or consent of instructor) Introduction of the design, analysis, and implementation of high performance computational science and engineering applications using advanced computer architectures, parallel algorithms, parallel languages, and performance-oriented computing facilities.  ',7,NULL),
	(257,N'CSCI',N'B570',N'Software System Design and Implementation',3,NULL,N'Standard Letter',N'(Prerequisite: CSCI B500 [or demonstrated equivalent knowledge/experience] or consent of instructor) Techniques involved in the planning and implementation of real-life software systems. Topics include software planning, design, implementation, testing, and documentation.',7,NULL),
	(258,N'CSCI',N'B599',N'Independent Study',3,NULL,N'Standard Letter',N'Research under the supervision of a faculty member.',7,NULL),
	(259,N'CSCI',N'B601',N'Principles of Computer Security',3,NULL,N'Standard Letter',N'Prerequisite: CSCI B201 [or demonstrated equivalent knowledge/experience] or consent of instructor) Principles and practices of computer system security including operating system security, network security, software security and web security.',7,NULL),
	(260,N'CSCI',N'B622',N'Data Management and Analytics',3,NULL,N'Standard Letter',N'(Prerequisite: CSCI B520 [or demonstrated equivalent knowledge/experience] or consent of instructor) Foundations of data analytics. Concepts and skills for relational data modeling, querying, and management.',7,NULL),
	(261,N'CSCI',N'B699',N'Industrial or Research Internship',1,3,N'Standard Letter',N'Practical full-time work experience in an area of Computational Science, selected by the student and approved by the Department Chair or Computational Science Program Coordinator.',7,NULL),
	(262,N'CSCI',N'B797',N'Research Project',3,6,N'Pass/Fail',N'Research in Computational Science. Repeatable as needed, with approval from the Computer Science department chair. ',7,NULL),
	(263,N'CSCI',N'B799',N'Master''s Thesis',3,6,N'Pass/Fail Grad Lvl AIK/UPS',N'Preparation of a thesis for the master''s degree. Repeatable as needed, with approval from the Computer Science department chair. ',7,NULL),
	(264,N'CSXE',N'B200',N'Statics',3,NULL,N'Standard Letter',N'(Prerequisite: MATH B142) Principles of computational mechanics; equilibrium of particles and rigid bodies; distributed forces, centroids, and centers of pressure, mass, and gravity; moments of inertia; analysis of simple structures and machines.',2,NULL),
	(265,N'CSXE',N'B211',N'Engineering Graphics and Visualization',3,NULL,N'Standard Letter',N'(Prerequisite: PHYS B211 or consent of instructor) Principles and practice of visualization and graphical representation using modern computer-aided design tools.',2,NULL),
	(266,N'CSXE',N'B260',N'Solid Mechanics',3,NULL,N'Standard Letter',N'(Prerequisite: CSXE B200) Basic concepts of stress and strain. Behavior of structures under applied loads including forces, torques, moments and combinations thereof. Deformations of elastic relationships between stress and strain.',2,NULL),
	(267,N'CSXE',N'B290',N'Thermodynamics',3,NULL,N'Standard Letter',N'(Prerequisite: MATH B240, PHYS B211 or consent) Definitions, work, heat, energy. First law analysis of systems and control volumes. Second law analysis. ',2,NULL),
	(268,N'CSXE',N'B310',N'Dynamics',3,NULL,N'Standard Letter',N'(Prerequisite: CSXE B200.) Kinematics of particles and rigid bodies. Kinetics of particles, emphasis on Newton�s second law: energy and momentum methods for the solution of problems. Applications of plane motion of rigid bodies.',2,NULL),
	(269,N'CSXE',N'B327',N'Design of Mechanical Elements',3,NULL,N'Standard Letter',N'(Prerequisite: CSXE B260.) Design against static failure and fatigue failure of structural members and machine parts; design and selection of components including fasteners, welds, shafts, springs, gears, bearings, and chain drives.',2,NULL),
	(270,N'ECON',N'B101',N'Consumer Economics',3,NULL,N'Standard Letter',N'This introductory survey course provides students with an understanding of the basic elements of consumer economics and personal finance. The course is designed to assist students in becoming informed, rational, decision-makers. Topics include planning and budgeting, credit, consumer rights, consumers and markets, marginal analysis and taxes. ',1,NULL),
	(271,N'ECON',N'B221',N'Microeconomics',3,NULL,N'Standard Letter',N'(Prerequisite: MATH B111 with a grade of �C� or higher) Microeconomic analysis theory of the firm, market structure, cost and output determination; market pricing; income distribution and international economics.',1,NULL),
	(272,N'ECON',N'B222',N'Macroeconomics',3,NULL,N'Standard Letter',N'Macroeconomic analysis: basic definitions and concepts: mechanics of pricing and the fundamentals of American capitalism; national income economics, income and employment theory and monetary and fiscal policy.',1,NULL),
	(273,N'ECON',N'B301',N'Money and Banking',3,NULL,N'Standard Letter',N'(Prerequisites: ECON B221, B222) The role of money in the market economy. Commercial banks, the Federal Reserve System and monetary policy. ',1,NULL),
	(274,N'ECON',N'B303',N'The International Economy',3,NULL,N'Standard Letter',N'(Prerequisites: ECON B221, B222) Survey of international economic issues and institutions, from a historical point of view including the interconnections of economies around the world.',1,NULL),
	(275,N'ECON',N'B311',N'Issues in Economics',3,NULL,N'Standard Letter',N'(Prerequisites: ECON B221, B222) The nature and causes of major economic problems facing the nation and its communities and policy alternatives designed to solve them. The philosophy and methodology of economics in social problem solving. ',1,NULL),
	(276,N'ECON',N'B364',N'Financial Institutions',3,NULL,N'Standard Letter',N'(Prerequisites: ECON B221, B222) A study of the functions and operations of financial institutions and their relationships to the commercial banking system and the general economy. Attention is devoted to savings institutions, insurance companies, rural and urban real estate credit, consumer credit and associated topics.',1,NULL),
	(277,N'ECON',N'B406',N'Labor Economics',3,NULL,N'Standard Letter',N'(Prerequisites: ECON B221, B222) A study of labor market institutions, trends in labor market activity and the effects of government policy on the labor market.',1,NULL),
	(278,N'EDCI',N'B100',N'Clinical Observation & Analysis',3,NULL,N'Standard Letter',N'Clinical experience in an early childhood setting. Observation and analysis in classroom setting includes focus on the following topics: learning climate, classroom management, lesson clarity, instructional variety, task orientation, leaning process, student success, performance outcomes and higher thought processes.',3,NULL),
	(279,N'EDCI',N'B201',N'Teacher Cadet II',3,NULL,N'Standard Letter',N'(Prerequisite: EDCI B100) This course focuses on the dynamics of human learning and the psychological principles that serve as the foundation for educational practice. The general goal is to provide a basic introduction to research findings from the discipline of psychology that can be used to inform the planning and implementation of effective instructional practices in the classroom. ',3,NULL),
	(280,N'EDCI',N'B220',N'Introduction to Life Science Education',4,NULL,N'Standard Letter',N'Students will engage in the major themes (principles) of biology through active inquiry and hands-on learning experiences. This course includes exploring topics in evolution, biological systems, energy transfer, exploring natural phenomena through the research process, and, the nature of science. The course includes three-hour lectures and three hours of laboratory practices. Students will explore the Next Generation of Science Standards K-16 science and engineering practices and crosscutting concepts. ',3,NULL),
	(281,N'EDCI',N'B243',N'Resources in Teaching',3,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: EDCI B100) Introduction to technological resources relevant to the teaching profession including computer technology, educational software, and telecommunications. This course focuses on examining how applying technology in the classroom can be used to support teaching and learning and addresses the methods and materials used for technology integration.',3,NULL),
	(282,N'EDCI',N'B320',N'Curriculum Planning, Technology, and Assessment in Secondary Education',3,NULL,N'Standard Letter',N'(Prerequisite or Corequisite: EDCI B100) Explores issues of development and education of adolescents including curriculum, instruction, activities, materials, and authentic assessment. Prospective teachers will understand the importance of differentiation and technology integration at all levels of instruction and assessment. Parental involvement, community resources, and collaborative relationships with specialists are included components of this course.',3,NULL),
	(283,N'EDCI',N'B322',N'Cultural Diversity in Education',3,NULL,N'Standard Letter',N'This course prepares students to demonstrate an understanding of the depth and breadth of cultural diversity within the United States, as well as the ways that the intersections of cultures within the classroom shape teaching and learning outcomes. ',3,NULL),
	(284,N'EDCI',N'B399',N'Independent Study in Education',1,6,N'Standard Letter',N'(Prerequisite: Contract approval is required).',3,NULL),
	(285,N'EDCI',N'B400',N'Selected Topics in Education',3,NULL,N'Standard Letter',N'Intensive study of selected topics, themes, and/or interdisciplinary concerns in education. Course and content varies and will be announced in the schedule of classes by topic title. Topics may include: Gifted Education; Teaching English Language Learners; Play, Music and Movement in Early Childhood Education; Classroom Management, Assessment & Approaches in Differentiating Instruction, etc. May be repeated under different topics.',3,NULL),
	(286,N'EDCI',N'B441',N'Organization and Management in the Diverse Classroom',3,NULL,N'Standard Letter',N'(Prerequisite: Admission to the Department of Education''s Teacher Education Professional Program for Elementary Education or Early Childhood Education) Structuring of the physical, social, and instructional environment to maximize learning in a supportive, diverse classroom. Development of a comprehensive understanding of practice, proactive, and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorists and constructivist approaches, inclusive education, ESOL learner needs, conflict resolution, and the promotion of learning communities are components of this course.',3,NULL),
	(287,N'EDCI',N'B442',N'Organization & Management in the Secondary Classroom',3,NULL,N'Standard Letter',N'(Prerequisite: Admission into the Professional Program) Structuring of the physical, social, and instructional environment to maximize learning in a supportive, diverse secondary classroom. Development of a comprehensive understanding of practice, proactive, and reactive approaches to management with attention to motivation and culturally diverse settings will be addressed. Behaviorist and constructivist approaches, inclusive education, ESOL learner needs, conflict resolution, ABC Analysis, and the promotion of learning communities are components of this course. ',3,NULL),
	(288,N'EDCI',N'B599',N'Selected Topics in Education',1,3,N'Standard Letter',N'(Prerequisite: Permission of Instructor) Introduction to topics in education. Course content varies and will be determined by instructor. ',3,NULL),
	(289,N'EDEC',N'B340',N'Education of the Young Child',3,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: EDCI B100). A study of the physical, emotional, intellectual and social components of development, birth through age eight and their relationship to the education of the young child birth - age eight. Diagnosis and assessment of development are addressed. Programs serving young children and their families will be discussed. The administration of these programs as well as advocacy efforts are included. Observation and participation in early childhood settings is required.',3,NULL),
	(290,N'EDEC',N'B342',N'Curriculum Planning and Development in Early Childhood Education',3,NULL,N'Standard Letter',N'(Prerequisite or Co-requisites: EDCI B100; EDEC B340; EDPY B335). This curriculum course is designed for prospective teachers in the nursery, kindergarten and primary schools. The course explores various issues involved in the development and education of children from the ages of four to eight. Attention is given to learning activities, materials and equipment suitable for teaching at this level. Emphasis is given to appropriate methods for assessment of children ages four through eight and to the relationship of various subject areas to the physical, social, emotional and cognitive development of the child. Philosophy, history of early childhood education, classroom management, societal influences, parental involvement and community resources are included.',3,NULL),
	(291,N'EDEC',N'B345',N'Family in Early Life Childhood',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B209 or PSYC B321; Admission to the Professional Program in Education or consent of the Department Chair) Principles, practices and content of family life and family-school relations as related to young children�s learning and development in various settings during the early childhood years, birth through eight. This course will provide a foundation for using family life knowledge in relating to young children and families in effective ways.',3,NULL),
	(292,N'EDEC',N'B435',N'Math Experiences in Early Childhood Education',3,NULL,N'Standard Letter',N'(Prerequisite: EDCI B100; Admission to the Professional Program in Education or consent of the Department Chair; Co-requisites: EDEC B436, EDEC B444, EDEC B440P). This methods course includes the basic content of the academic area of mathematics to be presented to PreK-3rd grade children. Developmentally appropriate experiences, learning activities, materials and equipment to aid in the development of math concepts in young children are presented. Diversity-related influences and needs of exceptional learners are also addressed.',3,NULL),
	(293,N'EDEC',N'B436',N'Science and Social Studies Experiences in Early Childhood Education',3,NULL,N'Standard Letter',N'(Prerequisite: EDCI B100; Admission to Professional Program in Education or consent of the Department Chair; Co-requisites: EDEC B435, EDEC B444, EDEC B440P). This methods course includes the basic content in the inquiry areas of science and social studies to be presented to PreK - 3rd grade children. Developmentally appropriate inquiry experiences, learning activities, materials and equipment are presented. Diversity-related influences and needs of exceptional learners are also addressed.',3,NULL),
	(294,N'EDEC',N'B440P',N'Practicum: Teaching Integrated Lessons in Early Childhood Education',3,NULL,N'Pass/Fail',N'(Prerequisite: Admission to the Professional Program or consent of the Department Chair; Co-requisite EDEC B435, EDEC B436, and EDEC B444). Supervised clinical experience in an early childhood setting. Teacher candidates will apply principles of planning, instruction, assessment, management, and professionalism in diverse field-based settings serving students in grades P-3. Offered in Fall.',3,NULL),
	(295,N'EDEC',N'B469',N'Internship in Early Childhood Education',12,NULL,N'Pass/Fail',N'(Prerequisite: Admission to the Professional Program in Education and the Internship; Co-requisite: EDEC B476) A program of observation and teaching in the public schools under the supervision of university and public school personnel.',3,NULL),
	(296,N'EDEC',N'B476',N'Senior Seminar in Early Childhood Education',3,NULL,N'Standard Letter',N'(Co-requisite: EDEC B469) The synthesis and critical evaluation of professional studies in early childhood education.  ',3,NULL),
	(297,N'EDEL',N'B320',N'Cirriculum Planning, Development and Assessment in the Elementary School',3,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: EDCI B100) This course explores issues involved in the development and education of children including curriculum, instruction, activities, materials, grouping, grading and appropriate methods of authentic assessment, as well as analysis of standardized test results in relation to the physical, social, emotional, and cognitive development of grade 2-6 learners for optimal learning. Parental involvement, community resources and collaborative relationships with specialists are included components of this course.',3,NULL),
	(298,N'EDEL',N'B330',N'Intergrating the Arts in Elementary Education: Art, Music and Movement',3,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: EDCI B100) Provides opportunities to develop competence in selecting and using a variety of high quality instructional methods, resources, and assessment strategies for teaching art, music, and movement to elementary children.',3,NULL),
	(299,N'EDEL',N'B431',N'Teaching Mathematics in the Elementary School',3,NULL,N'Standard Letter',N'(Prerequisite: Admission to the Department of Education''s Professional Program for Elementary Education) Materials, resources, programs, and methods for teaching mathematics to diverse learners in grades 2-6. Problem solving, mathematical content and process connections, as well as assessment, diagnosis, and remediation will be addressed. Included are supervised practicum experiences that promote reflective teaching in elementary school settings. ',3,NULL),
	(300,N'EDEL',N'B432',N'Teaching Science in the Elementary School',3,NULL,N'Standard Letter',N'(Prerequisite: Admission to the Department of Education''s Professional Program for Elementary Education) Materials, resources, programs, and methods for teaching science in an inquiry format to diverse learners in grades 2-6. Included are supervised practicum experiences that promote reflective teaching in elementary school settings.',3,NULL),
	(301,N'EDEL',N'B434',N'Language Arts in the Elementary School',3,NULL,N'Standard Letter',N'(Prerequisite: EDCI B100, EDRD B218 and admission to the Department of Education''s Teacher Education Professional Program for Elementary Education) This course focuses on methods of teaching language arts and writing in grades 2-6. Course content includes strategies for teaching the conventions of language, the writing process, writing traits, assessment methods, and incorporating content area reading and writing.',3,NULL),
	(302,N'EDEL',N'B440P',N'Math/Science Practicum',3,NULL,N'Pass/Fail',N'(Prerequisite: Admission to the Professional Program or permission of the Department Chair; Co-requisite EDEL B431, EDEL B432, and EDEL B434) Supervised clinical experience in an elementary education setting. Teacher candidates will apply principles of planning, instruction, assessment, management, and professionalism in diverse field-based settings serving students in grades 2-6. Offered in Fall. ',3,NULL),
	(303,N'EDEL',N'B443',N'Teaching Social Studies in the Elementary School',3,NULL,N'Standard Letter',N'(Prerequisite: Admission to the Department of Education''s Professional Program for Elementary Education) Materials, resources, programs, and methods for teaching social studies to grades 2-6 for learners to become well-informed citizens in a culturally diverse and democratic society. Included are supervised practicum experiences that promote reflective teaching in the elementary school setting. ',3,NULL),
	(304,N'EDEL',N'B470',N'Internship in Elementary School',12,NULL,N'Pass/Fail',N'(Prerequisite: Admission to the Professional Program in Elementary Education; Co-requisite: EDEL B476) A program of observation and teaching in the public schools under the supervision of university and public school personnel.',3,NULL),
	(305,N'EDEL',N'B476',N'Senior Seminar',3,NULL,N'Standard Letter',N'(Co-requisite: EDEL B469) The synthesis and critical evaluation of professional studies in elementary education. ',3,NULL),
	(306,N'EDEX',N'B300',N'Introduction to Exceptional Learner',3,NULL,N'Standard Letter',N'(Admission to the Professional Program or consent of Department Chair). A survey of the development of special education, the current legal guidelines with emphasis on public school mandates, the various clusters of exceptionalities: their definition, classification, identification, prevalence, causes, characteristics and educational needs, including mainstreaming in the regular classroom. ',3,NULL),
	(307,N'EDEX',N'B301',N'Introduction to Exceptional Populations at the Secondary Level',3,NULL,N'Standard Letter',N'(Prerequisite: EDRD B319 & EDCI B320) Introductory course designed to survey the development of special education in high school settings; the current legal guidelines with emphasis on public school mandates; the various clusters of exceptionalities, their definitions, classification, identification, prevalence, causes, characteristics, education needs; and the inclusion of students with exceptionalities within the general education classroom at the secondary level.',3,NULL),
	(308,N'EDFO',N'B321',N'Foundations of American Education',3,NULL,N'Standard Letter',N'Extensive treatment of social, political, economic and philosophical influences that have shaped public education. Study of the financial, organizational and legal aspects of education. Library assignments provide a working knowledge of professional standard references and journals.',3,NULL),
	(309,N'EDME',N'B430',N'Teaching Mathematics in the Secondary School',3,NULL,N'Standard Letter',N'(Co-requisite: EDME B430P) This course includes teaching methods for secondary mathematics education. ',3,NULL),
	(310,N'EDME',N'B430P',N'Practicum in Teaching Mathematics in the Secondary School',3,NULL,N'Pass/Fail',N'(Co-requisite: EDME B430) Supervised clinical experience in a secondary mathematics setting. Observation and participation in a classroom setting is required.',3,NULL),
	(311,N'EDME',N'B469',N'Internship in Secondary Mathematics Education',12,NULL,N'Pass/Fail',N'(Co-requisite: EDME B476) A program of observation and teaching secondary mathematics in the public schools under the supervision of university and public school personnel.  ',3,NULL),
	(312,N'EDME',N'B476',N'Senior Seminar in Secondary Mathematics Education',3,NULL,N'Standard Letter',N'(Co-requisite: EDME B469) The synthesis and critical evaluation of professional studies in secondary mathematics education. ',3,NULL),
	(313,N'EDPH',N'B231',N'Personal and Community Health',3,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: EDCI B100) A study of the principles and practices of personal and community health and their application to the health education of the young child. ',3,NULL),
	(314,N'EDPY',N'B333',N'Introduction to Child Growth and Development',3,NULL,N'Standard Letter',N'Basic course designed to familiarize the prospective teacher with the patterns of social, emotional, physical and intellectual growth of the individual. Development of these growth patterns from the prenatal stage to the onset of adolescence.',3,NULL),
	(315,N'EDPY',N'B335',N'Introduction to Educational Psychology',3,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: EDCI B100) This course will introduce pre-service teachers and education majors to psychological principles, theory and data upon which effective classroom practices are based, including general methods and techniques. A variety of teaching methods for classroom management will be considered with the focus on the teacher as a decision maker in planning, evaluation and control. Emphasis will be placed on student motivation, learning problems, individual differences and measurement.',3,NULL),
	(316,N'EDPY',N'B635',N'Advanced Educational Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: Permission of Department) This course will introduce and illustrate the proper use of learning theories in providing insights into defining and solving problems that may be encountered in educational settings. The emphasis will be on the use of these theories to solve realistic and relevant problems drawn from the classroom teacher�s own personal experience or from cases in the readings. ',3,NULL),
	(317,N'EDRD',N'B318',N'Foundations of Reading',3,NULL,N'Standard Letter',N'(Prerequisite: EDCI B100, or EDCI B243, or special permission of the Department Chair) This course focuses on the foundations of reading, including language development, phonemic awareness, phonics, vocabulary, fluency, and comprehension. Offered in Fall.',3,NULL),
	(318,N'EDRD',N'B319',N'Foundations of Reading for Secondary Teachers',3,NULL,N'Standard Letter',N'(Prerequisite: EDCI B100; admissions to a secondary teaching program, or special permission of the Department Chair of Education) This course provides the basics of teaching reading and writing in secondary content classes. Candidates will be prepared to support students in grades 9-12 who are struggling to read, write, and comprehend information through assessment and differentiation.',3,NULL),
	(319,N'EDRD',N'B425',N'Assessment of Literacy for Early Childhood and Elementary Teachers',3,NULL,N'Standard Letter',N'(Prerequisite: Admission to the Professional Program in Education or consent of the Department Chair, and EDCI B100, EDCI B243, and EDRD B318; Corequisite: EDRD B430 or B433, and EDRD B450P) This course instructs teacher candidates to administer and analyze a variety of formal and informal assessments for screening and diagnosis of reading problems at the early childhood and elementary level. The course utilizes both standardized and portfolio assessments. Offered in Spring.',3,NULL),
	(320,N'EDRD',N'B428',N'Content Area Literacy for Early Childhood and Elementary Teachers',3,NULL,N'Standard Letter',N'(Prerequisite: Admission to the Professional Program or special permission of the Department Chair and EDCI B100, EDCI B243, and EDRD B318) This course is designed to instruct teacher candidates, grades pre-K through 6, in developing methods and materials that will improve their students� literacy skills in content area reading and writing. Offered in Fall. ',3,NULL),
	(321,N'EDRD',N'B429',N'Content Literacy for Secondary Teachers',3,NULL,N'Standard Letter',N'(Prerequisite: EDCI B100; admissions to a secondary teaching program, or special permission of the Department Chair of Education) This course provides 7-12 teachers with the strategies for teaching literacy within the framework of content area classes. The course teaches a sound theoretical knowledge of academic vocabulary, nonfiction texts structures and strategies for analyzing texts to improve the knowledge base.',3,NULL),
	(322,N'EDRD',N'B430',N'Instructional Strategies in Literacy for Early Childhood Teachers',3,NULL,N'Standard Letter',N'(Prerequisite: EDCI B100, EDCI B243, EDRD B318; Admission to the Professional Program or special permission of the Department Chair. Corequisite: EDRD B425 & EDRD B450P) This course focuses on research-based instructional strategies for literacy in early childhood classrooms. Course content includes cooperative learning, critical literacy, Reader''s and Writer''s Workshop. Specific instruction in the five elements of teaching reading: phonics, phonemic awareness, fluency, vocabulary and comprehension and the 6+1 traits of writing.',3,NULL),
	(323,N'EDRD',N'B433',N'Instructional Strategies for Elementary Teachers',3,NULL,N'Standard Letter',N'(Prerequisite: Admission to the Professional Program in Education) This course focuses on research-based instructional strategies for literacy in elementary classrooms. Course content includes cooperative learning, critical literacy, Reader''s and Writer''s Workshop. Specific instruction in the five elements of teaching reading: phonics, phonemic awareness, fluency, vocabulary and comprehension. Reading comprehension and writing processes across the content areas are also included.',3,NULL),
	(324,N'EDRD',N'B450P',N'Literacy/Social Studies Practicum',3,NULL,N'Pass/Fail',N'(Prerequisite: Admission to the Professional Program in Education and the Internship; Co-requisite: EDRD B420 and EDRD B430 or B433). Supervised clinical experience in an early childhood or elementary setting. Teacher candidates will demonstrate proficiency in planning, assessing and teaching various methods of reading and providing individualized differentiated instruction for struggling/ELL students.',3,NULL),
	(325,N'EDRD',N'B619',N'Foundations of Reading',3,NULL,N'Standard Letter',N'(Prerequisite: Permission of Department) This course provides candidates with comprehensive knowledge of the social, cultural, and linguistic factors that influence reading development. Emphasis is placed on practical application of theory, oral language development, phonemic awareness and phonics.',3,NULL),
	(326,N'EDRD',N'B623',N'Differentiation in Reading Instruction',3,NULL,N'Standard Letter',N'This course requires that students conduct in-depth study of effective literacy methods, materials, and formative assessment for K-12 classrooms. Emphasis is on serving the instructional needs of diverse students, including the gifted and talented, culturally and linguistically diverse learners, and children and young people with disabilities. ',3,NULL),
	(327,N'EDRD',N'B624',N'Assessment & Instructional Strategies for Reading for ELLs',3,NULL,N'Standard Letter',N'(Prerequisite: Department Permission) This course focuses on determining reading and language needs of English learners through the use of screening and diagnostic assessments and using that information to inform teaching of English learners within the classroom setting. Candidates learn to administer quick assessments and design instruction and how instruction varies and students acquire language. Candidates choose one student''s data to present in a case study format.  ',3,NULL),
	(328,N'EDRD',N'B625',N'Assessment Strategies for Reading Assessment Strategies for Reading',3,NULL,N'Standard Letter',N'Teachers will examine various types of assessments that will determine students� strengths and areas for further instruction. Teachers will analyze existing data from multiple levels: individual students, groups of students (class level), grade levels, school, district, state, and national level data. They will explain assessment results and demonstrate the ability to advocate for appropriate literacy practices to relevant stakeholders. Teachers will also be able to locate and administer non-biased assessments to culturally and linguistically diverse student. This course aligns with Read to Succeed Legislation requirements for in-service teachers. ',3,NULL),
	(329,N'EDRD',N'B626',N'Writing Across the Curriculum',3,NULL,N'Standard Letter',N'This course is designed to instruct graduate candidates, grades k-12 in developing methods and materials that will improve their students� literacy skills in the content areas of math, social studies, science, and health. Emphasis is on the application of strategies that will support students in reading, writing, and working with media in the context of content area instruction. ',3,NULL),
	(330,N'EDRD',N'B629',N'Content Area Reading and Writing',3,NULL,N'Standard Letter',N'After gaining a sound theoretical knowledge of the reading and writing processes in nonfiction text, teachers will apply what they have learned to their own disciplines, creating strategies that will support students in reading and writing within the context of content area instruction. ',3,NULL),
	(331,N'EDRD',N'B632',N'Action Research for Literacy Education',3,NULL,N'Standard Letter',N'Candidates will gain skills necessary for conducting action research in literacy education and coaching.  This includes assessing the needs of teacher/students, identifying research-based interventions, designing and implementing a coaching plan including identification of assessment to document effectiveness of plan, and assessing effectiveness of coaching plan. ',3,NULL),
	(332,N'EDRD',N'B640P',N'Practicum in Assessing & Teaching English Language Learners',3,NULL,N'Pass/Fail',N'(Prerequisite: Department Permission) Supervised clinical experience in literacy that is implemented within the classroom. Candidates will practice proficiency in planning, assessing, and teaching using various methods of reading and writing that serve the needs of English Language Learners. The main assessment for this course is a diagnostic reading case study. ',3,NULL),
	(333,N'EDRD',N'B645',N'Action Research for Literacy Coaching',3,NULL,N'Standard Letter',N'Candidates will gain the skills to create, manage and evaluate school-wide reading programs. This includes learning adult learning theories, developing professional learning opportunities, and supervising the literacy program. ',3,NULL),
	(334,N'EDRD',N'B650',N'Capstone: Literacy Coaching Seminar',3,NULL,N'Standard Letter',N'This course is the culmination of the M.Ed. program and focuses on bringing together all of the South Carolina Literacy Competencies for Reading Coaches (SCDE, 2015). Candidates discuss presentations by various literacy specialists and exemplary literacy coaches, evaluate a variety of literacy programs, materials, and assessments, and prepare a professional portfolio.  ',3,NULL),
	(335,N'EDRM',N'B620',N'Educational Research, Design, and Analysis',3,NULL,N'Standard Letter',N'This course provides an overview of the principles, models, and techniques of educational research. A substantial portion of this course focuses on the acquisition of critical reading skills and on the analysis and interpretation of data produced by educational investigation and inquiry. ',3,NULL),
	(336,N'ENGL',N'B101',N'Composition and Rhetoric',3,NULL,N'Standard Letter',N'An introduction to university-level writing, emphasizing the rhetorical approaches necessary to understand other writers'' purposes and stances, create effective writing, and develop processed for composing texts for academic, civic, professional, and personal purposes.',4,NULL),
	(337,N'ENGL',N'B102',N'Composition and Literature',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, each with a grade of �C� or higher) An extension of composition skills developed in ENGL B101 and an introduction to literature, emphasizing the interpretive skills and processes necessary to read complex and imaginative texts creatively, critically, and rhetorically so students can write responses to - and interventions in - the world around them.',4,NULL),
	(338,N'ENGL',N'B105',N'Enhanced Composition',3,NULL,N'Standard Letter',N'English majors, humanities majors, and all word-lovers: an enhanced version of ENGL B101. An introduction to genres of writing, including (but not limited to) researched arguments. ',4,NULL),
	(339,N'ENGL',N'B106',N'Enhanced Composition and Literature',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, each with a grade of �C� or higher) For English majors, humanities majors, and all word-lovers: an enhanced version of ENGL B102. An introduction to literary interpretation and the writing of researched arguments about literature. ',4,NULL),
	(340,N'ENGL',N'B180',N'Introduction to Film',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 with a grade of �C� or higher) Introduction to critical analysis of film (for all majors). ',4,NULL),
	(341,N'ENGL',N'B190',N'Introduction to Journalism and Media Studies',3,NULL,N'Standard Letter',N'Introduction to practical skills of contributing to and running a print publication supported by analysis of various media and communication paradigms. ',4,NULL),
	(342,N'ENGL',N'B191',N'Journalism Laboratory',1,NULL,N'Standard Letter',N'Supervised participation in the production of the Tidal Tribune. May be repeated for up to 8 credits.',4,NULL),
	(343,N'ENGL',N'B200',N'Introduction to English Studies',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) An introduction to the history, present state, and potential futures of English Studies with an emphasis on the distinctive fields, methods, and terminology employed in the discipline of English.',4,NULL),
	(344,N'ENGL',N'B211',N'Editing and Publishing Practicum',1,NULL,N'Standard Letter',N'(Prerequisite: ENGL B102 and at least one 200-level ENGL course, which may be taken concurrently. Consent of instructor.)English 211 provides students with practical experience in editing and publishing through their work on the critical journal or literary magazine; may be taken up to 6 times for credit. Appropriate for students from any discipline.',4,NULL),
	(345,N'ENGL',N'B215',N'Writing Center Practicum',1,NULL,N'Standard Letter',N'(Prerequisite: Grade of �B� or higher in ENGL B470 and Instructor Permission) Provides students with ongoing practice and training in teaching and tutoring writing. May be taken up to 6 times for credit.',4,NULL),
	(346,N'ENGL',N'B222',N'Creative Writing Across the Curriculum',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Introductory level workshop designed to foster a student�s appreciation for, and ability to create brief works of adult level fiction, poetry, nonfiction, and drama. Appropriate for students from any discipline.',4,NULL),
	(347,N'ENGL',N'B244',N'Introduction to Rhetorical Theory',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) This course acquaints students with historic and current rhetorical theory. ',4,NULL),
	(348,N'ENGL',N'B250',N'Copyediting and Document Design',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B102, with a grade of ''C'' or higher) This course gives students an overview of the skills necessary to prepare texts (in a range of media) for publication: copyediting and document design. Students will learn to design texts for greater readability, and to complete document reviews including grammar/style, copyediting notations, and fact-checking. Appropriate for students from any discipline.',4,NULL),
	(349,N'ENGL',N'B262',N'Introduction to Technical Writing',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B102, with a grade of ''C'' or higher) An introduction to the basic concepts, processes, and genres of technical writing. Students practice using technical writing skills to communicate specialized or technical information to non-specialist audiences. Recommended for engineers, scientists, and computer scientists. ',4,NULL),
	(350,N'ENGL',N'B263',N'Introduction to Workplace Writing',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in ENGL B102) An introduction to rhetorically-effective writing for workplace audiences, including common workplace genres (e.g. professional emails, reports, and resumes) and practice in collaborative writing, document design, and revision.',4,NULL),
	(351,N'ENGL',N'B266',N'Professional Writing Practicum',1,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) A practicum in professional writing, allowing students to complete projects that employ skills in visual rhetoric, writing, editing, proofreading, and/or research in an on-campus workplace setting. (May be repeated for up to 2 credits) ',4,NULL),
	(352,N'ENGL',N'B270',N'World Literatures',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Survey of world literatures, spanning ancient to postmodern texts. Appropriate for students from any discipline.',4,NULL),
	(353,N'ENGL',N'B287',N'American Literatures',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Survey of American literatures; authors, genres and periods. Appropriate for students from any discipline.',4,NULL),
	(354,N'ENGL',N'B288',N'English Literatures to the 18th Century',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Early British poetry, drama, and prose to the 18th Century. Appropriate for students from any discipline.',4,NULL),
	(355,N'ENGL',N'B289',N'English Literatures from the 18th Century',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) British and postcolonial poetry, drama and prose from the 18th Century to the present. Appropriate for students from any discipline. ',4,NULL),
	(356,N'ENGL',N'B290',N'Great Books of the West',3,NULL,N'Standard Letter',N'{�CPLT B290} (Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Selected masterpieces of Western literature, with emphasis on non-English language texts in translation which are foundational to literature in English, including works by Homer, Dante, Cervantes, Voltaire, Goethe and Flaubert. Appropriate for students from any discipline.',4,NULL),
	(357,N'ENGL',N'B291',N'Introduction to Non-Western Literature',3,NULL,N'Standard Letter',N'{�CPLT B291} (Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) Selected masterpieces of non-Western literature. Works may range from antiquity to the present. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement). Appropriate for students from any discipline.',4,NULL),
	(358,N'ENGL',N'B301',N'Theatre History I',3,NULL,N'Standard Letter',N'{� THEA B301} (Prerequisite: ENGL B101 and B102, or equivalent) A study of the development of Western theatrical texts and practices including playwriting, acting, and design from ancient Greece to 1800. ',4,NULL),
	(359,N'ENGL',N'B302',N'Theatre History II',3,NULL,N'Standard Letter',N'{� THEA B302} (Prerequisite: ENGL B101 and B102, or equivalent) A study of the development of Western theatrical texts and practices including playwriting, acting, directing, and design from 1800 to the present.',4,NULL),
	(360,N'ENGL',N'B310',N'Reading and Performing Shakespeare',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) A course about how people read and perform Shakespeare in which students read and perform Shakespeare.',4,NULL),
	(361,N'ENGL',N'B322',N'Playwriting',3,NULL,N'Standard Letter',N'{� THEA B322} (Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher.) A workshop approach to playwriting that culminates in each student creating a production-ready one-act play. May be repeated with consent of instructor for a maximum of 6 credit hours. ',4,NULL),
	(362,N'ENGL',N'B380',N'Epic to Romance',3,NULL,N'Standard Letter',N'{�CPLT B380} Comprehensive exploration of medieval and other pre-Renaissance literature using texts representative of the evolution of dominant literary forms.',4,NULL),
	(363,N'ENGL',N'B381',N'The Renaissance',3,NULL,N'Standard Letter',N'{�CPLT B381} Literature of the Renaissance, in its cultural contexts, explored through representative works. ',4,NULL),
	(364,N'ENGL',N'B382',N'The Enlightenment',3,NULL,N'Standard Letter',N'{�CPLT B382} Literature of the Enlightenment in its cultural contexts, explored through representative works. ',4,NULL),
	(365,N'ENGL',N'B385',N'Modernism',3,NULL,N'Standard Letter',N'{�CPLT B385} Literature of Modernism in its cultural contexts, explored through representative works. ',4,NULL),
	(366,N'ENGL',N'B386',NULL,3,NULL,N'Standard Letter',N'{�CPLT B386} Literature of Postmodernism in its cultural contexts, explored through representative works. ',4,NULL),
	(367,N'ENGL',N'B395',NULL,3,NULL,N'Standard Letter',N'{�CPLT B395} Representative plays by Greek and Roman dramatists. ',4,NULL),
	(368,N'ENGL',N'B397',NULL,3,NULL,N'Standard Letter',N'{�CPLT B397} Continental plays from the mid-19th century to the present. ',4,NULL),
	(369,N'ENGL',N'B399',NULL,3,9,N'Standard Letter',N'(Prerequisite: Contract approval is required). ',4,NULL),
	(370,N'ENGL',N'B401',N'Chaucer''s Work',3,NULL,N'Standard Letter',N'Chaucer�s works, with special attention to the Canterbury Tales. ',4,NULL),
	(371,N'ENGL',N'B402',N'Tudor Literature',3,NULL,N'Standard Letter',N'Poetry and prose of the 16th century. ',4,NULL),
	(372,N'ENGL',N'B403',N'17th Centrury Literature',3,NULL,N'Standard Letter',N'Poetry and prose of the 17th century.',4,NULL),
	(373,N'ENGL',N'B405',N'Early Shakespeare',3,NULL,N'Standard Letter',N'Shakespeare�s early poetry and plays, with representative works by his contemporaries. ',4,NULL),
	(374,N'ENGL',N'B406',N'Late Shakespeare',3,NULL,N'Standard Letter',N'Shakespeare�s late poetry and plays, with representative works by his contemporaries. ',4,NULL),
	(375,N'ENGL',N'B407',N'Milton',3,NULL,N'Standard Letter',N'Milton�s works, with special attention to Paradise Lost. ',4,NULL),
	(376,N'ENGL',N'B410',N'18th Century Literature',3,NULL,N'Standard Letter',N'Poetry and prose of the 18th century. ',4,NULL),
