	(378,N'ENGL',N'B412',N'Victorian Literature',3,NULL,N'Standard Letter',N'Poetry and prose from the 1830s to the end of the century.',4,NULL),
	(379,N'ENGL',N'B413',N'Modern English Literature',3,NULL,N'Standard Letter',N'Poetry and prose of the 20th century.',4,NULL),
	(380,N'ENGL',N'B415',N'The English Novel',3,NULL,N'Standard Letter',N'Development of the novel as a literary form and study of selected works from its beginnings to the present. ',4,NULL),
	(381,N'ENGL',N'B419',N'Topics in English Literature',3,NULL,N'Standard Letter',N'Intensive study of selected topics. May be repeated for credit under a different title. ',4,NULL),
