	(448,N'HIST',N'B111',N'History of America from Discovery to 1865',3,NULL,N'Standard Letter',N'A general survey of American history from the era of discovery to the end of Civil War, emphasizing major political, economic, social and intellectual developments. Course includes REACH Act �Founding Documents�.',6,NULL),
	(449,N'HIST',N'B112',N'History of the United States from 1865 to the Present Day',3,NULL,N'Standard Letter',N'A general survey of United States from the end of the Civil War to the present, emphasizing major political, economic, social and intellectual developments.',6,NULL),
	(450,N'HIST',N'B115',N'World History to 1500',3,NULL,N'Standard Letter',N'HIST 115 is the first of a two-semester survey of World History from the origin of human civilizations to the advent of the modern period (1500 C.E.). The course necessarily adopts a cross-cultural approach to the study and interpretation of the past, including political, intellectual, economic and social inquiry. HIST 115 addresses issues of religion, gender, trade, migration, conflict and interaction between and within societies. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement). ',6,NULL),
	(451,N'HIST',N'B116',N'World History from 1500 to Present',3,NULL,N'Standard Letter',N'HIST 116 is the second of a two-semester survey of World History from the advent of the modern period (1500 C.E.) to the present. The course necessarily adopts a cross-cultural approach to the study and interpretation of the past, including political, intellectual, economic and social inquiry. HIST 116 addresses issues of religion, gender, trade, migration, conflict and interaction between and within societies. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',6,NULL),
	(452,N'HIST',N'B300',N'The Historian''s Craft',3,NULL,N'Standard Letter',N'Explores the nature of historical evidence, the formulation of historical questions and the construction of historical arguments using primary and secondary materials.',6,NULL),
