	(455,N'HIST',N'B303',N'World of the Ancient Romans',3,NULL,N'Standard Letter',N'An examination of the political, cultural, and social history of ancient Rome, from the founding of the city c. 750 BCE to the barbarian conquest in the fifth century.',6,NULL),
	(456,N'HIST',N'B306',N'The Birth of Europe',3,NULL,N'Standard Letter',N'A survey of the formation and development of Europe from the fourth to the 14th centuries. Emphasis upon the emergence of European culture and upon aspects of European prosperity after A.D. 1000.',6,NULL),
	(457,N'HIST',N'B307',N'The Crusades',3,NULL,N'Standard Letter',N'Holy War and Realpolitik in Mediterranean East-West relations from the 10th to the 15th centuries with emphasis on the role of the Crusades in the cultural formation, development and international relations of East and West.',6,NULL),
	(458,N'HIST',N'B309',N'Age of Renaissance',3,NULL,N'Standard Letter',N'Social, cultural, and artistic movements in Italy and northern Europe from the Black Death (c. 1350) to religious reforms and revolutions (c. 1520). ',6,NULL),
	(459,N'HIST',N'B310',N'Age of the Reformation',3,NULL,N'Standard Letter',N'Ecclesiastical institutions, religious experience and efforts at reform before Luther; career and theology of Luther; diffusion of Reformation throughout Europe; career and theology of Calvin; Catholic renewal and response.',6,NULL),
