	(464,N'HIST',N'B320',N'The History of Great Britain to 1660',3,NULL,N'Standard Letter',N'A survey of the political, social, economic and cultural development of the British Isles from Anglo-Saxon times to the Restoration of 1660. ',6,NULL),
