	(483,N'HIST',N'B430',N'U.S. Constitutional History',3,NULL,N'Standard Letter',N'(Prerequisite: completion of one of the following: HIST B101, B102, B111, B112, B115, B116. Of the six, HIST B111, or B112 which cover U.S. history are preferred, though not required.)United States Constitutional history including constitutional origins in English and colonial legal practices, writing and ratifying the Constitution, Supreme Court decisions, and changes in constitutional interpretation into the twentieth century. Course includes REACH Act �Founding Documents�.',6,NULL),
	(484,N'HIST',N'B442',N'The Old South',3,NULL,N'Standard Letter',N'Development of Southern society and of the forces that made the South a distinctive section of the United States. Course includes REACH Act �Founding Documents�.',6,NULL),
