	(488,N'HIST',N'B492',N'Topics in History',3,NULL,N'Standard Letter',N'Reading and research on selected historical topics. Open only to juniors and seniors with consent of the instructor. May be repeated under different topics.',6,3),
	(489,N'HMSV',N'B180',N'Personal an Professional Development in Human Services',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101 or SOCY B101 or consent of Instructor) This course provided students with the opportunity to explore their personal and professional development and understand how values, beliefs and norms impact both personal and professional lives. ',10,NULL),
	(490,N'HMSV',N'B190',N'Human Services: An Introduction',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101 or SOCY B101 or consent of Instructor). The intention of this course is to acquaint students with an overview of the interdisciplinary field of human services by providing a historical and contemporary survey of human service program literatures. Students will be able to identify the domain of human services as an interdisciplinary area of theory and practice. Specifically, they will be able to master concepts generic to this field of study and apply them in human service situations.',10,NULL),
	(491,N'HMSV',N'B280',N'Micro Level Human Service Interventions',3,NULL,N'Standard Letter',N'(Prerequisite or co-requisite: HMSV B190 or consent of Instructor.) Exploration of the theories, skills and practices of working one-on one in human services settings. Includes active listening, communication skills, and interviewing techniques, the development of service plans, crisis intervention, short and long term care, case management and information and referral services. Multicultural and ethical/legal issues related to this level of intervention will be examined.',10,NULL),
	(492,N'HMSV',N'B282',N'Mezzo Level Human Services Interventions',3,NULL,N'Standard Letter',N'(Prerequisite: HMSV B280 or consent of Instructor.) Exploration of the theories, skills and practice of working with small groups in human services settings. Includes understanding group dynamics, managing and facilitating educational and prevention groups, self-help and support groups, and families. Multicultural and ethical/legal issues related to this level of intervention will be examined.',10,NULL),
	(493,N'HMSV',N'B290',N'Human Services Internship I',3,NULL,N'Standard Letter',N'(Prerequisite: HMSV 280 or permission of Instructor) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service; participation in three on-campus seminars, or three interviews with instructor or a combination of these; on-line reflections; and a final paper that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice.',10,NULL),
	(494,N'HMSV',N'B298',N'Human Services Internship II',3,NULL,N'Standard Letter',N'(Prerequisite: HMSV 290 or consent of Instructor) The application of theoretical foundations and human service principles in a supervised human service setting. Requires at least 120 hours of service; participation in three on-campus seminars, or three interviews with instructor or a combination of these; on-line reflections; and a final paper that demonstrates the ability to apply interdisciplinary theories, concepts and principles of practice at a higher level than in the previous internship. (N.B. no more than two internship can be at the same site.)',10,NULL),
	(495,N'HMSV',N'B300',N'Macro Level Human Services Interventions',3,NULL,N'Standard Letter',N'(Prerequisite or co-requisite: HMSV B280 or consent of Instructor) Exploration of the theories, skills and practices of working with larger groups in human service settings such as grassroots or formal organizations, neighborhoods, communities, geographic regions, political jurisdictions, and societies. Includes community organizing and development, agency collaborations, social change, social marketing and public awareness, advocacy and social policy work. Multicultural and ethical/legal issues related to this level of intervention will be examined. ',10,NULL),
	(496,N'HMSV',N'B302',N'Human Service Evaluation',3,NULL,N'Standard Letter',N'(Prerequisite: HMSV B280, or consent of Instructor) Research methods for determining the effectiveness of social programs/interventions (i.e., experimental, quasi-experimental and qualitative designs).',10,NULL),
	(497,N'HMSV',N'B303',N'Principles of Gerontology',3,NULL,N'Standard Letter',N'(�PSYC B303 & SOCY B303) An exploration of the interdisciplinary field of gerontology, including the fundamental concepts, theories, and issues involved in the study of aging from diverse perspectives.',10,NULL),
	(498,N'HMSV',N'B400',N'Leadership and Professional Ethics in Human Services',3,NULL,N'Standard Letter',N'(Prerequisite or co-requisite: HMSV B302 or consent of Instructor) An exploration of leadership in human service settings and the essentials involved in managing information, human resources and fiscal resources in human service agencies with an emphasis on non-profit organizations. In addition, the course will explore professional ethics and legal issues involved in facing challenges such as privacy, confidentiality, informed consent, freedom of information and information security.',10,NULL),
	(499,N'HMSV',N'B402',N'Nonprofit Management and Funding',3,NULL,N'Standard Letter',N'(Prerequisite: HMSV B400 or consent of Instructor) Principles, theories, skills and practices of effective nonprofit management, including the following topics: governance, legal structures and standards, strategic planning, fundraising and proposal development, volunteer management, marketing and communication.',10,NULL),
	(500,N'HMSV',N'B403',N'Working with Older Adults',3,NULL,N'Standard Letter',N'{�PSYC/SOCY B403} (Prerequisite: SOCY/PSYC/HMSV B303 or SOCY B313 or PSYC B328, or consent of instructor) Provides students with hands-on experience in fields serving the growing older adult population. This is a service-learning course with a significant experiential component. Students will spend time engaged directly with older adults, learning from practitioners working with and in service to older adults, supporting caregivers for older adults, and reflecting on their own perceptions of aging.  ',10,NULL);
