	(585,N'ISAT',N'B207',N'Computer System Administration',3,NULL,N'Standard Letter',N'{�CSCI B207} (Prerequisite: CSCI B145 and B150) Account maintenance, backups, restoration, system configuration, resource allocation and monitoring, network management, peripheral administration, emphasis on Microsoft Windows and UNIX/Linux systems. ',7,NULL),
	(586,N'ISAT',N'B211',N'Digital Logic Design',3,NULL,N'Standard Letter',N'{�CSCI B211} (Prerequisite: MATH B141 or B174) Number systems, Boolean algebra, logic design, sequential machines. ',7,NULL),
	(587,N'ISAT',N'B212',N'Introduction to Computer Architecture',3,NULL,N'Standard Letter',N'{�CSCI B212} (Prerequisite: CSCI B211) Organization and architecture of computer systems hardware; instruction set architectures; addressing modes; register transfer notation; processor design and computer arithmetic; memory systems; hardware implementations of virtual memory, and input/output control and devices.',7,NULL),
	(588,N'ISAT',N'B240',N'Introduction to Software Engineering',3,NULL,N'Standard Letter',N'{�CSCI B240} (Prerequisite: ISAT B145 or consent of instructor) Fundamentals of software design and development; software implementation strategies; object-oriented design techniques; ethics in software development. ',7,NULL),
	(589,N'ISAT',N'B250',N'Mobile Application Development',3,NULL,N'Standard Letter',N'{�CSCI B250} (Prerequisite: CSCI B145 with grade of C or better, or consent.) Introduction to Mobile application development fundamentals including development platforms, user interface design, data persistence, map Application Programming Interface.',7,NULL),
	(590,N'ISAT',N'B255',N'Introduction to Computational Biology',3,NULL,N'Standard Letter',N'{�CSCI B255} (Prerequisite: CSCI B104 or BIOL B101 or consent) Introduction to the Linux operating system, an introduction to computational tools used in exploring and analyzing biological data.',7,NULL),
	(591,N'ISAT',N'B265',N'Graphics, Multimedia and User-Interface Design',3,NULL,N'Standard Letter',N'{�CSCI B265} (Prerequisite: CSCI/MATH B280 or MATH B230, and CSCI B145 or consent.) Principles of windowing systems; Graphical interface design and implementation; Processing graphical data using a high level programming language.',7,NULL),
	(592,N'ISAT',N'B280',N'Computational Mathematics',4,NULL,N'Standard Letter',N'{�CSCI B280, MATH B280} (Prerequisite: MATH B142 and CSCI B104 or consent of instructor) Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations, diagonalization, and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines.',7,NULL),
	(593,N'ISAT',N'B317',N'Introduction to Digital Forensics',3,NULL,N'Standard Letter',N'{�CSCI B317} (Prerequisite: CSCI B201/ISAT B201 or Permission of Instructor) This course will provide students with an introduction to the field of digital forensics and e-discovery. Topics to be covered include the scientific method of digital forensics, electronic discovery, legal issues related to digital analysis, and mobile technologies. Students will learn basic procedures and requirements for conducting digital forensics on a variety of platforms, including Windows, iOS, and Android devices. ',7,NULL),
	(594,N'ISAT',N'B318',N'Ethical Hacking',3,NULL,N'Standard Letter',N'(Prerequisite: ISAT B201) Introduction to the principles and techniques associated with the cybersecurity practice known as penetration testing or ethical hacking. The course covers planning, reconnaissance, scanning, exploitation, post-exploitation, and result reporting. The student discovers how system vulnerabilities can be exploited and learns to avoid such problems. ',7,NULL),
	(595,N'ISAT',N'B320',N'Database Management Systems I',3,NULL,N'Standard Letter',N'{�CSCI B320} (Prerequisite: CSCI B145 or consent) Provides foundations of database systems for students with little prior database experience; topics include relational algebra, data models, schema design and normalization, storage management, query, transaction, concurrency control and consistency.',7,NULL),
	(596,N'ISAT',N'B321',N'Database-Driven Applications Development',3,NULL,N'Standard Letter',N'{�CSCI B321} (Prerequisite: CSCI B145 and CSCI B320) Development of data-driven software for devices including smart phones, tablets, handheld units, and other general purpose computing platforms. Emphasis on database connectivity, design patterns, human-computer interfaces and usability.',7,NULL),
	(597,N'ISAT',N'B350',N'Introduction to Data Structures and Algorithms',3,NULL,N'Standard Letter',N'{�CSCI B350} (Prerequisite: CSCI/MATH B280 [or MATH B230 and MATH B242], and CSCI B146 or consent) Core techniques in the scientific computing process; the focus is on numerical methods, data structures, and computing optimization.',7,NULL),
	(598,N'ISAT',N'B365',N'Computer Graphics',3,NULL,N'Standard Letter',N'{�CSCI B365} (Prerequisite: CSCI B240 and CSCI/MATH B280 [or MATH B230] or consent.) Graphics pipeline; 2D and 3D geometric objects and transformations; 2D and 3D viewing, clipping, lighting, and rendering processes; Perspective projections; Lighting and reflectance models; Shading models; Hidden surface elimination; 3D curves and surfaces; Color perception and color models.',7,NULL),
	(599,N'ISAT',N'B399',N'Independent Study',1,3,N'Standard Letter',N'{�CSCI B399} (Prerequisite: Contract approval is required).',7,NULL),
	(600,N'ISAT',N'B401',N'Information Security Principles',3,NULL,N'Standard Letter',N'{�CSCI B401} (Prerequisite: CSCI B201) This course extends fundamental computer security concepts, practices, and issues, introducing students in the broader field of information security. Topics include: common attack/threat vectors; information security planning; information security prevention, detection, and response tools and approaches; risk and risk assessment; human factors in information security; legal, ethical, and professional issues.',7,NULL),
	(601,N'ISAT',N'B409',N'Special Topics in Security',3,NULL,N'Standard Letter',N'(Prerequisite: Consent of instructor) Intensive study of a particular topic in computing security, information security, or other aspects of cybersecurity. Course content varies and will be announced in the schedule of classes by topic title. May be repeated for credit under a different topic title. ',7,NULL),
	(602,N'ISAT',N'B416',N'Introduction to Computer Networks',3,NULL,N'Standard Letter',N'{�CSCI B416} (Prerequisite: CSCI B145 or consent) Fundamental concepts in computer networks, protocols, and applications. Topics include: network architectures, transmission media, protocols, wireless networks, routing, security and latest topics.',7,NULL),
	(603,N'ISAT',N'B420',N'Database Management Systems II',3,NULL,N'Standard Letter',N'{�CSCI B420} (Prerequisite: CSCI B320) This course explores advanced data manipulation and server-side programming techniques for use in enterprise Relational Database Management Systems (RDBMS). Topics include: platform specific programmatic extensions to Structured Query Language (SQL); stored procedure, function, and package implementation; trigger creation and usage; query optimization techniques; security considerations. ',7,NULL),
	(604,N'ISAT',N'B422',N'Introduction to Data Mining',3,NULL,N'Standard Letter',N'{�CSCI B422} (Prerequisite: MATH B230 or CSCI/MATH B280, STAT B340 and CSCI B320) Introduction to information processing techniques and mathematical tools to assemble, access, and analyze data for decision support and knowledge discovery.',7,NULL),
	(605,N'ISAT',N'B426',N'Special Topics in Computer Networks & Distributed Computing',3,NULL,N'Standard Letter',N'{�CSCI B426} (Prerequisite: CSCI B416) Advanced topics in Computer Networks, course content varies and will be announced in the schedule of classes by suffix and title. May be repeated under different topics.',7,NULL),
	(606,N'ISAT',N'B437',N'Information Technology Project Management',3,NULL,N'Standard Letter',N'{�CSCI B437} (Prerequisite: CSCI/ISAT B207 and MGMT B371, or consent of instructor) This course introduces students to project management concepts, techniques, and tools used by project managers to plan, initiate, manage and close information technology projects. Topics include: the systems approach to project management; application of a project management framework to the planning and management of scope, cost, people, expectations, risk, communications, and procurement; agile methodologies; project management software.',7,NULL),
	(607,N'ISAT',N'B450',N'Modeling and Simulation',3,NULL,N'Standard Letter',N'{�CSCI B450} (Prerequisite: CSCI B350 or consent, and STAT B340) An introduction to modeling and simulation. Topics include fundamental techniques in designing, coding, and use of simulation software to represent actual or theoretical systems in order to observe their behavior and evaluate design correctness.',7,NULL),
	(608,N'ISAT',N'B455',N'Cryptography',3,NULL,N'Standard Letter',N'(Prerequisite: CSCI/ISAT B201, CSCI/ISAT B416, MATH B141, STAT B201 or B240 or B340, or consent of instructor.) Cryptography, secure encryption protocols, and the essential mathematics underlying encryption. Number theory, symmetric and asymmetric ciphers, hash functions, key management and distribution. Transport-level security and other forms of network and Internet security.',7,NULL),
	(609,N'ISAT',N'B469',N'High Performance Computing',3,NULL,N'Standard Letter',N'{�CSCI B469} (Prerequisite: CSCI B104 or CSCI B145, MATH B230 or CSCI/MATH B280, and CSCI B150) Architecture and interconnection of parallel computers; parallel programming models and applications; issues in high performance computing; programming of parallel computers; general purpose GPU programming and applications.',7,NULL),
	(610,N'ISAT',N'B470',N'Software System Process & Management',3,NULL,N'Standard Letter',N'{�CSCI B470} (Prerequisite: CSCI B350 or consent) Testing theory and techniques for software systems; software development process, specification, black-box and white-box testing, configuration and compatibility testing, usability testing, quality assurance, testing planning, and documentation. ',7,NULL),
	(611,N'ISAT',N'B499',N'Computer Science Co-Op/Internship',1,3,N'Pass/Fail',N'{�CSCI B499} (Prerequisite: Computational Science major or consent of instructor) Practical full-time work experience in an area of Computational Science, selected by the student and approved by the Department Chair or Computational Science Program Coordinator. For 1 credit, 45 minimum internship work hours required; for 2 credits, 90 work hours, and for 3 credits, 135 work hours.',7,NULL),
	(612,N'LANG',N'B101',N'Integrated Linguistic Skills for Native Speakers I Integrated Linguistic Skills Native Speakers I',4,NULL,N'Pass/Fail',N'Introduction to foreign language linguistic skills (beginning level 1) with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes.',6,NULL),
	(613,N'LANG',N'B102',N'Integrated Linguistics Skills Native Speakers II',4,NULL,N'Pass/Fail',N'Continuation (beginning level 2) of foreign language linguistic skills with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes.',6,NULL),
	(614,N'LANG',N'B201',N'Integrated Linguistic Skills Native Speakers III',4,NULL,N'Pass/Fail',N'Continuation (intermediate level 1) of foreign language linguistic skills with stress on effective communication in both written and spoken language as well as reading comprehension and an understanding of cultural practices for academic purposes.',6,NULL),
	(615,N'LING',N'B385',N'Gender and Language Use',3,NULL,N'Standard Letter',N'{�ANTH B385} The course will explore an approach to gender and language use that emphasizes the grounding in social practice of both.  ',6,NULL),
	(616,N'LING',N'B431',N'Development of the English Language',3,NULL,N'Standard Letter',N'{�ENGL B453} English from Indo-European through Germanic and into Old English, Middle English and Modern English. No previous knowledge of Old English or Middle English is required.',6,NULL),
	(617,N'MART',N'B102',N'Media Design',3,NULL,N'Standard Letter',N'Fundamental conceptual and technical aspects of designing popular media, including an introduction to digital compositing, time-based media, and interactive media.',4,NULL),
	(618,N'MART',N'B145',N'Digital Imaging',3,NULL,N'Standard Letter',N'(Prerequisite: MART B102 or permission of instructor.) Foundations class on the aesthetic and communicative elements of digital image production, including 2D computer graphics, 3D motion graphics, and coding for media designers.',4,NULL),
	(619,N'MART',N'B201',N'History of Animation in the US',3,NULL,N'Standard Letter',N'{� ARTH B201} A survey of popular animation in the United States, from early 20th century film to contemporary digital media, with an introduction to animation techniques using computer software.',4,NULL),
	(620,N'MART',N'B210',N'Digital Animation 1',3,NULL,N'Standard Letter',N'Introduction to the theory and practice of using computer software to create animated digital media, including 3D character animation. ',4,NULL),
	(621,N'MART',N'B250',N'Broadcast Design 1',3,NULL,N'Standard Letter',N'Introduction to the design and production of media for documentary style broadcasting, including storyboarding, virtual sets, digital cinematography, video editing, and motion graphics.',4,NULL),
	(622,N'MART',N'B281',N'Video Game Design 1',3,NULL,N'Standard Letter',N'Introduction to the theory and practice of using computer software to design interactive digital media, including a first-person 3D video game. ',4,NULL),
	(623,N'MART',N'B310',N'Digital Animation 2',3,NULL,N'Standard Letter',N'(Prerequisite: MART B210) Intermediate project-based course on a specialized aspect of digital animation production, including 3D modeling, character animation, or special effects.',4,NULL),
	(624,N'MART',N'B350',N'Broadcast Design 2',3,NULL,N'Standard Letter',N'(Prerequisite: MART B250) Intermediate course on a specialized aspect of designing digital media for a documentary style television broadcast, such as virtual sets, digital cinematography, 3D motion graphics, or special effects. ',4,NULL),
	(625,N'MART',N'B375',N'Digital Fabrication',3,NULL,N'Standard Letter',N'(Prerequisite: MART B145 or permission of instructor) An introduction to emerging technologies relating to rapid prototyping processes, this course focuses on three-dimensional printing and other computer controlled technologies pertaining to the design and fabrication of a sculptural object and/or design.',4,NULL),
	(626,N'MART',N'B381',N'Video Game Design 2',3,NULL,N'Standard Letter',N'(Prerequisite: MART B281) Intermediate project-based course on a specialized aspect of 3D video game production, including art assets, level design, or coding events.',4,NULL),
	(627,N'MART',N'B385',N'Emerging Technologies',3,NULL,N'Standard Letter',N'(Prerequisite: MART B145 or permission by instructor) This course focuses on the use of hardware and software to create artwork that has elements of interactivity, time-based functionality and code manipulation. Other topics include: DIY movements, microprocessors, and installation art.',4,NULL),
	(628,N'MART',N'B410',N'Narrative Media',3,NULL,N'Standard Letter',N'(Prerequisite: MART B310 or permission by instructor) Advanced project-based course on telling a story through moving pictures, including taking a script through the 3D production process to a festival quality short animation.',4,NULL),
	(629,N'MART',N'B481',N'Performative Media',3,NULL,N'Standard Letter',N'(Prerequisite: MART B381 or permission of instructor) Advanced project-based course on the design and practice of media performance, including the development of interactive virtual characters and environments for a live stage production.',4,NULL),
	(630,N'MART',N'B499',N'Internship in Media Arts',1,3,N'Standard Letter',N'(Prerequisite: MART B310 or B381 or permission of instructor) Supervised experience in media production facilities. Can be taken for 1-3 credits based on 50 contact hours per credit, and contract must be approved by instructor, advisor, and department head. ',4,NULL),
	(631,N'MATH',N'B101',N'Experiential Mathematics and Computation',3,NULL,N'Standard Letter',N'(Prerequisite: Mathematics Placement Exam and two years of high school algebra or equivalent) Mathematics application and appreciation in algebra, geometry, probability and statistics. Modeling and computation in practical applications. Foundational topics are chosen from: Number and Measurement Systems, Symbolic Relationships, Data Description or Analysis, Geometry, Uncertainty, Reasoning, and the Mathematics of Finance. This course serves as a prerequisite for no other MATH courses. Offered every semester.',7,NULL),
	(632,N'MATH',N'B111',N'College Algebra',3,NULL,N'Standard Letter',N'(Prerequisite: qualification through placement) Basic college algebra; linear and quadratic equations, inequalities, functions and graphs of functions, exponential and logarithmic functions, systems of equations. Credit may not be received for both MATH B111 and B111L. Offered every semester.',7,NULL),
	(633,N'MATH',N'B111L',N'Intensive College Algebra',4,NULL,N'Standard Letter',N'(Prerequisite: qualification through placement) Basic college algebra; linear and quadratic equations, inequalities, functions and graphs of functions, exponential and logarithmic functions, systems of equations. Credit may not be received for both MATH B111L and B111. Offered every semester.',7,NULL),
	(634,N'MATH',N'B115',N'Precalculus Mathematics',4,NULL,N'Standard Letter',N'(Prerequisite: Qualification through placement or a grade of �C� or better in B111) Topics in algebra and trigonometry specifically needed for MATH 141, 142, 240. Polynomial, rational, inverse, logarithmic, exponential functions; circular functions; analytic trigonometry. Offered every semester.',7,NULL),
	(635,N'MATH',N'B122',N'Calculus for Business Administration and Social Sciences',3,NULL,N'Standard Letter',N'(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B111 or consent) Derivatives and integrals of elementary algebraic, exponential and logarithmic functions. Maxima, minima, rate of change, and area under a curve. Applications include marginality and elasticity of demand. Offered every semester.',7,NULL),
	(636,N'MATH',N'B131',N'Introductory Mathematics for Comutational Science',3,NULL,N'Standard Letter',N'(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B111 or consent) Sets, functions, analytic geometry, matrices and Euclidean spaces, infinites series, approximation, precision and error, counting and probability, graphs and trees; fundamental notions of differential and integral calculus.',8,NULL),
	(637,N'MATH',N'B141',N'Calculus I',4,NULL,N'Standard Letter',N'(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B115) Introduction to fundamental concepts and theorems of limits, continuity, and derivatives; rates of change; differentiation rules for algebraic and transcendental functions, including the chain rule; applications of derivatives; introduction to integration, including the Fundamental Theorem of Calculus and u-substitution; areas between curves. Offered every semester.',7,NULL),
	(638,N'MATH',N'B142',N'Calculus II',4,NULL,N'Standard Letter',N'(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B141) Techniques of integration, applications of the integral, L�Hospital�s Rule, improper integrals; sequences and series of real numbers, power and Taylor series, introduction to polar coordinates. Offered every semester. ',7,NULL),
	(639,N'MATH',N'B170',N'Finite Mathematics',3,NULL,N'Standard Letter',N'(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B111 or B115) Elementary matrix theory; systems of linear equations; permutations and combinations; probability and Markov chains; linear programming and game theory. ',7,NULL),
	(640,N'MATH',N'B172',N'Mathematical Modeling for the Life Sciences',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of �C� or better in MATH B122 or MATH B141) Modeling with difference equations; vectors, trigonometry, polar coordinates, matrices, eigenvalues and eigenvectors; addition and multiplication in combinatorics, permutations, combinations, introduction to probability theory (discrete, continuous); techniques of integration, symmetry. Credit may not be received for both MATH B172 and either MATH B170 or B174. Offered Spring semester.',7,NULL),
	(641,N'MATH',N'B174',N'Discrete Mathematics for Computer Science',3,NULL,N'Standard Letter',N'(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B115) Induction, complexity, elementary counting, combinations and permutations, recursion and recurrence relations, graphs and trees; discussion of the design and analysis of algorithms� with emphasis on sorting and searching. Offered Spring semester.',7,NULL),
	(642,N'MATH',N'B221',N'Basic Concepts of Elementary Mathematics',3,NULL,N'Standard Letter',N'(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B111 or B115) The meaning of number, fundamental operations of arithmetic, the structure of the real number system and its subsystems, elementary number theory. Open only to students in elementary or early childhood teacher certification. Offered every semester.',7,NULL),
	(643,N'MATH',N'B222',N'Basic Concepts of Elementary Mathematics II',3,NULL,N'Standard Letter',N'(Prerequisite: MATH B221) Informal geometry and basic concepts of algebra. Open only to students in elementary or early childhood teacher certification. Offered every semester.',7,NULL),
	(644,N'MATH',N'B230',N'Linear Algebra',3,NULL,N'Standard Letter',N'(Prerequisite: MATH B141 or consent of instructor) Linear systems and matrices, vector spaces, linear independence, rank of a matrix, linear transformations, determinants, introduction to eigenvalues and eigenvectors, diagonalization and applications. Offered Fall semester.',7,NULL),
	(645,N'MATH',N'B240',N'Calculus III',4,NULL,N'Standard Letter',N'(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B142) Parametric equations, polar coordinates, three dimensional analytic geometry, cylindrical and spherical coordinates, vector functions, functions of several variables, partial differentiation, max-min, Lagrange multipliers, multiple integrals and applications, integral vector calculus. Offered Spring semester. ',7,NULL),
	(646,N'MATH',N'B242',N'Elementary Differential Equations',3,NULL,N'Standard Letter',N'(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B142) Ordinary differential equations of first order, higher order linear equations, Laplace transform methods, series methods; numerical solution of differential equations. Applications to physical sciences and engineering. Offered Spring semester. ',7,NULL),
	(647,N'MATH',N'B280',N'Computational Mathematics',4,NULL,N'Standard Letter',N'{�CSCI B280} (Prerequisite: MATH B142 and CSCI B104 or consent of instructor) Fundamental concepts selected from linear algebra and differential equations applicable to Computational Science. Major topics include systems of linear equations, diagonalization, and numerical solutions to differential equations. The focus is on computational methods and programming skills that will be implemented in a variety of science and engineering disciplines.',8,NULL),
	(648,N'MATH',N'B300',N'Introduction to Proof',3,NULL,N'Standard Letter',N'(Prerequisite: Qualification through placement or a grade of �C� or better in MATH B142) Introduction to the language and nature of reasoning, structure, and technique as they apply to advanced mathematics and proofs. Topics include logic, set theory, cardinality, and methods of proof (including induction). Offered every semester. ',7,NULL),
	(649,N'MATH',N'B331',N'Foundations of Geometry',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of ''C'' or better in MATH B300) The study of geometry as a logical system based upon postulates and undefined terms. The fundamental concepts and relations of Euclidean geometry developed rigorously on the basis of a set of postulates. Some topics from non-Euclidean geometry. Offered Fall semester. ',7,NULL),
	(650,N'MATH',N'B399',N'Independent Study in Mathematics',1,9,N'Standard Letter',N'(Prerequisite: Contract approval is required). ',8,NULL),
	(651,N'MATH',N'B401',N'History of Mathematics',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of �C� or better in MATH B121 or MATH B141) A study of the historical development of mathematics focusing on conceptual milestones. Offered Fall semester. ',7,NULL),
	(652,N'MATH',N'B410',N'Abstract Algebra I',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of �C� or better in MATH B230 and MATH B300) An introduction to algebraic structures. Introduction to group theory including subgroups, quotient groups, homomorphisms; introduction to rings including ideals, quotient rings, polynomial rings and fields of fractions. Offered Spring semester.',7,NULL),
	(653,N'MATH',N'B411',N'Abstract Algebra II',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of �C� or better in MATH B410) A continuation of studies in Algebra. An introduction to modules and field theory including vector spaces, algebras and free abelian groups; introduction to field theory including algebraic extension, Galois theory and finite fields.',7,NULL),
	(654,N'MATH',N'B419',N'Mathematical Modeling',4,NULL,N'Standard Letter',N'{� CSCI B419} (Prerequisite: grade of �C� or better in MATH B142 and CSCI B104, or consent of instructor) Utilizes numerical and mathematical analysis to investigate experimental data and complex systems in science and/or engineering. Emphasis is on the mathematical modeling techniques and computer programming to explore applied problems. ',8,NULL),
	(655,N'MATH',N'B421',N'Mathematics for Secondary Teachers',3,NULL,N'Standard Letter',N'Survey of properties and algebra of real numbers and complex numbers; properties and representations of various functions; concepts of calculus; Euclidean and non-Euclidean geometries; applications of probability, data analysis, and discrete mathematics.',7,NULL),
	(656,N'MATH',N'B427',N'Numerical Analysis',3,NULL,N'Standard Letter',N'(Prerequisite: MATH B280 or B242, and MATH B230) Interpolation and approximation of functions; solution of algebraic equations; numerical differentiation and integration; numerical solutions of ordinary differential equations and boundary value problems; computer implementation of algorithms. ',7,NULL),
	(657,N'MATH',N'B450',N'Analysis I',3,NULL,N'Standard Letter',N'(Prerequisite: grade of �C� or better in MATH B300 or consent of instructor) A rigorous treatment of topics introduced in elementary calculus and more advanced topics basic to the study of real analysis. Offered Spring semester.',7,NULL),
	(658,N'MATH',N'B451',N'Analysis II',3,NULL,N'Standard Letter',N'(Prerequisite: grade of �C� or better in MATH B450 or consent of department) An introduction to the theory of several variables calculus: convergence in Euclidean spaces, functions on Euclidean spaces, differentiation in several variables, integration in several variables.',8,NULL),
	(659,N'MATH',N'B452',N'Complex Analysis',3,NULL,N'Standard Letter',N'(Prerequisite: grade of �C� or better in MATH B240) Complex integration, calculus of residues, conformal mapping, Taylor and Laurent series expansions, applications. ',7,NULL),
	(660,N'MATH',N'B460',N'Topology',3,NULL,N'Standard Letter',N'(Prerequisite: grade of �C� or better in MATH B300 or consent of instructor) Topological spaces and homeomorphisms; separability; compactness; connectedness; completeness; metrizability; introduction to homotopy theory. ',7,NULL),
	(661,N'MATH',N'B480',N'Senior Seminar',3,NULL,N'Pass/Fail',N'(Prerequisite: Consent of instructor) A review of current literature in specialized subject areas involving student presentations. Content varies and will be announced in the schedule of classes by suffix and title. Offered Spring semester.',7,NULL),
	(662,N'MATH',N'B497',N'Reading for Senior Thesis',1,NULL,N'Pass/Fail',N'(Prerequisite: Junior standing with GPA of 3.0 within Mathematics major and departmental approval.) Directed reading in preparation for senior thesis in literature.',8,3),
	(663,N'MATH',N'B499',N'Senior Thesis',2,NULL,N'Pass/Fail',N'(Prerequisite: MATH B497) The senior thesis provides a capstone experience for Mathematics majors. Students will work independently and with the professor to complete a substantial expository or research project.',7,4),
	(664,N'MGMT',N'B300',N'Careers in Business',3,NULL,N'Standard Letter',N'(Prerequisite: Junior standing) An introduction to career opportunities and the career placement process in business. ',1,3),
	(665,N'MGMT',N'B355',N'Introduction to Health Care Management',3,NULL,N'Standard Letter',N'(Prerequisite: Junior Standing) This course will provide students with the opportunity to develop a general understanding of the health care industry and managerial and organizational aspects of health care organizations. Students will learn to apply management concepts, processes, and theoretical ideas in addressing management problems in health care organizations and in the operation of health care systems. Course activities will enable students to learn the importance of identifying and managing finite resources, complying with ethical and legal standards, and recognizing tradeoffs between patient care and financial accountability. ',1,3),
	(666,N'MGMT',N'B371',N'Principles of Management and Leadership',3,NULL,N'Standard Letter',N'(Prerequisite: Junior standing) A comprehensive survey of the basic principles of management and leadership applicable to all forms of business. The course provides the student with a basis for thinking about complex business situations in the framework of analysis of the management and leadership process.',1,3),
	(667,N'MGMT',N'B374',N'Human Resource Management',3,NULL,N'Standard Letter',N'(Prerequisite: MGMT B371) A development of an understanding of personnel administration as a staff function through a study of modern-day concepts and practices. Topics include: research and standards, employment, training and education, safety and health, employee services and industrial relations.',1,NULL),
	(668,N'MGMT',N'B376',N'Organization Behavior',3,NULL,N'Standard Letter',N'(Prerequisite: MGMT B371) A study of the process of integrating people into a work situation that motivates them to work together productively, cooperatively and with economic, psychological and social satisfaction. ',1,NULL),
	(669,N'MGMT',N'B401',N'Topics in  Entrepreneurship',3,NULL,N'Standard Letter',N'(Prerequisites: MKTG B350, MGMT B376) Relevant selected issues and topics of interest in management. Issues and concepts of the business world are explored with film profiles, case histories and readings. May be repeated under different topics.',1,NULL),
	(670,N'MGMT',N'B403',N'Leadership in Organizations',3,NULL,N'Standard Letter',N'(Prerequisite: MGMT B371) Reviews research and practice in organizational leadership; provides students with self-assessment, developmental exercises and case studies to prepare for leadership roles.',1,NULL),
	(671,N'MGMT',N'B404',N'Pay, Rewards, and Compensation Management',3,NULL,N'Standard Letter',N'An examination of how organizations use pay and other types of rewards (both intrinsic and extrinsic) to affect employee motivation and behavior.',1,NULL),
	(672,N'MGMT',N'B411',N'International Management',3,NULL,N'Standard Letter',N'(Prerequisite: Junior standing) This course will apply the basic principles of management and leadership to the firm operating internationally. Emphasis is placed on the management functions of leading, planning, organizing and controlling, as well as the conduct of labor relations, within the framework of a multicultural environment. ',1,3),
	(673,N'MGMT',N'B473',N'Management and Operations of Small Business',3,NULL,N'Standard Letter',N'(Prerequisites: MGMT B371) Analysis of the management and operations of a small business. The course includes the study of an existing small business. The areas of management, finance, marketing and credit as they apply to a small business are studied.',1,NULL),
	(674,N'MGMT',N'B475',N'Operations and Supply Chain Management',3,NULL,N'Standard Letter',N'(Prerequisites: MGMT B371 and STAT B201) A study of the strategic, operating and control decisions involved in manufacturing and service organizations. Topics include forecasting, process development, production technology, resource allocation, facility planning, facility layout, planning systems, inventory systems, resource requirements planning systems, shop floor planning, scheduling operations, just-in-time manufacturing, materials management, productivity control, quality management, quality control, project management and lean Six Sigma. ',1,NULL),
	(675,N'MGMT',N'B476',N'Supply Chain Management: A Logistics Perspective',3,NULL,N'Standard Letter',N'(Prerequisite: MGMT B475) A strategic managerial emphasis that combines strategy. ',1,NULL),
	(676,N'MGMT',N'B477',N'Organization Theory',3,NULL,N'Standard Letter',N'(Prerequisite: MGMT B376) A conceptual framework for the orderly analysis of management functions through studies in organization planning and control theories.',1,NULL),
	(677,N'MGMT',N'B478',N'Strategic Management',3,NULL,N'Standard Letter',N'(Prerequisites: MKTG B350, BADM B363, MGMT B376 and Senior standing) A study of the strategic management process and of the formulation and application of functionally integrated business policy by top management. Emphasis is on decision-making in the face of changing conditions.',1,4),
	(678,N'MGSC',N'B290',N'Computer Information Systems in Business',3,NULL,N'Standard Letter',N'Concepts and techniques of business problem solving using microcomputers. Introduction to the PC operating environment, basic information system concepts and spreadsheet, presentation, database and word processing software.',1,NULL),
	(679,N'MGSC',N'B390',N'Management Information Systems',3,NULL,N'Standard Letter',N'(Prerequisite: MGSC B290 or CSCI B101) A study of the concepts, interactions and functions of major business systems with particular emphasis on the problems and issues related to computer based systems. Included are concepts of designing information systems, collecting and processing data, reporting results of operations and controlling the business organization.',1,NULL),
	(680,N'MKTG',N'B350',N'Principles of Marketing',3,NULL,N'Standard Letter',N'(Prerequisites: ECON B221) Principles and concepts underlying marketing functions, including the conception, pricing, promotion and distribution of products and services and the role of marketing in society. ',1,NULL),
	(681,N'MKTG',N'B352',N'Introduction to Marketing Research',3,NULL,N'Standard Letter',N'(Prerequisites: MKTG B350 and STAT B201) Principles and concepts underlying marketing functions, including the conception, pricing, promotion and distribution of products and services and the role of marketing in society.',1,NULL),
	(682,N'MKTG',N'B355',N'Healthcare Marketing',3,NULL,N'Standard Letter',N'An examination of the segmentation, brand image management, and positioning strategies that underlie the strategic marketing practices of healthcare organizations. Topics include basic principles and key concepts related to the design and implementation of marketing efforts in healthcare organizations. The goal is to understand the process involved in the development and analysis of strategic healthcare marketing plans. ',1,NULL),
	(683,N'MKTG',N'B453',NULL,3,NULL,N'Standard Letter',N'(Prerequisite: MKTG B350) This course is intended to provide the student with an understanding of the fundamentals of sales management including the recruitment, training, motivation, compensation and evaluation of a sales force.',1,NULL),
	(684,N'MKTG',N'B454',N'Marketing Communications and Strategy',3,NULL,N'Standard Letter',N'(Prerequisite: MKTG B350) Integration of advertising, sales promotion, and point-of-purchase communications toward the goal of enhancing brand equity. ',1,NULL),
	(685,N'MKTG',N'B455',N'Consumer Behavior',3,NULL,N'Standard Letter',N'(Prerequisite: MKTG B350) The principal objective of study is the consumer decision process as examined in a marketing context. Selected concepts from psychology, sociology, anthropology and behavioral disciplines are analyzed to develop the student''s ability to understand and predict reactions of consumers to marketing decisions.',1,NULL),
	(686,N'MKTG',N'B457',N'Personal Selling and Sales',3,NULL,N'Standard Letter',N'(Prerequisite: MKTG B350) This course is a comprehensive survey of the basic process of personal selling and sales management applicable to all forms of business. The course is intended to provide the student with a basis for developing personal selling skills as well as understanding the fundamentals of sales management.',1,NULL),
	(687,N'MKTG',N'B465',N'Marketing Strategy and Planning',3,NULL,N'Standard Letter',N'(Prerequisite: MKTG B352) Management of marketing organizations and integration of functions, with emphasis on planning and designing strategies and applying tools and techniques for problem solving and decision making.',1,NULL),
	(688,N'MKTG',N'B474',N'Sports Marketing',3,NULL,N'Standard Letter',N'(Prerequisite: MKTG B350) A study of promotion, sales, and sponsorship strategies utilized in both the marketing of sports (events and properties) and marketing through sports (building brands via alignment with a sports property).',1,NULL),
	(689,N'MSCI',N'B210',N'Oceans and Society',4,NULL,N'Standard Letter',N'A non-technical introduction to the oceans: organisms, systems and the physical and chemical characteristics. Laboratories illustrate the structure and function of marine environments. Three lecture and two laboratory hours per week. Attendance on field trips may be required.',11,NULL),
	(690,N'MSCI',N'B215',N'Coastal Environments of the Southeastern',3,NULL,N'Standard Letter',N'Coastal zones of South Carolina and neighboring states, including geologic history, geomorphology, stratigraphy, hydrogeology, shoreline processes, environmental issues and effect of man. Three lecture hours each week plus optional field trips. Not available for marine science major credit. ',11,NULL),
	(691,N'MSCI',N'B215L',N'Coastal Environments of the Southeastern U.S. Laboratory',1,NULL,N'Standard Letter',N'Exercises examining coastal ecology, geomorphology, hydrogeology, shoreline processes, environmental issues and human impact. Two laboratory hours per week. Scheduled field trips required. Not available for marine science major credit.',11,NULL),
	(692,N'MUSC',N'B110',N'Introduction to Music',3,NULL,N'Standard Letter',N'Perceptive listening and appreciation of musical elements, forms and style periods, including composers� lives, individual styles and representative works. Emphasis on classical music; jazz and American popular music included.',4,NULL),
	(693,N'MUSC',N'B124',N'Symphonic Band',1,NULL,N'Standard Letter',N'Musical organizations are open to all university students by audition. ',4,NULL),
	(694,N'MUSC',N'B129',N'University Chorus',1,NULL,N'Standard Letter',N'Musical organizations are open to all university students by audition. May be repeated for up to 8 credits. ',4,NULL),
	(695,N'MUSC',N'B130',N'Sound Design',3,NULL,N'Standard Letter',N'Theory, Harmony, Form and Analysis, Writing, Choral, (SATB), Piano/vocal, Ensemble scores. Acoustics, Sound Reproduction (Attack, Sustain Decay, Amplitude, Frequency, Compression, Reverb). Engage students with basic concepts of music using current software applications. ',4,NULL),
	(696,N'MUSC',N'B140',N'Jazz and American Popular Music',3,NULL,N'Standard Letter',N'Development of jazz and American popular music through the study of important soloists, ensembles, arrangers and composers.',4,NULL),
	(697,N'NURS',N'B100',N'Nursing Honors Seminar',1,NULL,N'Standard Letter',N'(Prerequisite: Acceptance to the BSN Honors Program) This honors course is designed to provide students the opportunity to explore the changing role of nursing in the American healthcare system. Seminar meetings and planned excursions will facilitate scholarly exploration of the practice of nursing, with an emphasis on the factors influencing current and future nursing practice.',9,NULL),
	(698,N'NURS',N'B101',N'Nursing Honors Seminar II',1,NULL,N'Standard Letter',N'(Prerequisite: NURS B100) This honors course is designed to provide students with the opportunity to explore the changing role of nursing in the American healthcare system. Seminar meeting and planned excursions will facilitate scholarly exploration of the scope of practice including direct care roles and indirect care roles of the nurse and their influence on health policy and the health of populations across the nation. ',9,NULL),
	(699,N'NURS',N'B105',N'Concepts, Communications, and Calculations',3,NULL,N'Standard Letter',N'This course introduces concepts essential to basic nursing practice. Nursing''s historical evolution as a profession through theory, concept and role development will be presented. An overview of medical terminology and medical calculations is provided as skills that promote patient safety within the health disciplines. Written communication skills for the professional nurse will be presented. Students will be introduced to the difference between scholarly and non-scholarly sources. ',9,NULL),
	(700,N'NURS',N'B200',N'Nursing Honors Seminar III',1,NULL,N'Standard Letter',N'(Prerequisite: NURS B101) This honors course is designed to provide students the opportunity to explore changing role of nursing across the globe. Seminar meetings and planned excursions will facilitate scholarly exploration of nursing practice, comparing and contrasting nursing practice in developed and developing countries with the United States. Emphasis is placed on the social determinants of health that influence disease prevention and health. ',9,NULL),
	(701,N'NURS',N'B201',N'Nursing Honors Seminar IV',1,NULL,N'Standard Letter',N'(Prerequisite: NURS B200) This honors course is designed to provide students the opportunity to explore the changing role of nursing to improve the health of others. Through seminar meetings and experiential leaning, students will pursue a scholarly exploration of the healthcare system and health needs of populations at the regional, state, national or international level, culminating in a service-learning project focused on the leading health indicators of the Centers for Disease Control and Prevention (CDC) Healthy People 2020.',9,NULL),
	(702,N'NURS',N'B202',N'Decision-Making in Concept Based Care',3,NULL,N'Standard Letter',N'(For the pre-licensure track: Prerequisite: Acceptance as a pre-licensure BSN student; Co-requisite: NURS B310 and NURS B312) The nursing process as a problem-solving framework is introduced to identify, treat, evaluate and document clinical problems in health records. Emphasis is placed on patient and family-centered therapeutic communication as an adjunct to assessment and evaluation. Selected universal concepts reflecting the holistic nature of caregiving across settings are presented to advance critical thinking.',9,NULL),
	(703,N'NURS',N'B202C',N'Clinical Care & Introduction to Nursing Techniques',3,NULL,N'Standard Letter',N'(Co-requisites: NURS B202, B310, B312) This course emphasizes how to perform common nursing procedures. Techniques and skill development are practiced ensuring patient confidentiality, comfort measures and pain management, dietary restrictions/ intake and output measurement, infection control, vital signs, body mechanics/safety, concepts of self-care/hygiene, mobility and transfer, basic lab collection and interpretation of lab values commonly used in practice settings. ',9,NULL),
	(704,N'NURS',N'B300',N'Sex, Sexuality, Gender and Healthcare',3,NULL,N'Standard Letter',N'This course presents issues of sex, sexuality, and gender (SSG) that health care professionals will encounter. Students will learn the impact of sex, sexuality and gender in the context of healthcare. Disparities of health issues will be discussed from the continuum of health care practice, from education, through diagnosis, to treatment and response.',9,NULL),
	(705,N'NURS',N'B303',N'Health & Wellness Innovation: Creative Inquiry',3,NULL,N'Standard Letter',N'{�PUBH B303} (Prerequisite: NURS B350) The purpose of this course is to introduce and encourage health professional-driven innovation. This course equips students with an empathetic mindset to see healthcare and public health issues from the perspective of the person who is experiencing the challenge. Students will develop new and creative ways to improve health and well-being. ',9,NULL),
	(706,N'NURS',N'B305',N'Spirituality, Health, and Health Professions',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B202 or PUBH B315) Exploration of spirituality, its effect on health, and health professionals roles in the spiritual care of clients. ',9,NULL),
	(707,N'NURS',N'B310',N'Pathophysiology',3,NULL,N'Standard Letter',N'(Prerequisite: Acceptance to the Pre-licensure or RN to BSN Program or consent of Instructor). Building on prior science courses, this course advances knowledge of pathophysiology by analyzing the molecular, cellular and organ system changes that occur with common diseases, noting their impact on total body function and homeostasis. Focus is on the mechanisms of underlying diseases needed to deliver preventive and therapeutic health care interventions.',9,NULL),
	(708,N'NURS',N'B312',N'Assessment and Physical Examination of Individuals',3,NULL,N'Standard Letter',N'(Prerequisite: Acceptance to the Pre-licensure program, RN licensure or consent of instructor) Students will conduct a systematic patient examination to determine the health, health risk, and health alterations from disease conditions. The focus is on adults with normal physiologic variation and extends to include age, gender, and socio-cultural variants. Using assessment findings students will derive clinical problem statements, determine risk reduction strategies, and align assessment findings with laboratory and other diagnostic results to create a comprehensive health profile.',9,NULL),
	(709,N'NURS',N'B320',N'Pharmacologic Interventions',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B310 or consent of instructor) Pharmacokinetics, pharmacodynamics and pharmacogenetics are studied from a drug classification typology. The nurse�s role in verifying and validating drug prescriptions, calculating dosages, administering will build previous learning. Assisting patients with the management of side effects, drug discontinuation, and iatrogenic complications are studied. Current issues with poly-pharmaceuticals, addiction, and self-management with over-the-counter and herbal usage will be discussed from an evidence- and ethically-based practice perspective.',9,NULL),
	(710,N'NURS',N'B325',N'Nursing Informatics and Technology in Healthcare',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B202 or NURS B301) This course introduces nursing informatics and patient care technologies utilized in healthcare settings. Students explore informatics and technology from identification, retrieval, processing, evaluation, and management of healthcare technology and information systems intended to improve patient outcomes and reduce risk of harm. Legal and ethical considerations related to these technologies are examined. Emphasis is placed on selected technologies and evaluating how they impact nursing practice and influence quality and safety across the continuum of care. Basic computer literacy is a pre-requisite to support success.',9,NULL),
	(711,N'NURS',N'B326',N'Care of Adults with Acute and Chronic Conditions',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B202, B202C, B310 and B312) Nursing management of adult and older adult patients with acute and chronic conditions is introduced. Students will synthesize previous courses to link nursing concepts, physical examination and pharmacology as part of the care management plan. As disease processes by body system are examined in greater depth, students will study disease staging, complex therapeutics and technology usage, and anticipatory complications. Stigma, ethics, and discharge from one setting to another across the care continuum are presented as advanced challenges to intervention and outcome management.',9,NULL),
	(712,N'NURS',N'B326C',N'Clinical Care of Adults with Acute and Chronic Conditions',3,NULL,N'Standard Letter',N'(Prerequisites: NURS B202, B202C, B312. Corequisite: NURS B320 & B326) Students will be exposed to adults and older adults with acute and chronic conditions. Clinical experiences will focus on the application of knowledge and skills related to the care of an adult patient. Emphasis will be placed on applying the nursing process to manage care, setting clinical priorities and using technology to anticipate patient needs as a member of interprofessional teams.',9,NULL),
	(713,N'NURS',N'B330',N'Transcultural Health Practices',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101 or SOCY B101 or consent of instructor) This course focuses on the health practices of individual, family and communities with varied cultural, socioeconomic, and global backgrounds. Cultural variables such as age, gender, ethnicity, family structure, spiritual practice and religion, sexual expression, economics, and common health practices are examined to sensitize providers to person-centered care. Cultural practices in birth, health, pain management, natural healing practices, illness and death are explained and reinforced.',9,NULL),
	(714,N'NURS',N'B341',N'Performance of Caring',3,NULL,N'Standard Letter',N'{�THEA B341} (Prerequisite: SOCY B101 or PSYC B101) The class aims to train students to act as Simulated Participants (SP) in the Nursing Simulation lab as patients and supporting roles (such as patient family members) in dynamic, realistic simulated healthcare experiences. These experiences help train future nurses in a lifelike way.',9,NULL),
	(715,N'NURS',N'B350',N'The Science of Evidence-Based Practice',3,NULL,N'Standard Letter',N'(Prerequisite: STAT B201 and NURS B202 or RN Licensure or consent of Instructor) The science of nursing is presented exploring how research builds the nursing profession. The research process, from question to study design and analysis, and onto field-based implementation is contrasted. Students are exposed to multiple studies sufficient to inform evidence-based practice and discern good from bad science. Discussion of institutional databases available to inform quality improvement and organizational policy is explained. Ethical concerns and the mitigation of research risks are considered.',9,NULL),
	(716,N'NURS',N'B356',N'Care of Childbearing Families',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B320 and NURS B326; Corequisite: NURS B358) This course addresses the primary and preventive care provided to childbearing families. The needs of reproducing families to ensure safe pre-, intra-, and postnatal outcomes are addressed to ensure growth and functioning in the family unit. Male reproductive and female gynecological norms and abnormalities, along with complications of pregnancy, are contrasted. Psychosocial adaptations and special needs of the family unit are studied to manage grief and loss, palliative care and women�s and men�s reproductive health challenges.',9,NULL),
	(717,N'NURS',N'B357',N'Nursing Concepts in Adult Health',3,NULL,N'Standard Letter',N'(Prerequisite: Junior Standing) This class will help bridge an identified learning gap between NURS B326 and NURS B425.  The class will reinforce knowledge and application in Adult Health Nursing using a concept-based approach. The content will focus on critical thinking and clinical judgement utilizing the nursing process.  ',9,3),
	(718,N'NURS',N'B358',N'Care of Children',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B320 and NURS B326; Corequisite: NURS B356) The developmental, physiologic, cognitive, and health needs of children are presented. Children with acute and chronic health conditions, genetic abnormalities, and infectious diseases are studied with attention to how children respond to and adapt to disease and how disease prevention is addressed. Special attention is given to rapid and accurate assessment, availability of specialized health providers and equipment, and rapid transfer of pediatric patients during life-threatening emergencies.',9,NULL),
	(719,N'NURS',N'B360',N'Gerontological and Rehabilitation Nursing',3,NULL,N'Standard Letter',N'(Prerequisite: RN licensure, or NURS B312 and NURS B326, or permission of the instructor) Care and special needs of the older adult in various care settings. Gerontological nursing, presentation of disease, rehabilitation, health promotion, reimbursement and a comprehensive nursing gerontological assessment are covered. (Lecture 3 hours).',9,NULL),
	(720,N'NURS',N'B360C',N'Clinical Care of Childbearing Families',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B320 and NURS B326; Corequisite: NURS B356 and NURS B358) In conjunction with NURS B358, this course blends practice/simulation laboratory experiences with clinical experiences in care settings where mothers, infants, children and family units receive care.',9,NULL),
	(721,N'NURS',N'B395',N'Global Healthcare Study Abroad',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B202 and NURS B312, or permission of the instructor) Provides students the opportunity to engage in global health fieldwork in an international service learning setting. Faculty collaborate with international partners to develop customized global healthcare immersion experiences.',9,NULL),
	(722,N'NURS',N'B399',N'Independent Study in Nursing',1,6,N'Standard Letter',N'This course is an advanced study of a particular theme or topic in the nursing through readings, research, and analysis. It is designed for students who have completed basic courses and who want to study specific topics that are not offered in the curriculum or extend learning of a topic from a course already completed (i.e., develop a poster or manuscript based on a scholarly paper). A contract of study is developed through readings, projects, papers, and/or seminars approved by instructor. Up to 3 credits may be contracted and repeated for a total of 6 credits. ',9,NULL),
	(723,N'NURS',N'B401',N'Health Care Delivery Systems',3,NULL,N'Standard Letter',N'{�PUBH B401} (Prerequisite: NURS B326 or PUBH B310 or RN licensure, or consent of instructor) Systems theory; health care delivery systems conceptualizes transitions from one level of care to another with emphasis on ethical and legal issues; technology; historical, political and economic aspects to meet the health care needs of the population. (Lecture 3 hours)',9,NULL),
	(724,N'NURS',N'B410',N'Leading in Organizations',3,NULL,N'Standard Letter',N'(Prerequisite: Acceptance to RN to BSN program or NURS B326 or permission of instructor) This course examines the organizational and care delivery models where nurses lead, manage, and follow. Human resource practices; legal, regulatory, and risk management functions; quality improvement and change management techniques; and delegation expectations of the nurse are examined. Students are introduced to organizational and leadership theories.  ',9,NULL),
	(725,N'NURS',N'B412',N'Care of Individuals with Mental and Addictive Disorders',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B320 and NURS B350; Pre or Co-requisite: NURS B360) This course focuses on the epidemiology and treatment of individuals with actue and chronic mental and addiction disorders across the lifespan. Bio-physical, genetic and environmental predisposition to these conditions are examined. Pharmacologic approaches are reviewed, with emphasis on maintaining drug therapy and alleviating side effects. Cognitive approaches to helping patients and families manage anxiety, fear, and self-doubt are addressed.',9,NULL),
	(726,N'NURS',N'B418',N'Community and Public Health Nursing',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B356 and NURS B358 for pre-licensure students; NURS B350 for all nursing students; Co-requisite) Primary prevention strategies for populations at risk are emphasized to promote and protect health and prevent disease across the life span. Local, state and national health policies, political and economic influences will be part of the analysis of community issues and activities. An inter-disciplinary, collaborative approach is taken in community assessment, decision-making, planning, implementation and evaluation throughout community health nursing practice. The role and functions of agencies that deliver public health, community-based is presented. These functions include communicable disease reporting, control and management, environmental monitoring, disaster preparedness and management, the care of vulnerable populations, and public education. Community assessment and agency coordination at the local, regional, and national level is discussed. Principles of epidemiology, surveillance, environmental influences on health, strategies for dealing with public health issues will be presented in caring for populations. The place for community based and public health nursing as part of a coordinated/dis-coordinated care system at the local, regional, and national level will be examined. National and state agencies such as the CDC, DHEC and American Red Cross will serve as exemplars for the care coordination. ',9,NULL),
	(727,N'NURS',N'B420',N'Trends and Issues in Nursing',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B356 and NURS B358 for pre-licensure students) Historical and present trends in nursing practice are taught in this course with a perspective on nursing education, genetic research, evidenced-based practice and complementary therapies (Lecture 3 hours).',9,NULL),
	(728,N'NURS',N'B422C',N'Clinical Care in Public and Community Health Settings',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B320, B326, and B350. Corequisite: NURS B412 and B418) In conjunction with NURS B412 and NURS B418, this clinical course focuses on experiential learning in community-based or public health settings. These settings serve primary and prevention care needs of school age, mental health, addictions, or other populations. A change management project that involves priority setting, delegation, policy making, budgeting, and/or measurement of community impact is introduced. Clinical experience may also include providing community-based education, care coordination, and managing resource capacity.',9,NULL),
	(729,N'NURS',N'B425',N'Adult Health Nursing II',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B412, B418, B422C) This course will present advanced concepts in the care of high acuity and critically ill adult and elderly patients often seen in the intensive care setting. Cases analyzed will deal with high acuity illnesses, multi-systems failure, trauma, field-based communications and medical transfers. Technology to monitor, evaluate, and sustain life will be reviewed. Emphasis will be placed on Interprofessional collaboration to optimize care in the high acuity adult as well as adult palliative care and end-of-life care. Students will build confidence in rapid responses to dynamic changes in patient conditions and response. The psycho-social-support aspects of assisting families through highly vulnerable situations will be refined.',9,NULL),
	(730,N'NURS',N'B425C',N'Clinical Care of High Acuity Adults & Elders',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B326, B326C, B412, B418 & B422C. Corequisite: NURS B425) Students will have exposure to adults and elders with high acuity needs. Clinical experiences will focus on the application of knowledge and skills related to the care of a high acuity adult or elder. Emphasis will be placed on application of the nursing process to manage care and reduce risks in this population, utilization of technology to monitor rapidly changing patient needs, plan and prioritize care, anticipate patient needs and contribute to interprofessional teams collaborating care for the high acuity adult or elder.',9,NULL),
	(731,N'NURS',N'B430C',N'Clinical Synthesis and Seminar',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B412, B418 and B422C) In this clinical course, students will have an opportunity to model program outcomes and strengthen their abilities to manage a client population throughout a shift, focusing on organizational, delegation, and time management skills. Priority setting and the ability to develop focus in delivering care to more than one client are emphasized. In the seminar setting, synthesis of clinical information linked to individuals, families, and communities will be reviewed. Role understanding and clinical functioning will be evaluated to meet entry-level practice expectations. Knowledge of patient education, discharge planning, team functions, and nursing skills will be demonstrated.',9,NULL),
	(732,N'NURS',N'B435',N'Professional Nursing Seminar',2,NULL,N'Standard Letter',N'(Prerequisite: NURS B412, B418, & B422C) Students will prepare a personalized career plan that is consistent with an intentional career focus. Documents needed to apply for licensure, jobs, and continuing education will be developed and refined. Interviewing skills needed for applying for jobs and graduate level education are rehearsed. The use of social media in job procurement is presented. Readiness for NCLEX-RN� and achievement of licensure will be emphasized.',9,NULL),
	(733,N'NURS',N'B450',N'Ethical Decision-Making, Legal Issues and Health Policy in Professional Nursing',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B202 or B301) This course examines legal and ethical issues in healthcare and how they influence health policy. Students study legal principles governing professional nursing practice and explore frameworks to support ethical decision-making across the continuum of care. The nurse''s role in healthcare policy development, implementation and analysis are explored, particularly as it relates to legal and ethical issues affecting practice. Students explore current legal/ethical issues and existing health policies, with an emphasis on how these issues impact access to, and delivery of healthcare services to vulnerable populations.',9,NULL),
	(734,N'NURS',N'B499',N'Special Topics in Professional Nursing Practice',1,3,N'Standard Letter',N'(Prerequisite: NURS B326 or B301 or consent of instructor) This course examines advanced concepts, emerging trends and issues, and evidenced-based practice changes in professional nursing practice. Variable hours between 1-3 credits, depending upon special topic. Topics may include complementary and alternative health practices, end-of-life and palliative care, working with special populations, and nursing theories. May be repeated under different topics.',9,NULL),
	(735,N'PEDU',N'B101',N'RAD Self-Defense for Women',1,NULL,N'Standard Letter',N'(Prerequisite: Instructor Permission) An introduction to the principles, techniques, and active practice of self-defense for women. ',10,NULL),
	(736,N'PEDU',N'B104',N'Personal Fitness and Weight Control',1,NULL,N'Standard Letter',N'Assessment of major fitness components and development of a personalized exercise program based on fundamental principles of exercise prescription. Weight management and dietary guidelines will be addressed.',10,NULL),
	(737,N'PEDU',N'B105',N'Weight Training',1,NULL,N'Standard Letter',N'An introduction to progressive resistance training and participation in a personalized strength training program with emphasis on proper technique and safety principles.',10,NULL),
	(738,N'PEDU',N'B107',N'Aerobic Fitness',1,NULL,N'Standard Letter',N'Participate in aerobic fitness activities designed to improve cardiovascular endurance. Includes aerobic fitness assessment along with individualized and group aerobic fitness training. ',10,NULL),
	(739,N'PEDU',N'B112',N'Basketball',1,NULL,N'Standard Letter',N'Fundamental skills of game performance. Strategy, rules, and basic offenses and defenses. ',10,NULL),
	(740,N'PEDU',N'B113',N'Bowling',1,NULL,N'Standard Letter',N'An Introduction to the fundamentals of bowling, with an emphasis on basic techniques in all facets of the game, as well as an understanding of terminology. ',10,NULL),
	(741,N'PEDU',N'B114',N'Golf',1,NULL,N'Standard Letter',N'Basic concepts and fundamentals of the golf swing will be emphasized. Grip, stance, posture, alignment, and ball position relative to the golf swing will be addressed. On-course instruction included.',10,NULL),
	(742,N'PEDU',N'B117',N'Karate',1,NULL,N'Standard Letter',N'Explore different martial arts styles with emphasis on basic hand strikes, kicks, blocks, stances, fighting strategy, martial art theory, history and selfdefense strategies. ',10,NULL),
	(743,N'PEDU',N'B119',N'Soccer',1,NULL,N'Standard Letter',N'Fundamental skills for game performance; history, rules, and game strategy.',10,NULL),
	(744,N'PEDU',N'B121',NULL,1,NULL,N'Standard Letter',N'Introduction to the game of tennis. All aspects of the game for new players including technical, tactical, physical and mental skills will be developed. The emphasis will be on helping students serve, rally and score and to build their knowledge and skill base. ',10,NULL),
	(745,N'PEDU',N'B136',N'Yoga I',1,NULL,N'Standard Letter',N'Explore the mind-body connection through participation in yoga poses, transitional movements, and progressive relaxation techniques. Build strength, flexibility, muscle tone, and mindfulness while improving one''s sense of well-being.',10,NULL),
	(746,N'PEDU',N'B137',N'Yoga II',1,NULL,N'Standard Letter',N'(Prerequisite: PEDU B136, or consent of instructor) This course is a continuation of the Yoga I, focusing on the understanding and practice of intermediate to advanced yoga asanas (postures), pranayama (breathing) and meditation technique, including an introduction to the chakras.',10,NULL),
	(747,N'PEDU',N'B142',N'Lifeguard Training',1,NULL,N'Standard Letter',N'(Prerequisite: Permission of the PEDU Program Coordinator) Students will develop proficiency in water safety skills. Successful completion of all course requirement leads to certification in American Red Cross Lifeguard Training, CPR, First Aid, and AED.',10,NULL),
	(748,N'PEDU',N'B147',N'Kayaking',1,NULL,N'Standard Letter',N'(Prerequisite: successful completion of deep water swim exam) Supervised calm water single kayak paddling. Emphasis on safety, equipment selection, basic paddle and kayak-handling techniques, fitness considerations, travel safety, rescue and survival techniques.',10,NULL),
	(749,N'PEDU',N'B148',N'Stand Up Paddle Boarding',1,NULL,N'Standard Letter',N'(Prerequisite: Must be a deep water swimmer.) A supervised calm water stand up paddling experience. Emphasis on safety, equipment selection, paddle and board-handling techniques, fitness, travel safety, rescue and survival techniques.',10,NULL),
	(750,N'PEDU',N'B153',N'Heartsaver CPR/First Aid/AED',1,NULL,N'Standard Letter',N'The study and practice of early emergency care procedures, including first aid; choking relief in adults, children, and infants; and what to do for sudden cardiac arrest in adults, children, and infants.',10,NULL);
INSERT INTO Courses (CourseID, CourseSubject, CourseNumber, CourseName, MinCredits, MaxCredits, GradeMode, CourseDesc, DepartmentID, LevelID) VALUES
	(751,N'PEDU',N'B189',N'Indoor Cycling',1,NULL,N'Standard Letter',N'An introduction to the basic fundaments of indoor cycling.  ',10,NULL),
	(752,N'PEDU',N'B202',N'Foundations of Coaching',2,NULL,N'Standard Letter',N'Explore coaching philosophies, coaching techniques, training fundamentals, risk management and group management strategies. Emphasis placed on coaching skills necessary for working with children. Includes practical experience and evaluation of coaching situations.',10,NULL),
	(753,N'PHIL',N'B102',N'Introduction to Philosophy',3,NULL,N'Standard Letter',N'An introduction to the main problems of philosophy and its methods of inquiry, analysis and criticism. Works of important philosophers will be read.  ',6,NULL),
	(754,N'PHIL',N'B110',N'Introduction to Formal Logic: Deduction & Inference',3,NULL,N'Standard Letter',N'This course is an introduction to deductive reasoning. The focus will be on the use of formal methods to construct and criticize actual arguments. Particular emphasis will be placed upon Aristotelian logic, sentential logic, and predicate logic. Student will develop skills in the development and analysis of syllogisms, Venn Diagrams, truth tables, and formal proofs.',6,NULL),
	(755,N'PHIL',N'B111',N'Introduction to Informal Logic: Reasoning & Analysis',3,NULL,N'Standard Letter',N'This course is an introduction to inductive reasoning. The focus will be on argumentation and argument analysis. Students will develop skills for: identifying argumentative language; determining the type of argument present; constructing argument maps; evaluating arguments in term of inductive standards; and identifying various informal fallacies.',6,NULL),
	(756,N'PHIL',N'B201',N'History of Ancient Philosophy',3,NULL,N'Standard Letter',N'An introduction to the development of philosophy in the ancient world through study of the works of representative philosophers. PHIL B202 may be taken prior to this course.',6,NULL),
	(757,N'PHIL',N'B202',NULL,3,NULL,N'Standard Letter',N'An introduction to the development of philosophic thought since the Renaissance through the study of the works of important philosophers. The chief emphasis is on the 17th and 18th centuries.',6,NULL),
	(758,N'PHIL',N'B211',N'Contemporary Moral Issues',3,NULL,N'Standard Letter',N'Moral issues confronting men and women in contemporary society. Topics will vary but may include discussion of problems related to abortion, drugs, euthanasia, war, social engineering and punishment of criminals.',6,NULL),
	(759,N'PHIL',N'B212',N'Philosophy of Human Nature',3,NULL,N'Standard Letter',N'This course investigates particular interpretations of human nature that have arisen within the history of ideas. Particular focus will be given to 1) analyzing the conflicting claims regarding human behavior that arise from such interpretations and 2) evaluating disagreements regarding the norms of conduct and social policy that develop from these different interpretations.',6,NULL),
	(760,N'PHIL',N'B302',N'American Philosophy',3,NULL,N'Standard Letter',N'The principal movements of philosophical thought from Colonial times to the present, with special emphasis on the 19th and 20th centuries. ',6,NULL),
	(761,N'PHIL',N'B303',N'Critical Social Theories',3,NULL,N'Standard Letter',N'This course is an introduction to the critical social theories that have developed since the late 19th century. Critical social thought in philosophy focuses on various socio-historical conditions in contemporary society, as well as on the sociocultural methods that are used to study them. Possible frameworks may include Marxism, Neo-Marxism, feminist philosophies, queer theory, critical race theory, and post-analytic philosophy. Social and cultural topics may include race, gender, global economic dynamics, Internet culture, and social media. ',6,NULL),
	(762,N'PHIL',N'B304',N'History of Analytic Philosophy',3,NULL,N'Standard Letter',N'This course is an introduction to analytic philosophy in the British and American philosophical traditions, emphasizing epistemology and the philosophy of language. Particular attention will be given to developments arising out of logical positivism and ordinary language philosophy.  ',6,NULL),
	(763,N'PHIL',N'B311',N'Ethics',3,NULL,N'Standard Letter',N'A study of the moral principles of conduct and the basic concepts underlying these principles, such as good, evil, right, wrong, justice, value, duty and obligation. The ethical works of influential philosophers are analyzed in terms of these concepts. ',6,NULL),
	(764,N'PHIL',N'B312',N'Bioethics',3,NULL,N'Standard Letter',N'The concepts of Person and Justice as they relate to biomedical sciences and technologies. ',6,NULL),
	(765,N'PHIL',N'B313',N'Philosophy of Art',3,NULL,N'Standard Letter',N'Philosophical problems relating to the arts, with emphasis on questions pertaining to aesthetic experience. ',6,NULL),
	(766,N'PHIL',N'B315',N'Philosophy of Technology',3,NULL,N'Standard Letter',N'This course will focus on the various philosophical questions and issues that arise from the technological opportunities and challenges of the 21st century. Philosophical topics surrounding technology will include those related to ethics, the philosophy of language, feminism, critical theory, and pragmatism. Possible topics regarding technology may include information technologies, robotics, AI, genetic engineering, cyborgs, climate change/geoengineering/the Anthropocene, and social media technologies. Finally, we investigate how technological developments stimulate philosophical thinking. ',6,NULL),
	(767,N'PHIL',N'B320',N'Existentialism',3,NULL,N'Standard Letter',N'An introduction to existentialist themes in contemporary philosophy, literature, psychology and religion. The writings of existentialists such as Kierkegaard, Nietzsche, Camus, Sartre, Buber, May and Binswanger will be read and discussed. ',6,NULL),
	(768,N'PHIL',N'B341',N'Environmental Ethics',3,NULL,N'Standard Letter',N'Examination of principles and arguments surrounding moral issues involving the environment. ',6,NULL),
	(769,N'PHIL',N'B363',N'Philosophy of Film',3,NULL,N'Standard Letter',N'{�IDST B363} (Prerequisite: ENGL B101/B105 and ENGL B102/B106) Interdisciplinary course with emphasis on topical study of film theory, the aesthetics of film as an art form, the social impact and relevance of film.',6,NULL),
	(770,N'PHIL',N'B397',N'Readings in Philosophy',3,6,N'Standard Letter',N'{�IDST B397} (Prerequisite: Junior standing and completion of General Education English and Humanities requirements) A systematic study of a primary source in philosophy having relevance to other disciplines. Can be conducted as a small course or as a tutorial. May be taken twice for credit. ',6,3),
	(771,N'PHIL',N'B398',N'Topics in Philosophy',3,NULL,N'Standard Letter',N'(Prerequisite: Specific prerequisites may vary; consult the instructor) Intensive study of selected themes, topics, currents of thoughts or interdisciplinary concerns. May be repeated under different topics.',6,NULL),
	(772,N'PHIL',N'B399',N'Independent Study in Philosophy',3,9,N'Standard Letter',N'(Prerequisite: Contract approval is required).',6,NULL),
	(773,N'PHYS',N'B101',N'The Physics of How Things Work I',3,NULL,N'Standard Letter',N'A practical introduction to physics and science in everyday life� from concrete examples to basic physical principles. ',11,NULL),
	(774,N'PHYS',N'B101L',N'The Physics of How Things Work I Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: PHYS B101) Experiments, exercises and demonstrations to accompany PHYS 101. ',11,NULL),
	(775,N'PHYS',N'B102',N'The Physics of How Things Work',3,NULL,N'Standard Letter',N'(Prerequisite: PHYS B101) A continuation of PHYS B101 with emphasis on electricity, magnetism, optics and atomic physics. ',11,NULL),
	(776,N'PHYS',N'B102L',N'The Physics of How Things Work II Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: PHYS B102) Experiments, exercises and demonstrations to accompany PHYS B102. ',11,NULL),
	(777,N'PHYS',N'B201',N'General Physics I',3,NULL,N'Standard Letter',N'(Prerequisite: MATH B115, or MATH B122, or equivalent) First part of an introductory course sequence. Topics include mechanics, wave motion, sound and heat. No previous background in physics is assumed.',11,NULL),
	(778,N'PHYS',N'B201L',N'General Physics I Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: PHYS B201). ',11,NULL),
	(779,N'PHYS',N'B202',N'General Physics II',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in PHYS B201) Continuation of PHYS B201; includes electromagnetism, relativity, quantum physics, atomic and nuclear physics. ',11,NULL),
	(780,N'PHYS',N'B202L',N'General Physics II Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: PHYS B202). ',11,NULL),
	(781,N'PHYS',N'B211',N'Essentials of Physics',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in MATH B141; Co-requisite: PHYS B211L or B201L) Classical mechanics and wave motion. Calculus-level course for students of science and engineering.',11,NULL),
	(782,N'PHYS',N'B211L',N'Essentials of Physics I Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: PHYS B211). ',11,NULL),
	(783,N'PHYS',N'B212',N'Essentials of Physics II',3,NULL,N'Standard Letter',N'(Prerequisite: a grade of C or better in PHYS B211 and MATH B142; Co-requisite: PHYS B212L) Classical electromagnetism and optics. ',11,NULL),
	(784,N'PHYS',N'B212L',N'Essentials of Physics II Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite or Co-requisite: PHYS B212). ',11,NULL),
	(785,N'PHYS',N'B398',N'Advanced Topics and Physics',1,4,N'Standard Letter',N'Study of a topic not otherwise available to student. May involve reading assignments, tutorial, lectures, papers, presentations, or field or laboratory study, determined in consultation with instructor. Repeatable to a maximum of 8 credit hours.',11,NULL),
	(786,N'POLI',N'B105',N'Introduction to Politics',3,NULL,N'Standard Letter',N'Concepts and problems involved in human relationship with governments, the nation-state and political change. ',6,NULL),
	(787,N'POLI',N'B111',N'Contoversies in American Politics',3,NULL,N'Standard Letter',N'An introduction to the analysis of key issues in contemporary American politics focusing on the arguments, the groups involved and the political factors that influence the outcome of the debate. ',6,NULL),
	(788,N'POLI',N'B201',N'American National Government',3,NULL,N'Standard Letter',N'The formation and development of the national government, its organization and powers. ',6,NULL),
	(789,N'POLI',N'B315',N'Internatioanl Relations',3,NULL,N'Standard Letter',N'International political behavior and institutions. ',6,NULL),
	(790,N'POLI',N'B370',N'Introduction to Public Administration',3,NULL,N'Standard Letter',N'A study of the basic principles and theory of administrative structure, responsibility and control in relation to policy making in the modern state. ',6,NULL),
	(791,N'POLI',N'B399A',N'Independent Study in Political Science',1,6,N'Standard Letter',N'(Prerequisite: Contract approval is required). ',6,NULL),
	(792,N'POLI',N'B399B',N'Independent Study in International Studies',1,6,N'Standard Letter',N'(Prerequisite: Contract approval is required). ',6,NULL),
	(793,N'POLI',N'B400',N'Selected Topics in Political Theory',3,NULL,N'Standard Letter',N'Intensive analysis of a particular topic or topics. To be identified by topic title each semester. May be repeated under different topics.  ',6,NULL),
	(794,N'PSYC',N'B101',N'Introduction to Psychology',3,NULL,N'Standard Letter',N'An introduction to and survey of the basic concepts and findings within the field of psychology.  ',6,NULL),
	(795,N'PSYC',N'B200',N'Research Methods in Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Basic principles and methodology.',6,NULL),
	(796,N'PSYC',N'B202',N'Psychological Statistics',3,NULL,N'Standard Letter',N'Introduction to statistical methods for psychology research.  ',6,NULL),
	(797,N'PSYC',N'B209',N'Human Growth and Development',3,NULL,N'Standard Letter',N'An Introduction to and survey of physical, mental, social, and emotional developmental patterns evidence from the prenatal period through senescence and death.',6,NULL),
	(798,N'PSYC',N'B210',N'Psychology of Adjustment',3,NULL,N'Standard Letter',N'Introduction to theories and processes underlying and facilitating human adjustment in the community, family and workplace.  ',6,NULL),
	(799,N'PSYC',N'B212',N'Applied Psychology',3,NULL,N'Standard Letter',N'Uses of psychological knowledge and techniques in practical contexts; clinical, school, industrial, consumer and environmental psychology.  ',6,NULL),
	(800,N'PSYC',N'B214',N'Human Sexual Behavior',3,NULL,N'Standard Letter',N'Psychological, physiological and sociological factors of human sexual behavior and attitudes.  ',6,NULL),
	(801,N'PSYC',N'B216',N'Psychology of Marriage',3,NULL,N'Standard Letter',N'The psychological, physiological and social characteristics of marriage.  ',6,NULL),
	(802,N'PSYC',N'B218',N'Psychology of Women',3,NULL,N'Standard Letter',N'Women''s experiences: childhood and adolescence, work, family, cultural images, adjustment and social change.  ',6,NULL),
	(803,N'PSYC',N'B220',N'Psychology of Religion',3,NULL,N'Standard Letter',N'The development of the religious consciousness and its various expressions, the psychological dynamics of growth and conversion, response to crisis and the relation of spiritual practice to health and wholeness.',6,NULL),
	(804,N'PSYC',N'B224',N'Industrial/Organizational Psychology',3,NULL,N'Standard Letter',N'Psychological techniques applied to various industrial and organizational problem areas, such as management and supervision, morale, efficiency, training, personnel selection and placement and relations among personnel.',6,NULL),
	(805,N'PSYC',N'B229',N'Sport Psychology',3,NULL,N'Standard Letter',N'The role of sports in socialization, personality development and competence, including: spectator-performer interactions, motivation, competition effects; and the application of psychological techniques to performance enhancement.',6,NULL),
	(806,N'PSYC',N'B302',N'Learning and Memory',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Research and applications concerning the acquisition of new behavior and knowledge, including accounts based on classical and instrumental conditioning and on information-processing models.',6,NULL),
	(807,N'PSYC',N'B303',N'Principles of Gerontology',3,NULL,N'Standard Letter',N'(�HMSV B303 & SOCY B303) An exploration of the interdisciplinary field of gerontology, including the fundamental concepts, theories, and issues involved in the study of aging from diverse perspectives.',6,NULL),
	(808,N'PSYC',N'B311',N'Abnormal Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Covers the classification, diagnosis, etiological theories and treatments of the major mental and emotional disorders.  ',6,NULL),
	(809,N'PSYC',N'B312',N'Abnormal Behavior in Children',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B311 or consent of instructor) Theories, description and assessment of child behavior problems and disorders; methods of intervention.',6,NULL),
	(810,N'PSYC',N'B321',N'Life Span Developmental Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Psychological development from conception to late adulthood. Topics include physical, cognitive and social processes associated with development at each stage of the life cycle.',6,NULL),
	(811,N'PSYC',N'B322',N'Psychology of Child Development',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Examination of development from conception through older childhood. Specific cognitive and social processes will be given in-depth study.',6,NULL),
	(812,N'PSYC',N'B328',N'Psychology of Aging',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Psychological, social and biological phenomena associated with maturity and aging.  ',6,NULL),
	(813,N'PSYC',N'B331',N'Social Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Introduction to theory and research in social psychology from a psychological viewpoint. Topics include social perception, social cognition, attitudes, interpersonal relationships, aggression, prosocial behavior and group processes.',6,NULL),
	(814,N'PSYC',N'B341',N'Personality Theory',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Covers the major theories and research on personality and the dynamics of human motivation.  ',6,NULL),
	(815,N'PSYC',N'B361',N'Biological Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) The neurochemical and neuroanatomical bases of behavior ranging from the reflex to schizophrenia. Satisfies 3-credit hour course requirement for Natural Science GE.',6,NULL),
	(816,N'PSYC',N'B380',N'Cultural Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) A global cultural perspective on human behavior exploring how culture influences our lives and the lives of others across the world. Topics may include cultural influences on development, mental health, cognition, personality and social behavior.  ',6,NULL),
	(817,N'PSYC',N'B399',N'Independent Study in Psychology',1,6,N'Standard Letter',N'(Prerequisite: Contract approval is required, and PSYC B101 and consent of instructor) Closely supervised project or research experience in psychology. May be repeated for up to six credit hours. Not for psychology major credit.',6,NULL),
	(818,N'PSYC',N'B401',N'Cognitive Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B302) Research and theories on sensory memory, attention, short-term and working memory, human learning and forgetting, imagery, long-term memory, speech perception, reading, language, thinking and problem solving and decision making.',6,NULL),
	(819,N'PSYC',N'B403',N'Working with Older Adults',3,NULL,N'Standard Letter',N'{�HMSV/SOCY B403} (Prerequisite: SOCY/PSYC/HMSV B303 or SOCY B313 or PSYC B328, or consent of instructor) Provides students with hands-on experience in fields serving the growing older adult population. This is a service-learning course with a significant experiential component. Students will spend time engaged directly with older adults, learning from practitioners working with and in service to older adults, supporting caregivers for older adults, and reflecting on their own perceptions of aging.  ',6,NULL),
	(820,N'PSYC',N'B404',N'Psychology Consumer Behavior',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Psychological Principles and concepts applied to advertising and selling, promotion, consumer attitudes, psychological measurement and prediction, and influence in consumer behavior. ',6,NULL),
	(821,N'PSYC',N'B406',N'History and Systems of Psychology',3,NULL,N'Standard Letter',N'(Prerequisite PSYC B101) This course covers systematic approaches to psychology and the history of psychology. ',6,NULL),
	(822,N'PSYC',N'B409',N'Positive Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101 and Junior or Senior standing) Research and theories on psychological well-being and happiness. Topics include subjective well-being, positive affect and emotions, flow, resilience, correlates of happiness, self-regulation, virtues and character, interpersonal relationships, and mindfulness.',6,3),
	(823,N'PSYC',N'B411',N'Introduction to Clinical Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B311 and B341 or consent of instructor) An introduction to the science and practice of clinical psychology. Application of psychological principles to the assessment and treatment of mental disorders and behavioral problems in human beings.',6,NULL),
	(824,N'PSYC',N'B413',N'Trauma & Recovery',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B311 or equivalent) This course will provide an overall theoretical basis for trauma assessment and intervention. Students will learn the overview of trauma & recovery from crime scene to therapy couch. Topics include legal, social, and behavioral concepts of trauma, trauma theory, treatment options, and stages of recovery.  ',6,NULL),
	(825,N'PSYC',N'B415',N'Community Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Community psychology explores the roles that individuals play in the formation, resilience, and well-being of communities and, in turn, examine how communities influence the individual.  ',6,NULL),
	(826,N'PSYC',N'B418',N'Psychology of Drug Use and Effects',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Overview of the physiology and psychological effects of psychoactive substances and of addictions.  Historical, societal, legal, medical, and economic factors on psychoactive substance use and abuse will be explored.  ',6,NULL),
	(827,N'PSYC',N'B425',N'Psychology and the Legal System',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) The role of psychologists in the legal system, psychological issues within the legal system, interpretations of victims and criminality, and treatment of offenders.',6,NULL),
	(828,N'PSYC',N'B441',N'Psychological Tests and Measurement',3,NULL,N'Standard Letter',N'(Prerequisite: STAT B201 or consent of instructor) Overview of the nature, design and application of psychological tests. Emphasis on test construction, the psychometric properties of psychological tests, intelligence and aptitude testing, objective and projective tests of personality and general issues in the application of tests.',6,NULL),
	(829,N'PSYC',N'B451',N'Sensation and Perception',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Processing of information from the environment. Physiological, physical, psychological and contextual determinants of perception.',6,NULL),
	(830,N'PSYC',N'B462',N'Psychology in Film',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) Application of knowledge from various areas of psychology to the study of film and portrayal of psychological concepts in film. ',6,NULL),
	(831,N'PSYC',N'B465',N'Health Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101) An introduction to the interdisciplinary subfield of psychology dedicated to promoting and maintaining health and preventing and treating illness. ',6,NULL),
	(832,N'PSYC',N'B490',N'Selected Topics in Psychology',3,NULL,N'Standard Letter',N'Course content varies and will be announced in the schedule of classes by topic title. May be repeated under different topics.  ',6,NULL),
	(833,N'PSYC',N'B494',N'Advanced Research Methods in Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B200 and [PSYC B202 or SOCY B220 or STAT B201]) This course provides an integration of research methods and statistical methods. Students will design and complete a psychology research project.   ',6,NULL),
	(834,N'PSYC',N'B495',N'Internship in Psychology',3,NULL,N'Standard Letter',N'(Prerequisite: Psychology Majors only, 15 hours of psychology, consent of instructor) Provides experience in a professional setting to facilitate integration of academic knowledge with real world. Minimum requirement of 150 service hours. ',6,NULL),
	(835,N'PSYC',N'B496',N'Internship in Psychology II',3,6,N'Standard Letter',N'(Prerequisite: Psychology Majors only, PSYC B495, and consent of instructor) Provides experience in a professional setting to facilitate integration of academic knowledge with real world. Required service hours: 150 - 300 (depending on credit hours).',6,NULL),
	(836,N'PSYC',N'B498',N'Advanced Independent Study',1,6,N'Standard Letter',N'(Prerequisite: 9 hours of psychology and consent of instructor) Closely supervised project or research experience in psychology. Approved contract required. May be repeated for up to six credits.',6,NULL),
	(837,N'PSYC',N'B499',N'Individual Research',3,NULL,N'Standard Letter',N'(Prerequisite: 15 hours of psychology and consent of instructor) Planning and execution of supervised research in psychology. Approved contract required.',6,NULL),
	(838,N'PUBH',N'B101',N'Basic Health',3,NULL,N'Standard Letter',N'This course is a basic health course in which students will learn about strategies to improve health. Nutrition, fitness, drugs, and sexuality are some of the topics discussed. Career opportunities within the health field will be explored.',10,NULL),
	(839,N'PUBH',N'B242',N'Nutrition',3,NULL,N'Standard Letter',N'{�HRTM B242} Introductory course on human nutrition. Includes principles of normal nutrition, basics of life cycle nutrition, relationship of nutrients to health and disease, and discussion of current issues.  ',10,NULL),
	(840,N'PUBH',N'B300',N'Transcultural Health',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B101 or SOCY B101 or consent of instructor) This course surveys the cultural and social dimensions of health and illness with emphasis on the development of cultural competence. Different populations are examined for the development of a personal understanding of the traditions and customs of their societies, providing a unique perspective on the implications for patient care. (Satisfies USCB General Education Global Citizenship and Multicultural Understanding Requirement).',10,NULL),
	(841,N'PUBH',N'B303',N'Health & Wellness Innovation: Creative Inquiry',3,NULL,N'Standard Letter',N'{�NURS B303} (Prerequisite: PUBH B310) The purpose of this course is to introduce and encourage health professional-driven innovation. This course equips students with an empathetic mindset to see healthcare and public health issues from the perspective of the person who is experiencing the challenge. Students will develop new and creative ways to improve health and well-being. ',10,NULL),
	(842,N'PUBH',N'B305',N'Spirituality, Health, and Health Professions',3,NULL,N'Standard Letter',N'(Prerequisite: NURS B202 or PUBH B310) Exploration of spirituality, its effect on health, and health professionals roles in the spiritual care of clients.  ',10,NULL),
	(843,N'PUBH',N'B310',N'Introduction to Public Health',3,NULL,N'Standard Letter',N'A broad-based overview of those processes that enable people to assume responsibility for health and wellness and the role of the public health professional.  ',10,NULL),
	(844,N'PUBH',N'B315',N'Health Promotion Across the Lifespan',3,NULL,N'Standard Letter',N'(Prerequisite: PSYC B209 or PSYC B321) The study of age as a determinant of health and disease outcomes across the lifespan with strategies to promote wellness.  ',10,NULL),
	(845,N'PUBH',N'B320',N'Chronic Disease and Risk Reduction',3,NULL,N'Standard Letter',N'(Prerequisite: BIOL B243 and BIOL B244, or equivalent coursework) The study of those diseases of long duration and slow progression and the means by which their societal burden can be reduced.',10,NULL),
	(846,N'PUBH',N'B321',N'Fundamentals of Occupational Health & Safety',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH B310) An introductory course covering major issues in occupational health and safety, with an emphasis on the identification, evaluation and control of physical, chemical, biological and behavioral factors often present in the workplace and pose a risk for illness, injury and death. As people typically work at least 40 hours per week for most of their adult lives, the workplace has the potential to significantly impact human health and wellbeing.',10,NULL),
	(847,N'PUBH',N'B322',N'Life-Cycle Nutrition',3,NULL,N'Standard Letter',N'(Prerequisite: HRTM/PUBH B242) This course examines the essentials of human nutrition and the modification of nutritional needs at different life stages, including pregnancy, lactation, infancy, childhood, adolescence, adulthood, and older adulthood.',10,NULL),
	(848,N'PUBH',N'B323',N'Introduction to Exercise and Sports Science',3,NULL,N'Standard Letter',N'(Prerequisite: BIOL B243 and BIOL B244) This course is designed to examine the disciplines in the broad field of exercise science. An overview of the knowledge and skills needed to become a certified personal trainer (CPT) will be provided.',10,NULL),
	(849,N'PUBH',N'B324',N'Food & Culture',3,NULL,N'Standard Letter',N'{�HRTM B360} Examines food and eating behaviors, diet, and nutrition from cross- cultural perspective. ',10,NULL),
	(850,N'PUBH',N'B325',N'Sports Nutrition',3,NULL,N'Standard Letter',N'{�HRTM B320} (Prerequisite: PUBH/HRTM B242) The study of the association between nutrition and exercise performance. Metabolism of carbohydrates, fats, proteins, vitamins, minerals and water and its effect on athletic training is emphasized. Nutrition assessment of athletes, how to measure body composition, and the use of and controversy over ergogenic aids are explored.  ',10,NULL),
	(851,N'PUBH',N'B328',N'Nutrition and Chronic Disease',3,NULL,N'Standard Letter',N'(Prerequisite: HRTM/PUBH B242) Explore the relationship of food, diet and lifestyle choices to the prevention and management of various chronic diseases. Main topic areas include type 2 diabetes, cardiovascular disease, digestive health, obesity and cancer.',10,NULL),
	(852,N'PUBH',N'B330',N'Principles of Epidemiology',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH B310) The study of the patterns, causes, and effects of health and disease. ',10,NULL),
	(853,N'PUBH',N'B340',N'Introduction to Environmental Health',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH B310) The study of environmental factors, be they physical, chemical, biological or behavioral that have the potential to adversely impact human and/or ecological health.',10,NULL),
	(854,N'PUBH',N'B350',N'Health Communication',3,NULL,N'Standard Letter',N'{�COMM B350} Examines the strategies of health communication in interpersonal, group, organizational, societal-cultural, political-economic, and historical contexts.  ',10,NULL),
	(855,N'PUBH',N'B360',N'Health Behavior and Education',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH B310) The study of the behavioral and social factors that influence health and disease. Models of health behavior theory will be presented. Methods for preparation of health education curricula will be discussed.',10,NULL),
	(856,N'PUBH',N'B370',N'Wellness in Health Promotion',3,NULL,N'Standard Letter',N'(Prerequisite: BIOL B243 and BIOL B244, or equivalent coursework; and HRTM B242) The study of the roles of nutrition, exercise, hygiene and rest in the prevention of disease and the achievement of optimal health.',10,NULL),
	(857,N'PUBH',N'B380',N'Research Methods in Public Health',3,NULL,N'Standard Letter',N'(Prerequisite: STAT B201 and PUBH B310) A course designed to impart knowledge and skills regarding the design, implementation, analysis and interpretation of research in the field of public health.',10,NULL),
	(858,N'PUBH',N'B390',N'Field Experience in Public Health',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH B310 and Junior Status) A period of introductory work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where public health principles are applied.',10,3),
	(859,N'PUBH',N'B395',N'Global Healthcare Study Abroad',3,NULL,N'Standard Letter',N'(Prerequisite: Permission of the instructor) Provides students the opportunity to engage in global health fieldwork in an international service learning setting. Faculty collaborate with international partners to develop customized global healthcare immersion experiences.',10,NULL),
	(860,N'PUBH',N'B399',N'Independent Study in Public Health',1,4,N'Standard Letter',N'(Prerequisite: PUBH B310 or consent of instructor) This course examines concepts, emerging trends, issues, and evidence-based practice changes in public health practice. Variable hours between 1 to 4 credits, depending on topic which may include complementary and alternative health practices, working with special populations, emerging public health needs, etc. Students may re-take one additional time for a maximum of 8 credits.  ',10,NULL),
	(861,N'PUBH',N'B401',N'Health Care Delivery Systems',3,NULL,N'Standard Letter',N'{� NURS B401} (Prerequisite: PUBH 310 or NURSB326 or RN Licensure or consent of the instructor.) Systems theory, health care delivery systems conceptualize transitions from one level of care to another, with emphasis on ethical and legal issues; technology; historical, political, economic aspects to meet the health care needs of the population.',10,NULL),
	(862,N'PUBH',N'B410',N'Examining Health Inequalities',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH B310) This course is designed to examine health disparities and associated social determinants of health in the U.S. Also included is an exploration of multi-level intervention strategies for reducing health disparities.',10,NULL),
	(863,N'PUBH',N'B420',N'Leadership and Management in Public Health',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH B310) This course is designed to enhance leadership and management skills needed to design, implement and evaluate public health programs.',10,NULL),
	(864,N'PUBH',N'B423',N'Business & Practice of Personal Training',3,NULL,N'Standard Letter',N'(Prerequisite: Grade of B or better in PUBH B323) The continuation of PUBH B323, this practical course surveys the skills and knowledge required for success in the field of personal training. Following National Academy of Sports Medicine guidelines, the kinesiology and physiology of human performance and the effective development of a personal training enterprise are investigated. ',10,NULL),
	(865,N'PUBH',N'B431',N'Nutrition and Metabolism',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH/HRTM B242, BIOL B110, and a 3-4 credit hour CHEM course) Examines the physiology and metabolism of micro and macro nutrients, and how principles of nutrition impact metabolic regulation. ',10,NULL),
	(866,N'PUBH',N'B432',N'Public Health Nutrition Policy',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH/HRTM B242) Impact of nutrition policy on the public�s health is reviewed.  This course examines the complex, multifaceted range of programs and services dedicated to bettering the population�s health through nutrition. Considers policymaking, assessment and intervention methods, special populations and food security. ',10,NULL),
	(867,N'PUBH',N'B450',N'Public Health Program Development',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH B310) A study of methods used to develop effective public health and education programs which help enable individuals prevent, delay and treat disease. ',10,NULL),
	(868,N'PUBH',N'B460',N'Public Health Program Evaluation',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH B450) A study of evaluation methods used to assess the potential impacts of public health programs. ',10,NULL),
	(869,N'PUBH',N'B461',N'Writing in the Health Professions',3,NULL,N'Standard Letter',N'(Prerequisite: PUBH B310) Preparation for and practice in types of writing important to those working within the health care and public health industry, from brief letters to formal articles and reports. ',10,NULL),
	(870,N'PUBH',N'B480',N'Internship in Public Health',4,NULL,N'Standard Letter',N'(Prerequisite: PUBH B450; Co-requisite: PUBH B460) A period of work-related education that allows students to reinforce classroom learning while gaining practical experience in a supervised setting where public health principles are applied.',10,NULL),
	(871,N'PUBH',N'B490',N'Senior Seminar in Public Health',2,NULL,N'Standard Letter',N'(Prerequisite: PUBH B310) A capstone course that summarizes the experiences of the public health major and prepares students for employment and/or graduate study. ',10,NULL),
	(872,N'PUBH',N'B499',N'Special Topics in Public Health',1,4,N'Standard Letter',N'(Prerequisite: PUBH B310 or consent of instructor) This course examines advanced concepts, emerging trends and issues, and evidence-based practice changes in public health practice. Variable hours between 1 to 4credits, depending on special topic. Topics may include complementary and alternative health practices, working with special populations, emerging public health needs, etc. Students may re-take one additional time for a maximum of 8 credits. ',10,NULL),
