	(939,N'SPAN',N'B407',N'Literary Tendencies and Masterpieces of Spanish America II',3,NULL,N'Standard Letter',N'(Prerequisite: SPAN B312 or consent of instructor) A survey of the masterworks and literary tendencies of Spanish America from Independence to present day. Taught in Spanish. ',6,NULL),
	(940,N'SPAN',N'B417',N'Advanced Spanish for Business and The Professions',3,NULL,N'Standard Letter',N'(Prerequisite: SPAN B316 or consent of instructor) Vocabulary, concepts and oral/written skills necessary to communicate effectively in the social, cultural, or economic infrastructure of Hispanic countries. Introduction to the use of technology for the acquisition and processing of materials relevant to students� professional goals. Taught in Spanish.',6,NULL),
	(941,N'SPAN',N'B499',N'Senior Seminar in Spanish',3,NULL,N'Standard Letter',N'(Prerequisite: Placement at 300 level on Phase II placement exam, grade of �C� or better in at least one cultural history course (SPAN B400, B401, B402 or B403) and in at least one literature course (SPAN B404, B405, B406, or B407), or consent of instructor) A special seminar devoted to the in-depth study of selected topics in Hispanic literature, culture, or language. Required for the intensive major in Spanish. Taught in Spanish. ',6,NULL),
	(942,N'SPRT',N'B201',N'Introduction to Sport Management',3,NULL,N'Standard Letter',N'This course introduces the student to the sport management profession. Industry employment opportunities along with requisite professional skills are reviewed. ',5,NULL),
	(943,N'SPRT',N'B440',N'Business & Finance in Sport Management',3,NULL,N'Standard Letter',N'(Prerequisite: HRTM B201 or consent of instructor) This comprehensive course focuses on methods and procedures as they apply to the economics of sport. Areas such as cost analysis, purchasing, budgeting and what a franchise means to a municipality will be examined. ',5,NULL),
	(944,N'SPRT',N'B450',N'Sport Marketing',3,NULL,N'Standard Letter',N'This comprehensive course focuses on methods and procedures as they apply to the marketing of sport products. This course will provide future sport managers with a deeper understanding of how sport products are marketed in today�s economic climate, and will examine how sport and sport events are used to effectively market non-sport products. ',5,NULL),
	(945,N'STAT',N'B110',N'Introduction to Descriptive Statistics',3,NULL,N'Standard Letter',N'Computational and graphical techniques for organizing and presenting statistical data. Sample mean and sample variance, cross tabulation of categorical data, correlation and simple linear regression, quality control charts, statistical software. ',8,NULL),
	(946,N'STAT',N'B201',N'Elementary Statistics',3,NULL,N'Standard Letter',N'(Prerequisite: MATH B101 or higher or consent of instructor) An introductory course in the fundamentals of modern statistical methods. Topics include descriptive statistics, normal distributions, random sampling, statistical studies and ethics, probability, confidence intervals, tests of hypothesis, simple linear regression and correlation.',7,NULL),
	(947,N'STAT',N'B202',N'Elementary Statistics Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite: or Co-requisite: STAT B201) Experiments which illustrate important concepts of elementary statistics. Two laboratory hours per week. ',8,NULL),
	(948,N'STAT',N'B210',N'Elementary Statistics II',3,NULL,N'Standard Letter',N'(Prerequisite: STAT B201 or consent of instructor) A second course in statistics for students requiring knowledge of advanced procedures for descriptive and inferential statistics. Topics include assessing normality, modeling nonlinear data, conditions and assumptions for inference, and application of multiple inference techniques. Other topics chosen from: statistical quality control, random variables, binomial and geometric distributions, sampling and simulation, and non-parametric tests.',8,NULL),
	(949,N'STAT',N'B240',N'Fundamentals of Probability & Statistics',3,NULL,N'Standard Letter',N'(Prerequisite: MATH B141) Categorical and quantitative data; marginal and conditional distributions; normal model; association and correlation; linear regression; randomness and probability; sampling distribution models; confidence intervals and hypothesis tests; two-sample z-Test; two=sample tTest; the paired t-Test.',7,NULL),
	(950,N'STAT',N'B340',N'Introduction to Probabilty and Statistics',3,NULL,N'Standard Letter',N'(Prerequisite: MATH B240 or consent.) Set theory; distributions of both discrete and continuous random variables; moments (including moment generating and characteristic functions); limit theorems; multivariate distributions including marginal and conditional distributions; confidence intervals and hypothesis tests. ',7,NULL),
	(951,N'THEA',N'B170',N'Fundamentals of Acting',3,NULL,N'Standard Letter',N'The techniques of body and voice control; improvisations; interpretation of characters: characterization applied in scenes. Appropriate for students from any discipline. ',4,NULL),
	(952,N'THEA',N'B200',N'Understanding and Appreciation of Theatre',3,NULL,N'Standard Letter',N'An introduction to the understanding and appreciation of theatrical experience. Attendance at theatrical performances required. Appropriate for students from any discipline.',4,NULL),
	(953,N'THEA',N'B201',N'Introduction to Script Analysis',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 and B102, or equivalent) In this course, students will apply research and analysis skills to dramatic texts with an eye toward serving theatrical productions. ',4,NULL),
	(954,N'THEA',N'B220',N'Theatre Laboratory',1,NULL,N'Standard Letter',N'(Prerequisite: Instructor consent) Supervised participation in theater production. No formal class meetings. May be repeated for up to 8 credits. ',4,NULL),
	(955,N'THEA',N'B301',N'Theater History I',3,NULL,N'Standard Letter',N'{� ENGL B301} (Prerequisite: ENGL B101 and B102, or equivalent). A study of the development of Western theatrical texts and practices including playwriting, acting, and design from ancient Greece to 1800. ',4,NULL),
	(956,N'THEA',N'B302',N'Theatre History II',3,NULL,N'Standard Letter',N'{� ENGL B302} (Prerequisite: ENGL B101 and B102, or equivalent). A study of the development of Western theatrical texts and practices including playwriting, acting, directing, and design from 1800 to the present. ',4,NULL),
	(957,N'THEA',N'B303',N'Asian Theaters',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher) A survey of the theatrical genres and practices of Japan, China, Indonesia, and India.',4,NULL),
	(958,N'THEA',N'B310',N'Reading and Performing Shakespeare',3,NULL,N'Standard Letter',N'(Prerequisite: ENGL B101 or B105, and ENGL B102 or B106, each with a C or higher). A course about how people read and perform Shakespeare in which students read and perform Shakespeare. ',4,NULL),
	(959,N'THEA',N'B322',N'Playwriting',3,NULL,N'Standard Letter',N'{� ENGL B322} (Prerequisite: Junior level or consent of instructor) A workshop approach to playwriting that culminates in each student creating a production-ready one-act play. May be repeated with consent of instructor for a maximum of 6 credit hours. ',4,3),
	(960,N'THEA',N'B333',N'Directing',3,NULL,N'Standard Letter',N'(Prerequisite: THEA B170). An introduction to the history, principles, and practices of the art of stage direction including the selection, casting, and rehearsing of scenes to be presented in class.',4,NULL),
	(961,N'THEA',N'B340',N'Oral Interpretation of Literature',3,NULL,N'Standard Letter',N'{�COMM B340} A course designed to give an understanding of the principles involved in extracting meaning from the printed page and the oral presentation of that meaning in a lucid and stimulating manner.',4,NULL),
	(962,N'THEA',N'B341',N'Performance of Caring',3,NULL,N'Standard Letter',N'{�NURS B341} (Prerequisite: SOCY B101 or PSYC B101) The class aims to train students to act as Simulated Participants (SP) in the Nursing Simulation lab as patients and supporting roles (such as patient family members) in dynamic, realistic simulated healthcare experiences. These experiences help train future nurses in a lifelike way.',4,NULL),
	(963,N'THEA',N'B370',N'Intermediate Acting',3,NULL,N'Standard Letter',N'(Prerequisite: THEA B170) A continuation of THEA B170. ',4,NULL),
	(964,N'THEA',N'B382',N'Theater for Young Audiences',3,NULL,N'Standard Letter',N'(Prerequisite: THEA B170 or instructor permission) Methods for creating theater for youth. A children''s play will be produced and performed.  ',4,NULL),
	(965,N'THEA',N'B399',N'Independent Study in Theatre',3,6,N'Standard Letter',N'(Prerequisite: Contract approval is required, and Junior or Senior standing, and cumulative grade point average of 2.50 or higher)',4,3),
	(966,N'THEA',N'B410',N'Introduction to Performance Studies',3,NULL,N'Standard Letter',N'(Prerequisite: Junior standing or consent of instructor) An introduction to the field of performance studies including a history of the field, theories of performance and a broad look at the different behaviors and cultural artifacts performance studies scholars examine. ',4,3),
	(967,N'THEA',N'B430',N'Performing Shakespeare',3,NULL,N'Standard Letter',N'(Prerequisite: THEA B170) This class helps students develop a mastery of methods that enable one to perform the works of Shakespeare with confidence and competence.',4,NULL),
	(968,N'THEA',N'B439',N'Topics in Theater & Performance',3,NULL,N'Standard Letter',N'(Prerequisite: Sophomore Standing) Intensive study of selected practices, topics, currents of thought or interdisciplinary concerns. May be repeated for credit under a different topic. ',4,2),
	(969,N'THEA',N'B466',N'Theater Internship',1,6,N'Standard Letter',N'(Prerequisite: Consent of instructor) This course provides a structured but flexible opportunity for students to earn course credit for an internship with a professional, community, or educational theater organization outside the university. ',4,NULL),
	(970,N'THEA',N'B472',N'Cinema',3,NULL,N'Standard Letter',N'{�ENGL 472} (Prerequisite: ENGL B101 and ENGL B102) An investigation into the aesthetics of cinema. This course will also focus on the major genres. ',4,NULL),
	(971,N'THEA',N'B472L',N'Cinema Laboratory',0,NULL,N'Standard Letter',N'{�ENGL B472L} Required viewing for THEA B472. ',4,NULL),
	(972,N'THEA',N'B481',N'History of Cinema',3,NULL,N'Standard Letter',N'Survey of the international cinema from 1945 to the present. ',4,NULL),
	(973,N'UNIV',N'B101',N'Student in the University',3,NULL,N'Standard Letter',N'(Prerequisite: Freshman Standing or New USCB Student) The purposes of higher education and potential roles of the student within the university. Open to freshmen. Also open to other undergraduate students in their first semester of enrollment. ',6,1),
	(974,N'UNIV',N'B102',N'Well-Being in the University',1,NULL,N'Standard Letter',N'Well-Being in the University is designed to help first-year students who had experienced academic difficulties in their first semester better understand how their overall well-being impacts their success in college. Using a strengths-based approach, this course provides a general overview of the dimensions of wellness, helps students explore how their overall well-being effects their college success, and how they can use their strengths to overcome barriers to success in college.',6,NULL),
	(975,N'UNIV',N'B150',N'Pre-Nursing Student in the University',1,NULL,N'Standard Letter',N'University 150 is designed to help first-year pre-nursing students understand and adjust to the demands of the nursing major, acquire essential academic success skills to be successful, and better understand the nursing field as well as adjacent vocations.  ',6,NULL),
	(976,N'UNIV',N'B200',N'Lowcountry Studies Honors Seminar',1,NULL,N'Standard Letter',N'This seminar will be an introduction to topics, information, reading, and class field trips to reflect the Lowcountry Studies Honors'' experience in the first year of the program. Topics covered will include common readings, discussion of current topics or current events, and professional development of the student. Course can be taken for credit up to two semesters. ',6,NULL),
	(977,N'UNIV',N'B250',N'Career and Life Planning',1,NULL,N'Standard Letter',N'This course will aid in development of career and life-planning skills through exposure to self-assessment, occupational information, job search techniques, professional literature, experiential education, values clarification, and career ladder strategies. ',6,NULL),
	(978,N'UNIV',N'B401',N'Graduation with Leadership Distinction Captstone',1,NULL,N'Pass/Fail',N'(Prerequisite: Junior or Senior standing) Integration of a student''s program of study and "Students Connected" coursework. Course includes portfolio development, professional presentation, and transition into graduate school and/or employment. ',6,3),
	(979,N'UNIV',N'B491',N'Leadership in Practice',1,NULL,N'Standard Letter',N'(Prerequisite: By invitation only, following competitive application process) This course explores the practice of leadership and engages outstanding students in an active dialogue about the challenges of being a leader within the university context and beyond.',6,NULL),
