/****** CREATE TABLES ******/
CREATE TABLE [Departments] (
  [DepartmentID] INT IDENTITY(1,1) NOT NULL,
  [DepartmentName] VARCHAR(50),
  [DepartmentAbbr] VARCHAR(5),
  PRIMARY KEY ([DepartmentID])
);

CREATE TABLE [Students] (
  [StudentID] INT IDENTITY(1,1) NOT NULL,
  [VIPID] VARCHAR(10),
  [USCID] VARCHAR(10),
  [ClassStanding] VARCHAR(20),
  [Major] VARCHAR(10),
  [AcademicStanding] VARCHAR(20),
  [FirstName] VARCHAR(50),
  [LastName] VARCHAR(50),
  PRIMARY KEY ([StudentID])
);

CREATE TABLE [Professors] (
  [ProfessorID] INT IDENTITY(1,1) NOT NULL,
  [FirstName] VARCHAR(50),
  [LastName] VARCHAR(50),
  PRIMARY KEY ([ProfessorID])
);

CREATE TABLE [Levels] (
  [LevelID] INT IDENTITY(1,1) NOT NULL,
  [LevelDescription] VARCHAR(15),
  PRIMARY KEY ([LevelID])
);

CREATE TABLE [Courses] (
  [CourseID] INT IDENTITY(1,1) NOT NULL,
  [CourseSubject] VARCHAR(10),
  [CourseNumber] VARCHAR(10),
  [CourseName] VARCHAR(100),
  [MinCredits] INT,
  [MaxCredits] INT,
  [GradeMode] VARCHAR(50),
  [CourseDesc] VARCHAR(1500),
  [DepartmentID] INT,
  [LevelID] INT,
  PRIMARY KEY ([CourseID]),
  CONSTRAINT [FK_Courses.DepartmentID]
    FOREIGN KEY ([DepartmentID])
      REFERENCES [Departments]([DepartmentID]),
  CONSTRAINT [FK_Courses.LevelID]
    FOREIGN KEY ([LevelID])
      REFERENCES [Levels]([LevelID])
);

CREATE TABLE [Campuses] (
  [CampusID] INT IDENTITY(1,1) NOT NULL,
  [CampusName] VARCHAR(50),
  [Address] VARCHAR(50),
  [City] VARCHAR(50),
  [State] CHAR(2),
  [Zip] VARCHAR(10),
  PRIMARY KEY ([CampusID])
);

CREATE TABLE [Buildings] (
  [BuildingID] INT IDENTITY(1,1) NOT NULL,
  [BuildingAbbr] VARCHAR(20),
  [CampusID] INT,
  PRIMARY KEY ([BuildingID]),
  CONSTRAINT [FK_Buildings.CampusID]
    FOREIGN KEY ([CampusID])
      REFERENCES [Campuses]([CampusID])
);

CREATE TABLE [Rooms] (
  [RoomID] INT IDENTITY(1,1) NOT NULL,
  [RoomNumber] VARCHAR(10),
  [BuildingID] INT,
  PRIMARY KEY ([RoomID]),
  CONSTRAINT [FK_Rooms.BuildingID]
    FOREIGN KEY ([BuildingID])
      REFERENCES [Buildings]([BuildingID])
);

CREATE TABLE [AcademicTerms] (
  [TermID] INT IDENTITY(1,1) NOT NULL,
  [Semester] VARCHAR(20),
  [Year] VARCHAR(5),
  [TermType] VARCHAR(50),
  [StartDate] DATETIME,
  [EndDate] DATETIME,
  PRIMARY KEY ([TermID])
);

CREATE TABLE [CourseOfferings] (
  [CourseOfferingID] INT IDENTITY(1,1) NOT NULL,
  [CourseSubject] VARCHAR(10),
  [CourseNumber] VARCHAR(10),
  [CRN] VARCHAR(10),
  [Days] VARCHAR(10),
  [Time] VARCHAR(20),
  [CourseType] VARCHAR(15),
  [MaxEnrollment] INT,
  [StudentsEnrolled] INT,
  [CourseID] INT,
  [TermID] INT,
  [RoomID] INT,
  [ProfessorID] INT,
  PRIMARY KEY ([CourseOfferingID]),
  CONSTRAINT [FK_CourseOfferings.ProfessorID]
    FOREIGN KEY ([ProfessorID])
      REFERENCES [Professors]([ProfessorID]),
  CONSTRAINT [FK_CourseOfferings.CourseID]
    FOREIGN KEY ([CourseID])
      REFERENCES [Courses]([CourseID]),
  CONSTRAINT [FK_CourseOfferings.RoomID]
    FOREIGN KEY ([RoomID])
      REFERENCES [Rooms]([RoomID]),
  CONSTRAINT [FK_CourseOfferings.TermID]
    FOREIGN KEY ([TermID])
      REFERENCES [AcademicTerms]([TermID])
);

CREATE TABLE [EnrolledCourses] (
  [EnrolledCourseID] INT IDENTITY(1,1) NOT NULL,
  [Status] VARCHAR(20),
  [StudentID] INT,
  [CourseOfferingID] INT,
  PRIMARY KEY ([EnrolledCourseID]),
  CONSTRAINT [FK_EnrolledCourses.StudentID]
    FOREIGN KEY ([StudentID])
      REFERENCES [Students]([StudentID]),
  CONSTRAINT [FK_EnrolledCourses.CourseOfferingID]
    FOREIGN KEY ([CourseOfferingID])
      REFERENCES [CourseOfferings]([CourseOfferingID])
);

CREATE TABLE [RequiredCourses] (
  [RequiredCourseID] INT IDENTITY(1,1) NOT NULL,
  [CourseID] INT,
  [Major] VARCHAR(25),
  PRIMARY KEY ([RequiredCourseID]),
  CONSTRAINT [FK_RequiredCourses.CourseID]
    FOREIGN KEY ([CourseID])
      REFERENCES [Courses]([CourseID])
);

CREATE TABLE [CoursePrerequisites] (
  [PrerequisiteID] INT IDENTITY(1,1) NOT NULL,
  [PrereqFor] INT,
  [PrereqIs] INT,
  PRIMARY KEY ([PrerequisiteID]),
  CONSTRAINT [FK_CoursePrerequisites.PrereqIs]
    FOREIGN KEY ([PrereqIs])
      REFERENCES [Courses]([CourseID]),
  CONSTRAINT [FK_CoursePrerequisites.PrereqFor]
    FOREIGN KEY ([PrereqFor])
      REFERENCES [Courses]([CourseID])
);

CREATE TABLE [Grades] (
  [GradeID] INT IDENTITY(1,1) NOT NULL,
  [GradeLetter] VARCHAR(3),
  [GradePoints] NUMERIC(2,1),
  PRIMARY KEY ([GradeID])
);

CREATE TABLE [StudentGrades] (
  [StudentGradeID] INT IDENTITY(1,1) NOT NULL,
  [EnrolledCourseID] INT,
  [GradeLetter] VARCHAR(3),
  PRIMARY KEY ([StudentGradeID]),
  CONSTRAINT [FK_StudentGrades.EnrolledCourseID]
    FOREIGN KEY ([EnrolledCourseID])
      REFERENCES [EnrolledCourses]([EnrolledCourseID])
);

CREATE TABLE [F2FCourseEvals] (
  [F2FCourseEvalID] INT IDENTITY(1,1) NOT NULL,
  [StudentGradeID] INT,
  [Q1] INT,
  [Q2] INT,
  [Q3] INT,
  [Q4] INT,
  [Q5] INT,
  [Q6] INT,
  [Q7] INT,
  [Q8] INT,
  [Q9] INT,
  [Q10] INT,
  [Q11] INT,
  [Q12] INT,
  [Q13] INT,
  [Q14] INT,
  PRIMARY KEY ([F2FCourseEvalID]),
  CONSTRAINT [FK_F2FCourseEvals.StudentGradeID]
    FOREIGN KEY ([StudentGradeID])
      REFERENCES [StudentGrades]([StudentGradeID])
);

CREATE TABLE [OnlineCourseEvals] (
  [OnlineCourseEvalID] INT IDENTITY(1,1) NOT NULL,
  [StudentGradeID] INT,
  [Q1] INT,
  [Q2] INT,
  [Q3] INT,
  [Q4] INT,
  [Q5] INT,
  [Q6] INT,
  [Q7] INT,
  [Q8] INT,
  [Q9] INT,
  [Q10] INT,
  [Q11] INT,
  [Q12] INT,
  [Q13] INT,
  [Q14] INT,
  [Q15] INT,
  [Q16] INT,
  [Q17] INT,
  [Q18] INT,
  [Q19] INT,
  PRIMARY KEY ([OnlineCourseEvalID]),
  CONSTRAINT [FK_OnlineCourseEvals.StudentGradeID]
    FOREIGN KEY ([StudentGradeID])
      REFERENCES [StudentGrades]([StudentGradeID])
);

CREATE TABLE [F2FCourseEvalDescriptions] (
  [F2FCourseEvalDescID] INT IDENTITY(1,1) NOT NULL,
  [QuestionNumber] VARCHAR(3),
  [QuestionDescription] VARCHAR(500),
  PRIMARY KEY ([F2FCourseEvalDescID])
);

CREATE TABLE [OnlineCourseEvalDescriptions] (
  [OnlineCourseEvalDescID] INT IDENTITY(1,1) NOT NULL,
  [QuestionNumber] VARCHAR(3),
  [QuestionDescription] VARCHAR(500),
  PRIMARY KEY ([OnlineCourseEvalDescID])
);

