/****** ADD ADDITIONAL CHECK CONSTRAINTS ******/
ALTER TABLE AcademicTerms
ADD CONSTRAINT CHK_AcademicTerms CHECK (
	TermType = 'Full' OR
	TermType = '1st Half Term' OR
	TermType = '2nd Half Term' OR
	TermType = 'May Term' OR
	Semester = 'Summer' OR
	Semester = 'Fall' OR
	Semester = 'Spring'
)

ALTER TABLE StudentGrades
ADD CONSTRAINT CHK_StudentGrades CHECK (
	GradeLetter = 'A' OR
	GradeLetter = 'B+' OR
	GradeLetter = 'B' OR
	GradeLetter = 'C+' OR
	GradeLetter = 'C' OR
	GradeLetter = 'D+' OR
	GradeLetter = 'D' OR
	GradeLetter = 'F' OR
	GradeLetter = 'W' OR
	GradeLetter = 'WF' OR
	GradeLetter = 'I' OR
	GradeLetter = 'P'
)